DROP TABLE IF EXISTS `client`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `client` (
  `client_id` bigint(20) unsigned NOT NULL COMMENT 'Internal client identifier used for reference purpose throughout the client ops database',
  `client_name` varchar(256) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Business name of client',
  `status_id` bigint(20) unsigned NOT NULL COMMENT 'Dropwdown via lookup table. Active, Terminated, In Progress. Active means the Client is an active Client of WW and has been published. Terminated means the Client was once serviced by WW but no longer has an active contract. In Progress means the Client h',
  `account_type_id` bigint(20) unsigned DEFAULT NULL COMMENT 'Dropwdown via lookup table. Profile Class of the Client: Health Plan, Strategic, Regional, Plan Sponsor.',
  `effective_start_date` date DEFAULT NULL COMMENT 'Date on which the client becomes active',
  `effective_end_date` date DEFAULT NULL COMMENT 'Date on which the client is terminated',
  `active` bit(1) NOT NULL DEFAULT b'1' COMMENT '1 - Record Active. 0 - Record Inactive/Deleted',
  `created_by` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `created_date` datetime NOT NULL,
  `modified_by` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `modified_date` datetime NOT NULL,
  PRIMARY KEY (`client_id`),
  KEY `fk_client_status_id_idx` (`status_id`),
  KEY `fk_client_account_type_id_idx` (`account_type_id`),
  CONSTRAINT `fk_client_account_type_id` FOREIGN KEY (`account_type_id`) REFERENCES `lookup` (`lookup_id`),
  CONSTRAINT `fk_client_status_id` FOREIGN KEY (`status_id`) REFERENCES `lookup` (`lookup_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Client/Organization related demographic information';
/*!40101 SET character_set_client = @saved_cs_client */;

