--
-- Table structure for table `eligibility_data`
--

DROP TABLE IF EXISTS `eligibility_data`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `eligibility_data` (
  `eligibility_data_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Internal eligibility data identifier used for reference purpose throughout the client exp database',
  `file_id` bigint(20) unsigned DEFAULT NULL COMMENT 'The identifier of the last file in which this member record was received.',
  `eligibility_file_type_id` bigint(20) unsigned DEFAULT NULL COMMENT 'Dropdown via eligibility_file_type table. Type of eligibility file that the Client will submit: Complete, Simplified. Ex: Complete, Simplified, Custom etc.',
  `client_id` bigint(20) unsigned NOT NULL COMMENT 'Unique client id.Generated by client ops to track the Client across systems',
  `account_id` varchar(5) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Account ID identifies the eligibility group the file relates to within the client universe, and will be provided to the client during account setup in client ops database',
  `member_id` varchar(130) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Unique member ID for each member. ID convention should be established in account setup. Members will be required to provide this information upon enrollment. For health plan members, provide subscriber ID for all members associated with the subscriber (de',
  `initial_member_id` varchar(130) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Used to track if there is a change in the member_id',
  `date_of_birth` date NOT NULL COMMENT 'Date of Birth of the member',
  `member_first_name` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Member First Name',
  `member_middle_initial` char(1) COLLATE utf8_unicode_ci DEFAULT NULL,
  `member_last_name` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Member Last Name',
  `group_id` varchar(20) COLLATE utf8_unicode_ci NOT NULL COMMENT 'ID of the Group which will be created through collaboration between WW and the Client',
  `eligibility_effective_date` date NOT NULL COMMENT 'The member will be eligible for attributed WWHS benefits beginning this date.',
  `eligibility_end_date` date DEFAULT NULL COMMENT 'The member will no longer be eligible for attributed WWHS benefit after this date. Eligibility end date is often the contract expiration date.',
  `referral_status` bit(1) DEFAULT b'0' COMMENT 'Indicates the Referral Status. Ex: 1 - Referral Activated, 0 - Referral Deactivated',
  `referral_start_date` date DEFAULT NULL COMMENT 'Effective start date of the referral',
  `referral_end_date` date DEFAULT NULL COMMENT 'Effective end date of the referral',
  `relationship_code_id` varchar(5) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Identifies the individuals relationship to the primary subscriber.  Ex:\n01 = Self (Individual is primary subscriber/ employe',
  `coverage_code_id` varchar(5) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Identifies the size of group covered by associated subscriber. This must align with information populated in Relationship Code field (i.e. if individual is a dependent, Coverage Code must indicate subscriber has dependents)',
  `coverage_effective_date` date NOT NULL COMMENT 'Identifies when the coverage type (as determined by Coverage Code) is effective. This is typically the same as eligibility effective date, but may be different due to significant life events.',
  `maintenance_code_id` varchar(5) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Identifies the change in individuals eligibility status from previous file.\n00 = No Change/Addition\n01 = Change/Cancellation/Termination/Reinstateme',
  `subsidy_override` varchar(5) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Overrides WWHS subsidy logic and assigns provided Offering ID to member. Only populate this field as predetermined with WWHS.',
  `gender_id` varchar(5) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'M = MALE, F = FEMALE, U = UNKNOWN, O = OTHER',
  `address_1` varchar(200) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Street address of Member',
  `address_2` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Secondary line for street address (e.g., apartment, floor level)',
  `city` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'City of Member street address',
  `state_id` bigint(20) unsigned DEFAULT NULL COMMENT 'Dropwdown via state table. State of Member City',
  `zipcode` varchar(9) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Zip Code of Member address',
  `email_address` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Member email address',
  `phone_work` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Member Work Phone Number',
  `phone_home` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Member Home Phone Number',
  `phone_cell` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Member Cell Number',
  `locator_id` varchar(20) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Identifies the member''s location for billing and reporting purposes',
  `program_indicator_id` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'TBD. This field is not in use until further notice.',
  `title` varchar(4) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Member title Ex. Mr., Mrs., Ms., Dr.',
  `suffix` varchar(4) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Member Suffix',
  `billing_pass_through` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Informational field only. Information populated here will be displayed on billing file for reporting. Members will not be required to enter this information upon registration.',
  `client_pass_through` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Informational field only. Information populated here will be displayed on billing file for reporting. Members will not be required to enter this information upon registration.',
  `filler_1` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Informational field only. Information populated here will be displayed on billing file for reporting. Members will not be required to enter this information upon registration.',
  `filler_2` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Informational field only. Information populated here will be displayed on billing file for reporting. Members will not be required to enter this information upon registration.',
  `transition_id` varchar(40) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Provide new Member ID if existing Member ID has changed for member, or leave blank. Transition ID will replace existing Member ID in WWHS systems. Transition ID should be used infrequently. ',
  `data_source_id` char(1) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Last this record was updated by screen or file Ex: ''S'' FOR SCREEN, ''F'' FOR ELIGIBILITY FILE.',
  `system_source_id` varchar(5) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Internal system source identifier used for reference purpose throughout the client exp database. Ex: Client, WWHS etc.',
  `active` bit(1) DEFAULT b'0' COMMENT '1 - Record Active. 0 - Record Inactive/Deleted',
  `created_by` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `created_date` datetime NOT NULL,
  `modified_by` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `modified_date` datetime NOT NULL,
  `is_locked` bit(1) NOT NULL DEFAULT b'0' COMMENT '1 - Locked, 0 - Un-Locked',
