--

DROP TABLE IF EXISTS `eligibility_data_column_history`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `eligibility_data_column_history` (
  `eligibility_data_column_history_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Internal eligibility data column history identifier used for reference purpose throughout the client exp database',
  `audit_type` char(1) COLLATE utf8_unicode_ci NOT NULL COMMENT 'I - Insert, U - Update, D - Delete',
  `file_id` bigint(20) unsigned DEFAULT NULL,
  `eligibility_file_type_id` bigint(20) unsigned DEFAULT NULL COMMENT 'Dropdown via eligibility_file_type table. Type of eligibility file that the Client will submit: Complete, Simplified. Ex: Complete, Simplified, Custom etc.',
  `data_source_id` char(1) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Last this record was updated by screen or file Ex: ''S'' FOR SCREEN, ''F'' FOR ELIGIBILITY FILE.',
  `system_source_id` bigint(20) unsigned DEFAULT NULL COMMENT 'Dropwdown via lookup table. Internal system source identifier used for reference purpose throughout the client exp database. Ex: Client, WWHS etc.',
  `eligibility_data_id` bigint(20) unsigned NOT NULL COMMENT 'Internal eligibility data identifier used for reference purpose throughout the client exp database',
  `column_id` int(10) unsigned NOT NULL,
  `oldvalue` varchar(1000) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Old value in the field',
  `newvalue` varchar(1000) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'New or Updated value in the field',
  `created_by` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `created_date` datetime NOT NULL,
  PRIMARY KEY (`eligibility_data_column_history_id`),
  KEY `fk_eligibility_data_column_history_column_id_idx` (`column_id`),
  KEY `fk_eligibility_data_column_history_file_id_idx` (`file_id`),
  KEY `fk_eligibility_file_type_id_eligibility_file_type_id_idx` (`eligibility_file_type_id`),
  KEY `fk_eligibility_data_column_history_system_source_id _idx` (`system_source_id`),
  KEY `fk_eligibility_data_column_history_eligibility_data_id_idx` (`eligibility_data_id`),
  CONSTRAINT `fk_eligibility_data_column_history_column_id` FOREIGN KEY (`column_id`) REFERENCES `eligibility_file_column` (`column_id`),
  CONSTRAINT `fk_eligibility_data_column_history_eligibility_data_id` FOREIGN KEY (`eligibility_data_id`) REFERENCES `eligibility_data` (`eligibility_data_id`),
  CONSTRAINT `fk_eligibility_data_column_history_file_id` FOREIGN KEY (`file_id`) REFERENCES `eligibility_file` (`file_id`),
  CONSTRAINT `fk_eligibility_data_column_history_system_source_id ` FOREIGN KEY (`system_source_id`) REFERENCES `lookup` (`lookup_id`),
  CONSTRAINT `fk_eligibility_file_type_id_eligibility_file_type_id` FOREIGN KEY (`eligibility_file_type_id`) REFERENCES `eligibility_file_type` (`eligibility_file_type_id`)
) ENGINE=InnoDB AUTO_INCREMENT=407561 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Tracks column level changes on a eligibility data record bas';
/*!40101 SET character_set_client = @saved_cs_client */;

