DROP TABLE IF EXISTS `eligibility_file`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `eligibility_file` (
  `file_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Internal file identifier used for reference purpose throughout the client exp database',
  `file_name` varchar(500) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Name of the file that is being processed',
  `generated_file_name` varchar(500) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Generated Name of the file that is being processed',
  `client_id` bigint(20) unsigned DEFAULT NULL COMMENT 'Unique client id.Generated by client ops to track the Client across systems',
  `account_id` varchar(5) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Account ID identifies the eligibility group the file relates to within the client universe, and will be provided to the client during account setup in client ops database',
  `eligibility_file_option_id` bigint(20) unsigned DEFAULT NULL COMMENT 'Identifies if the file is Full or Change.',
  `eligibility_file_type_id` bigint(20) unsigned DEFAULT NULL COMMENT 'Internal eligibility file type identifier used for reference purpose throughout the client ops database.',
  `total_member_record_count_header` int(10) unsigned DEFAULT NULL COMMENT 'Header - Identify total number of member records within the file. This will help validate that all member records have been received. ',
  `total_member_record_count_trailer` int(10) unsigned DEFAULT NULL COMMENT 'Trailer - Identify total number of member records within the file. This will help validate that all member records have been received. ',
  `date_file_sent` date DEFAULT NULL,
  `time_file_sent` time DEFAULT NULL,
  `uploader_name` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `uploader_email_address` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `uploader_phone` varchar(10) COLLATE utf8_unicode_ci DEFAULT NULL,
  `active` bit(1) NOT NULL DEFAULT b'1' COMMENT '1 - Record Active. 0 - Record Inactive/Deleted',
  `created_by` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `created_date` datetime NOT NULL,
  `modified_by` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `modified_date` datetime NOT NULL,
  PRIMARY KEY (`file_id`),
  KEY `fk_eligibility_file_eligibility_file_type_id_idx` (`eligibility_file_type_id`),
  KEY `fk_eligibility_file_eligibility_file_option_id_idx` (`eligibility_file_option_id`),
  KEY `fk_eligibility_file_client_id_idx` (`client_id`),
  KEY `fk_eligibility_file_account_id_idx` (`account_id`),
  CONSTRAINT `eligibility_file_ibfk_1` FOREIGN KEY (`account_id`) REFERENCES `account_vendor` (`account_vendor_id`),
  CONSTRAINT `eligibility_file_ibfk_2` FOREIGN KEY (`client_id`) REFERENCES `client` (`client_id`),
  CONSTRAINT `eligibility_file_ibfk_3` FOREIGN KEY (`eligibility_file_option_id`) REFERENCES `lookup` (`lookup_id`),
  CONSTRAINT `eligibility_file_ibfk_4` FOREIGN KEY (`eligibility_file_type_id`) REFERENCES `eligibility_file_type` (`eligibility_file_type_id`)
) ENGINE=InnoDB AUTO_INCREMENT=122350 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Stores the file and header/trailer information relating to t';
/*!40101 SET character_set_client = @saved_cs_client */;

