--
-- Table structure for table `eligibility_file_staging_complete`
--

DROP TABLE IF EXISTS `eligibility_file_staging_complete`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `eligibility_file_staging_complete` (
  `eligibility_file_staging_complete_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `is_invalid_row` bit(1) NOT NULL DEFAULT b'0',
  `is_duplicate_row` bit(1) NOT NULL DEFAULT b'0',
  `file_id` bigint(20) unsigned DEFAULT NULL,
  `member_record_number` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Identifies the members location in the eligibility file beginning with 1. This will facilitate error reporting. Only numbers accepted.',
  `client_id` bigint(20) NOT NULL COMMENT 'Unique client id.Generated by client ops to track the Client across systems',
  `account_id` varchar(5) COLLATE utf8_unicode_ci DEFAULT NULL,
  `member_id` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Unique member ID for each member. ID convention should be established in account setup. Members will be required to provide this information upon enrollment. For health plan members, provide subscriber ID for all members associated with the subscriber (de',
  `initial_member_id` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Used to track if there is a change in the member_id',
  `date_of_birth` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Date of Birth of the member',
  `member_first_name` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Member First Name',
  `member_middle_initial` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL,
  `member_last_name` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Member Last Name',
  `group_id` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'ID of the Group which will be created through collaboration between WW and the Client',
  `eligibility_effective_date` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'The member will be eligible for attributed WWHS benefits beginning this date.',
  `eligibility_end_date` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'The member will no longer be eligible for attributed WWHS benefit after this date. Eligibility end date is often the contract expiration date.',
  `referral_status` bit(1) DEFAULT b'0' COMMENT 'Indicates the Referral Status. Ex: 1 - Referral Activated, 0 - Referral Deactivated',
  `referral_start_date` date DEFAULT NULL COMMENT 'Effective start date of the referral',
  `referral_end_date` date DEFAULT NULL COMMENT 'Effective end date of the referral',
  `relationship_code` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Dropwdown via lookup table. Identifies the individuals relationship to the primary subscriber.  Ex:\n01 = Self (Individual is primary subscriber/ employe',
  `coverage_code` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Dropwdown via lookup table. Identifies the size of group covered by associated subscriber. This must align with information populated in Relationship Code field (i.e. if individual is a dependent, Coverage Code must indicate subscriber has dependents)',
  `coverage_effective_date` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Identifies when the coverage type (as determined by Coverage Code) is effective. This is typically the same as eligibility effective date, but may be different due to significant life events.',
  `maintenance_code` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Dropwdown via lookup table. Identifies the change in individuals eligibility status from previous file.\n00 = No Change/Addition\n01 = Change/Cancellation/Termination/Reinstatement\n02 = Change to Member D',
  `subsidy_override` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Overrides WWHS subsidy logic and assigns provided Offering ID to member. Only populate this field as predetermined with WWHS.',
  `gender` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Dropdown via lookup table. M = MALE, F = FEMALE, U = UNKNOWN, O = OTHER',
  `address_1` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Street address of Member',
  `address_2` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Secondary line for street address (e.g., apartment, floor level)',
  `city` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'City of Member street address',
  `state` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Dropwdown via state table. State of Member City',
  `zipcode` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Zip Code of Member address',
  `email_address` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Member email address',
  `phone_work` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Member Work Phone Number',
  `phone_home` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Member Home Phone Number',
  `phone_cell` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Member Cell Number',
  `locator_id` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Identifies the member''s location for billing and reporting purposes',
  `program_indicator` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'TBD. This field is not in use until further notice.',
  `title` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Member title Ex. Mr., Mrs., Ms., Dr.',
