DROP TABLE IF EXISTS `eligibility_file_staging_simplified`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `eligibility_file_staging_simplified` (
  `eligibility_file_staging_simplified_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT,
  `is_invalid_row` bit(1) NOT NULL DEFAULT b'0',
  `is_duplicate_row` bit(1) NOT NULL DEFAULT b'0',
  `file_id` bigint(20) unsigned DEFAULT NULL,
  `member_record_number` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Identifies the members location in the eligibility file beginning with 1. This will facilitate error reporting. Only numbers accepted.',
  `client_id` bigint(20) NOT NULL COMMENT 'Unique client id.Generated by client ops to track the Client across systems',
  `account_id` varchar(5) COLLATE utf8_unicode_ci DEFAULT NULL,
  `member_id` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Unique member ID for each member. ID convention should be established in account setup. Members will be required to provide this information upon enrollment. For health plan members, provide subscriber ID for all members associated with the subscriber (de',
  `initial_member_id` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Used to track if there is a change in the member_id',
  `date_of_birth` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Date of Birth of the member',
  `member_first_name` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Member First Name',
  `member_middle_initial` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL,
  `member_last_name` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Member Last Name',
  `group_id` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'ID of the Group which will be created through collaboration between WW and the Client',
  `eligibility_effective_date` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'The member will be eligible for attributed WWHS benefits beginning this date.',
  `eligibility_end_date` varchar(500) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'The member will no longer be eligible for attributed WWHS benefit after this date. Eligibility end date is often the contract expiration date.',
  `referral_status` bit(1) DEFAULT b'0' COMMENT 'Indicates the Referral Status. Ex: 1 - Referral Activated, 0 - Referral Deactivated',
  `referral_start_date` date DEFAULT NULL COMMENT 'Effective start date of the referral',
