DROP TABLE IF EXISTS `eligibility_file_status`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `eligibility_file_status` (
  `eligibility_file_status_id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Internal eligibility file status identifier used for reference purpose throughout the client exp database',
  `file_id` bigint(20) unsigned NOT NULL COMMENT 'Internal file identifier used for reference purpose throughout the client exp database',
  `eligibility_file_status_type_id` bigint(20) unsigned NOT NULL COMMENT 'Dropwdown via lookup table. Identifies the various file processing codes.  Ex: Received, Processed, Error, Processed With Errors',
  `error_count` int(10) unsigned NOT NULL COMMENT 'Error count of records in single pass of the file',
  `total_eligible` int(10) unsigned NOT NULL COMMENT 'Total number of eligible records in a single pass of the file',
  `total_terminated` int(10) unsigned NOT NULL COMMENT 'Total number of terminated records in a single pass of the file.',
  `start_date_time` datetime NOT NULL COMMENT 'Start Date Time of the file processing',
  `end_date_time` datetime DEFAULT NULL COMMENT 'End Date Time of the file processing',
  `member_count` int(10) unsigned NOT NULL COMMENT 'Total member record count in a single pass of the file. In the first pass it will be the "Total member record count" received in the eligibility file header.',
  `records_added` int(10) unsigned NOT NULL COMMENT 'Number of records added in a single pass of the file.',
  `records_updated` int(10) unsigned NOT NULL COMMENT 'Number of records updated in a single pass of the file.',
  `records_no_change` int(11) NOT NULL,
  `file_released` bit(1) NOT NULL DEFAULT b'0' COMMENT '1 - Release to Client. 0 - Pending WWHS Review',
  `active` bit(1) NOT NULL DEFAULT b'1' COMMENT '1 - Record Active. 0 - Record Inactive/Deleted',
  `created_by` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `created_date` datetime NOT NULL,
  `modified_by` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `modified_date` datetime NOT NULL,
  `is_report_generated` bit(1) DEFAULT b'0',
  PRIMARY KEY (`eligibility_file_status_id`),
  KEY `fk_eligibility_file_status_file_id_idx` (`file_id`),
  KEY `fk_eligibility_file_status_type_id_idx` (`eligibility_file_status_type_id`),
  CONSTRAINT `fk_eligibility_file_status_file_id` FOREIGN KEY (`file_id`) REFERENCES `eligibility_file` (`file_id`),
  CONSTRAINT `fk_eligibility_file_status_type_id` FOREIGN KEY (`eligibility_file_status_type_id`) REFERENCES `lookup` (`lookup_id`)
) ENGINE=InnoDB AUTO_INCREMENT=120 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Allows to track the processing status of an eligibility file';
