--
-- Table structure for table `eligibility_vendor_recurring_task`
--

DROP TABLE IF EXISTS `eligibility_vendor_recurring_task`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `eligibility_vendor_recurring_task` (
  `eligibility_vendor_recurring_task_id` bigint(20) unsigned NOT NULL,
  `eligibility_vendor_scheduled_task_id` bigint(20) unsigned NOT NULL,
  `frequency_id` bigint(20) unsigned DEFAULT NULL COMMENT 'Dropdown via lookup. ex: Daily, Weekly, Monthly or Yearly',
  `interval_id` bigint(20) unsigned DEFAULT NULL COMMENT 'Dropdown via lookup. Every x days(1 to 5), weeks (1 to 4), months (1 to 12) etc.',
  `monthly_option_id` bigint(20) unsigned DEFAULT NULL COMMENT 'Dropdown via lookup. ex: "By Day of Month" or "By Day of Week"',
  `week_of_month_id` bigint(20) unsigned DEFAULT NULL COMMENT 'Dropdown via lookup. first, second, third, fourth, fifth (1 to 5). If populated then DayNo specifies the day of the week.',
  `month_of_year_id` bigint(20) unsigned DEFAULT NULL COMMENT 'Dropdown via lookup. Specifies the month of year ex: 1-12 ( 1 - January....12 - December)',
  `effective_start_date` date NOT NULL,
  `effective_end_date` date DEFAULT NULL COMMENT 'The last date to perform this recurring task',
  `occurence` int(11) DEFAULT NULL COMMENT 'The number of times to perform. If this and the effective_end_date value are null then perform for ever. Ex: Blank or any integer number',
  `active` bit(1) NOT NULL DEFAULT b'1' COMMENT '1 - Record Active. 0 - Record Inactive/Deleted',
  `created_by` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `created_date` datetime NOT NULL,
  `modified_by` varchar(100) COLLATE utf8_unicode_ci NOT NULL,
  `modified_date` datetime NOT NULL,
  PRIMARY KEY (`eligibility_vendor_recurring_task_id`),
  KEY `fk_eligibility_vendor_scheduled_task_id_idx` (`eligibility_vendor_scheduled_task_id`),
  KEY `fk_frequency_id_idx` (`frequency_id`),
  KEY `fk_interval_id_idx` (`interval_id`),
  KEY `fk_monthly_option_id_idx` (`monthly_option_id`),
  KEY `fk_week_of_month_id_idx` (`week_of_month_id`),
  KEY `fk_month_of_year_id_idx` (`month_of_year_id`),
  CONSTRAINT `fk_eligibility_vendor_scheduled_task_id` FOREIGN KEY (`eligibility_vendor_scheduled_task_id`) REFERENCES `eligibility_vendor_scheduled_task` (`eligibility_vendor_scheduled_task_id`),
  CONSTRAINT `fk_frequency_id` FOREIGN KEY (`frequency_id`) REFERENCES `lookup` (`lookup_id`),
  CONSTRAINT `fk_interval_id` FOREIGN KEY (`interval_id`) REFERENCES `lookup` (`lookup_id`),
  CONSTRAINT `fk_month_of_year_id` FOREIGN KEY (`month_of_year_id`) REFERENCES `lookup` (`lookup_id`),
  CONSTRAINT `fk_monthly_option_id` FOREIGN KEY (`monthly_option_id`) REFERENCES `lookup` (`lookup_id`),
  CONSTRAINT `fk_week_of_month_id` FOREIGN KEY (`week_of_month_id`) REFERENCES `lookup` (`lookup_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Used to track the recurring schedule of the files received f';
/*!40101 SET character_set_client = @saved_cs_client */;

