CREATE DEFINER=`wwhsadmin`@`%` FUNCTION `fn_check_cced_mismatch`(v_member_id varchar(100), v_ced varchar(10), v_ccode varchar(10),v_lid varchar(500), v_gid varchar(100),v_file_id bigint, v_data_source varchar(1), v_file_type varchar(1)) RETURNS bigint(20)
    DETERMINISTIC
begin
DECLARE v_error bigint default 0;
DECLARE v_rid varchar(5);
DECLARE v_lid_data ,v_ced_data, v_ccode_data varchar(500);

SELECT lookup_id into v_rid FROM lookup where lookup_group = 'RELATIONSHIP' and lookup_key = '01';



if v_file_type = 'C' then


			
			SELECT IFNULL((SELECT 1 FROM eligibility_data
			       where member_id=v_member_id
			       AND group_id = v_gid
			       AND relationship_code_id = v_rid limit 1),0)
				   INTO v_error;


			if v_error = 0 then
				IF v_data_source = 'F' THEN
					SET  v_error := fn_get_column_id('member_id',v_file_id,null,'P');	
				ELSEIF(v_data_source = 'S') THEN
					SET v_error := fn_get_column_id('member_id',null,'Complete','P');
				END IF;
			else
				SELECT locator_id, coverage_code_id, coverage_effective_date
				INTO v_lid_data, v_ccode_data, v_ced_data
				FROM eligibility_data
				WHERE member_id = v_member_id
				AND group_id = v_gid
				AND relationship_code_id = v_rid limit 1;

				if v_lid_data <> v_lid then
					IF v_data_source = 'F' THEN
					SET  v_error = fn_get_column_id('locator_id',v_file_id,null,'P');	
					ELSEIF(v_data_source = 'S') THEN
					SET v_error = fn_get_column_id('locator_id',null,'Complete','P');
					END IF;
				elseif v_ccode_data <> v_ccode then
					IF v_data_source = 'F' THEN
					SET  v_error = fn_get_column_id('coverage_code',v_file_id,null,'P');	
					ELSEIF(v_data_source = 'S') THEN
					SET v_error = fn_get_column_id('coverage_code',null,'Complete','P');
					END IF;
				elseif v_ced_data <> str_to_date(v_ced,'%m%d%Y') then
					IF v_data_source = 'F' THEN
					SET  v_error = fn_get_column_id('coverage_effective_date',v_file_id,null,'P');	
					ELSEIF(v_data_source = 'S') THEN
					SET v_error = fn_get_column_id('coverage_effective_date',null,'Complete','P');
					END IF;
				end if;
			end if;
	
elseif v_file_type = 'S' then



			SELECT IFNULL((SELECT 1 FROM eligibility_data
			       where member_id=v_member_id
			       AND group_id = v_gid
			       AND relationship_code_id = v_rid limit 1),0)
			INTO v_error;

			if v_error = 0 then
				IF v_data_source = 'F' THEN
					SET  v_error := fn_get_column_id('member_id',v_file_id,null,'P');	
				ELSEIF(v_data_source = 'S') THEN
					SET v_error := fn_get_column_id('member_id',null,'Complete','P');
				END IF;
			else
				SELECT locator_id, coverage_code_id, coverage_effective_date
				INTO v_lid_data, v_ccode_data, v_ced_data
				FROM eligibility_data
				WHERE member_id = v_member_id
				AND group_id = v_gid
				AND relationship_code_id = v_rid limit 1;

				if v_lid_data <> v_lid then
					IF v_data_source = 'F' THEN
					SET  v_error = fn_get_column_id('locator_id',v_file_id,null,'P');	
					ELSEIF(v_data_source = 'S') THEN
					SET v_error = fn_get_column_id('locator_id',null,'Complete','P');
					END IF;
				elseif v_ccode_data <> v_ccode then
					IF v_data_source = 'F' THEN
					SET  v_error = fn_get_column_id('coverage_code',v_file_id,null,'P');	
					ELSEIF(v_data_source = 'S') THEN
					SET v_error = fn_get_column_id('coverage_code',null,'Complete','P');
					END IF;
				elseif v_ced_data <> str_to_date(v_ced,'%m%d%Y') then
					IF v_data_source = 'F' THEN
					SET  v_error = fn_get_column_id('coverage_effective_date',v_file_id,null,'P');	
					ELSEIF(v_data_source = 'S') THEN
					SET v_error = fn_get_column_id('coverage_effective_date',null,'Complete','P');
					END IF;
				end if;
			end if;

	
end if; 


return v_error;

end ;;
