CREATE DEFINER=`wwhsadmin`@`%` FUNCTION `fn_check_cc_mismatch`(v_member_id varchar(200), v_coverage_code varchar(100), v_file_type varchar(1), v_file_id varchar(50), v_staging_id bigint) RETURNS tinyint(1)
    READS SQL DATA
    DETERMINISTIC
begin 
DECLARE is_valid boolean; 
DECLARE v_lookup_id int;

set is_valid = 0; 

IF v_file_id is not null THEN
	if v_file_type = 'c' then
		SELECT COUNT(1)
		INTO is_valid
		FROM eligibility_file_staging_complete p
		WHERE p.member_id = v_member_id 
		AND p.relationship_code = '01'
		AND p.coverage_code <> v_coverage_code
		AND p.file_id = v_file_id;

		IF(is_valid = 0) then
			SELECT count(1)
			INTO is_valid
			FROM eligibility_data p
			WHERE p.member_id = v_member_id 
			AND p.relationship_code_id = '01'	
			AND p.coverage_code_id <> v_coverage_code ;
		END IF;
	END IF;


	if v_file_type = 's' then
		SELECT COUNT(1)
		INTO is_valid
		FROM eligibility_file_staging_simplified p
		WHERE p.member_id = v_member_id 
		AND p.relationship_code = '01'
		AND p.coverage_code <> v_coverage_code
		AND p.file_id = v_file_id;

		IF(is_valid = 0) then
			SELECT count(1)
			INTO is_valid
			FROM eligibility_data p
			WHERE p.member_id = v_member_id 
			AND p.relationship_code_id = '01'	
			AND p.coverage_code_id <> v_coverage_code;
		END IF;
	END IF;
END IF;

IF v_staging_id is not null THEN
	if v_file_type = 'c' then
		SELECT COUNT(1)
		INTO is_valid
		FROM eligibility_file_staging_complete p
		WHERE p.member_id = v_member_id 
		AND p.relationship_code = '01'
		AND p.coverage_code <> v_coverage_code;

		IF(is_valid = 0) then
			SELECT count(1)
			INTO is_valid
			FROM eligibility_data p
			WHERE p.member_id = v_member_id 
			AND p.relationship_code_id = '01'	
			AND p.coverage_code_id <> v_coverage_code;
		END IF;
	END IF;


	if v_file_type = 's' then
		SELECT COUNT(1)
		INTO is_valid
		FROM eligibility_file_staging_simplified p
		WHERE p.member_id = v_member_id 
		AND p.relationship_code = '01'
		AND p.coverage_code <> v_coverage_code;

		IF(is_valid = 0) then
			SELECT count(1)
			INTO is_valid
			FROM eligibility_data p
			WHERE p.member_id = v_member_id 
			AND p.relationship_code_id = '01'	
			AND p.coverage_code_id <> v_coverage_code;
		END IF;
	END IF;
END IF;
return is_valid;

end ;;
