CREATE DEFINER=`wwhsadmin`@`%` FUNCTION `fn_check_dependent_present`(v_member_id varchar(200), v_file_type varchar(1), v_relationship_code varchar(100), v_record_id varchar(10), v_file_id varchar(50)) RETURNS tinyint(1)
    READS SQL DATA
    DETERMINISTIC
begin
DECLARE is_valid boolean; 

set is_valid = 0; 

if v_file_type = 'c' then
	SELECT 1
	INTO is_valid
	FROM eligibility_file_staging_complete p
	WHERE p.member_id = v_member_id 
	AND p.relationship_code = v_relationship_code
	AND p.eligibility_file_staging_complete_id != v_record_id
	AND p.file_id = v_file_id
	limit 1;

	IF(row_count() < 1) THEN
	SELECT 1
	INTO is_valid
	FROM eligibility_data p
	WHERE p.member_id = v_member_id 
	AND p.relationship_code_id = v_relationship_code
	limit 1;
	END IF;
END IF;


if v_file_type = 's' then
	SELECT 1
	INTO is_valid
	FROM eligibility_file_staging_simplified p
	WHERE p.member_id = v_member_id 
	AND p.relationship_code = v_relationship_code
	AND p.eligibility_file_staging_complete_id != v_record_id
	AND p.file_id = v_file_id
	limit 1;

	IF(row_count() < 1) THEN
	SELECT 1
	INTO is_valid
	FROM eligibility_data p
	WHERE p.member_id = v_member_id 
	AND p.relationship_code_id = v_relationship_code
	limit 1;
	END IF;
END IF;

return is_valid;

end ;;
