CREATE DEFINER=`wwhsadmin`@`%` FUNCTION `fn_check_if_number`(column_value Varchar(200)) RETURNS tinyint(1)
    READS SQL DATA
    DETERMINISTIC
BEGIN
DECLARE is_num BOOLEAN; 

SET is_num = 0; 


IF column_value REGEXP '^[0-9]*$' then
SET is_num = 1;
else 
set is_num = 0;
END IF;
RETURN is_num;
END ;;
