CREATE DEFINER=`wwhsadmin`@`%` FUNCTION `fn_get_column_id`(v_column_name varchar(500), v_file_id bigint, v_staging_type varchar(20), v_source varchar(1)) RETURNS int(11)
    READS SQL DATA
    DETERMINISTIC
begin
DECLARE v_column_id INT; 
DECLARE v_error varchar(500);
DECLARE EXIT HANDLER FOR NOT FOUND
BEGIN
	SET v_column_id = 0;
	return v_column_id;
END;

IF v_source = 'P' THEN
	

	IF v_staging_type ='' OR v_staging_type is null THEN

			BEGIN
				SET v_error = 'Unable to fetch Column Id from eligibility_file_column';
				select column_id 
				into v_column_id
				from eligibility_file_column
				where eligibility_file_type_id = (
				SELECT eligibility_file_type_id
				FROM eligibility_file
				WHERE file_id= v_file_id)
				and sql_column_name = v_column_name;
			END;

	

	ELSEIF v_file_id ='' OR v_file_id is null  THEN
			
			BEGIN
				SET v_error = 'Unable to fetch Column Id from eligibility_file_column';			
				
				select column_id 
				into v_column_id
				from eligibility_file_column
				where eligibility_file_type_id = (
				select eligibility_file_type_id from eligibility_file_type
				where file_extension = '.csv' and lower(eligibility_file_type_description)=lower(v_staging_type))
				and sql_column_name = v_column_name;
			END;

	END IF;
END IF;

IF v_source = 'T' THEN
	select column_id 
	into v_column_id
	from eligibility_file_column
	where eligibility_file_type_id = v_file_id	
	and sql_column_name = v_column_name;
END IF;

return v_column_id;

end ;;
