CREATE DEFINER=`wwhsadmin`@`%` FUNCTION `fn_header_accountid`(v_account_id varchar(100), v_client_id varchar(100)) RETURNS bigint(20)
begin
DECLARE v_error bigint default 0;
DECLARE v_active,v_valid_check bigint;


IF fn_check_alphanumeric(v_account_id) = 0 THEN
	SET v_error=103;
elseif length(v_account_id) > 5 then
	set v_error = 103;	
elseif v_account_id is null or v_account_id ='' then 
	set v_error=103;
else

		SELECT COUNT(1)
		INTO v_active
		from account_vendor
		where account_vendor_id = v_account_id
		and active = 1;
	if v_active = 0 then	
		set v_error=104;
	else
		SELECT count(1)
		INTO v_valid_check
		FROM client_eligibility_vendor cev inner join eligibility_vendor_account eva
		on cev.client_eligibility_vendor_id = eva.client_eligibility_vendor_id
		inner join account_vendor av on av.account_vendor_id = eva.account_vendor_id
		where  eva.account_vendor_id = v_account_id
		and    cev.client_id	    = v_client_id
		and    cev.active=1
		and    eva.active=1
		and    av.active=1
		limit 1;

		if v_valid_check = 0 then
			set v_error=104;
		end if;

	end if;

end if;
return v_error;

end ;;
