CREATE DEFINER=`wwhsadmin`@`%` FUNCTION `fn_header_account_suspend`(v_account_id varchar(100),v_client_id varchar(100)) RETURNS bigint(20)
begin
DECLARE v_error bigint default 0;
DECLARE v_suspend bigint default 0;
DECLARE v_sid, v_stype_id bigint default 0;

if fn_header_accountid(v_account_id,v_client_id) = 0 and fn_header_clientid(v_client_id) = 0 then


SELECT  eligibility_file_status_type_id
INTO v_stype_id
from eligibility_file_status
where eligibility_file_status_id = (
						SELECT max(s.eligibility_file_status_id)
						from eligibility_file f inner join eligibility_file_status s
						on f.file_id = s.file_id
						where f.account_id = v_account_id
						and   f.client_id  = v_client_id);


		select count(1) 
		INTO v_suspend
		from lookup
		where lookup_group='FILE_STATUS_E_O'
		and lookup_key in ('ERT','WCE')
		and lookup_id = v_stype_id;
		
	if v_suspend > 0 then	
		set v_error=164;
	end if;

end if;
return v_error;

end ;;
