CREATE DEFINER=`wwhsadmin`@`%` FUNCTION `fn_header_date_sent`(v_date varchar(100)) RETURNS bigint(20)
    READS SQL DATA
    DETERMINISTIC
begin
DECLARE v_error bigint default 0;

IF IFNULL(str_to_date(v_date,'%m%d%Y'),'N') ='N' then
	set v_error = 107;	
elseif v_date is null or v_date ='' or length(v_date) <> 8 then 
	set v_error=107;
elseif datediff(str_to_date(v_date,'%m%d%Y'),utc_date()) > 1 then	
	set v_error=107;
end if;
return v_error;

end ;;
