CREATE DEFINER=`wwhsadmin`@`%` FUNCTION `fn_header_get_filetype_id`(v_account_id varchar(100), v_file_ext varchar(10)) RETURNS bigint(20)
begin
DECLARE v_file_type_id bigint default 1;
DECLARE v_active,v_valid_check bigint;


	select e.eligibility_file_type_id
	into v_file_type_id
	from eligibility_file_type e inner join account_vendor_eligibility_file_type a
	on e.eligibility_file_type_id = a.eligibility_file_type_id
	where a.account_vendor_id     = v_account_id
	and   e.file_extension	      = concat('.',lower(v_file_ext))
	and   a.active 				  = 1
	and   e.active				  = 1
	limit 1;


return v_file_type_id;

end ;;
