    READS SQL DATA
    DETERMINISTIC
begin
DECLARE v_error bigint default 0;

if v_type='h' then
	IF length(v_memrecord_h) > 7 then
		set v_error = 106;	
	elseif v_memrecord_h is null or v_memrecord_h ='' then 
		set v_error=106;
	elseif v_memrecord_h NOT REGEXP '^[0-9]*$' then
		set v_error=106;
	end if;
elseif v_type='t' then
	IF length(v_memrecord_t) > 7 then
		set v_error = 149;	
	elseif v_memrecord_t is null or v_memrecord_t ='' then 
		set v_error=149;
	elseif v_memrecord_t NOT REGEXP '^[0-9]*$' then
		set v_error=149;
        elseif v_memrecord_t <> v_memrecord_h OR v_memrecord_t <> v_total_recs then
		set v_error=149;
	end if;
end if;
return v_error;

end ;;
