CREATE DEFINER=`wwhsadmin`@`%` FUNCTION `fn_is_date`(column_value Varchar(200)) RETURNS tinyint(1)
    READS SQL DATA
    DETERMINISTIC
BEGIN
 DECLARE is_date BOOLEAN;
 DECLARE v_month, v_date, v_normyear, v_leapyear integer;
 DECLARE v_fulldate varchar(255);
 
 SET is_date = 0; 
 SET v_month = 0;
 SET v_date = 0;

 


If char_length(trim(column_value)) = 8 then
	set v_fulldate = trim(column_value);
	set v_month = cast(substring(column_value,1,2) as unsigned);
	set v_date =  cast(substring(column_value,3,2) as unsigned);
	if cast(substring(column_value,7,2) as unsigned)= 0 and cast(substring(column_value,5,4) as unsigned)%400 = 0 then
		set v_leapyear = cast(substring(column_value,5,4) as unsigned);
		set v_normyear = 0;
		
	elseif cast(substring(column_value,7,2) as unsigned) > 0 and cast(substring(column_value,5,4) as unsigned)%4 = 0 then
		set v_leapyear = cast(substring(column_value,5,4) as unsigned);
		
		set v_normyear = 0;
	else 
		set v_leapyear = 0;
		
		set v_normyear = cast(substring(column_value,5,4) as unsigned);
	end if;
else
	set is_date = 0;
	set v_fulldate = trim(column_value);
	return is_date;
 end if;

 
 IF char_length(v_fulldate)= 8 and v_month in (1,3,5,7,8,10,12) and v_date <= 31 and v_normyear > 0 then
	 SET is_date = 1;

 elseif char_length(v_fulldate) = 8 and v_month in (4,6,9,11) and v_date <= 30 and v_normyear > 0 then
	SET is_date = 1;
 elseif 
	char_length(v_fulldate) = 8 and v_month = 2 and v_date <= 28 and  v_leapyear > 0 then
	SET is_date = 1;
 elseif
	char_length(v_fulldate) = 8 and v_month = 2 and v_date <= 29 and v_leapyear > 0 then
	SET is_date = 1;


else
	SET is_date = 0;
 END IF;
 RETURN is_date;
 END ;;
