CREATE DEFINER=`wwhsadmin`@`%` PROCEDURE `eligibilitydatahistory_create`(v_file_id bigint, v_data_source char(1), v_system_source_id varchar(10), v_staging_type varchar(10),v_staging_id bigint unsigned,v_eligibility_data_id bigint)
begin

declare v_column_name , v_column_id, v_file_type varchar(100);
declare v_threshold, v_error_count, v_staging_count,v_threshold_breach, v_wwhs_er,v_eligibility_file_type_id, v_system_source_lookup_id integer;
SET v_threshold_breach = 0;



if v_file_id is not null then
	select 
	eligibility_file_type_id
	into v_eligibility_file_type_id
	from eligibility_file ef
	where
	file_id = v_file_id;

	select eligibility_file_type_description
	into v_file_type
	from eligibility_file_type
	where eligibility_file_type_id = v_eligibility_file_type_id;

    SELECT count(*) 
    into v_wwhs_er 
    from eligibility_file_error_log
    where error_code in (select error_code from eligibility_file_error_code where wwhs_review=1)
    and file_id =v_file_id;
    


elseif v_staging_id is not null and v_staging_type = 'complete' then
	set v_eligibility_file_type_id = '1';
	
	SELECT lookup_id
	INTO v_system_source_lookup_id
	FROM lookup
	WHERE lookup_group = 'System Source'
	AND lookup_value = v_system_source_id;
elseif v_staging_id is not null and v_staging_type = 'simplified' then
	set v_eligibility_file_type_id = '3';
	
	
end if;
SELECT lookup_id
	INTO v_system_source_lookup_id
	FROM lookup
	WHERE lookup_group = 'System Source'
	AND lookup_value = v_system_source_id;

	if lower(v_file_type) = 'complete' and v_file_id is not null then
	SET FOREIGN_KEY_CHECKS=0;
	
	
	select count(eligibility_file_error_row_id) into v_error_count
		from eligibility_file_error_row
		where file_id = v_file_id; 

        select count(eligibility_file_staging_complete_id) into v_staging_count
		from eligibility_file_staging_complete
		where file_id = v_file_id;
        

        set v_threshold = (select (v_error_count/v_staging_count)*100);


		select distinct
		evf.eligibility_file_error_threshold
		into v_threshold_breach
		from eligibility_file ef
		inner join eligibility_vendor_file evf
