CREATE DEFINER=`eligibilityapp`@`%` PROCEDURE `eligibilitydatahistory_fetch`(

  IN ACCOUNT_ID          VARCHAR(1000)
,IN CREATED_DATE_START  VARCHAR(30)
,IN CREATED_DATE_END    VARCHAR(30)
,IN MEMBER_ID           VARCHAR(130)
,IN GROUP_ID            VARCHAR(20)
,IN ELIGIBILITY_DATA_ID VARCHAR(20)
,IN MEMBER_FIRST_NAME   VARCHAR(50)
,IN MEMBER_LAST_NAME    VARCHAR(50)
,IN UPDATE_TYPE         VARCHAR(100)
,IN CLIENT_ID           VARCHAR(20)
,IN SORT_CRITERIA       VARCHAR(20)
,IN COLUMN_NAME_SORT    VARCHAR(20)
,IN PAGE_SIZE           INT
,IN PAGE_NUMBER         INT
,IN TIMESTAMP           VARCHAR(20))
BEGIN
    DECLARE WHERE_CLAUSE_OUTER                VARCHAR(2000);
    DECLARE WHERE_CLAUSE_INDIVIDUAL_RECORDS   VARCHAR(2000);
    DECLARE SORT_CLAUSE                       VARCHAR(100);
    DECLARE OFFSET                            BIGINT;
    DECLARE PAGENATION_STRING                 VARCHAR(50);
    DECLARE CLAUSE_FOR_AUDIT_TYPE             VARCHAR(300);
    DECLARE CLAUSE_FOR_HISTORY_DS             VARCHAR(200);
    DECLARE CLAUSE_FOR_SUBTYPE                VARCHAR(300);
    DECLARE subUpdateType                     VARCHAR(50);
    SET CLAUSE_FOR_HISTORY_DS           := '';
    SET CLAUSE_FOR_AUDIT_TYPE           := '';
    SET CLAUSE_FOR_SUBTYPE              := '';
    SET WHERE_CLAUSE_OUTER              := '';
    SET PAGENATION_STRING               := '';
    SET subUpdateType                   := '';
    SET WHERE_CLAUSE_INDIVIDUAL_RECORDS := '';

    IF PAGE_SIZE <> 0
    THEN
      BEGIN
        SET PAGENATION_STRING      := concat(
                                        ' LIMIT '
                                       ,PAGE_SIZE
                                       ,' OFFSET '
                                       ,PAGE_NUMBER);
      END;
    END IF;


    IF COLUMN_NAME_SORT = 'fileName' OR
       COLUMN_NAME_SORT = 'groupId' OR
       COLUMN_NAME_SORT = 'memberId' OR
       COLUMN_NAME_SORT = 'memberFirstName' OR
       COLUMN_NAME_SORT = 'user' OR
       COLUMN_NAME_SORT = 'memberLastName' 
    THEN
      BEGIN
        SET SORT_CLAUSE      := concat(
                                  ' ORDER BY '
                                 ,COLUMN_NAME_SORT
                                 ,' '
                                 ,SORT_CRITERIA
                                 ,' ,');
        SET SORT_CLAUSE      := concat(
                                  SORT_CLAUSE
                                 ,' ABS('
                                 ,COLUMN_NAME_SORT
                                 ,') '
                                 ,SORT_CRITERIA
                                 ,' ');
      END;
    ELSEIF COLUMN_NAME_SORT = 'dob' OR
           COLUMN_NAME_SORT = 'accountId' OR
           COLUMN_NAME_SORT = 'lastUpdated' OR
           COLUMN_NAME_SORT = 'updated'
    THEN
      BEGIN
        SET SORT_CLAUSE      := concat(
                                  ' ORDER BY '
                                 ,COLUMN_NAME_SORT
                                 ,' '
                                 ,SORT_CRITERIA
                                 ,' ');
      END;
       ELSEIF COLUMN_NAME_SORT = 'active' 
    THEN
      BEGIN
        SET SORT_CLAUSE      := concat(
                                  ' ORDER BY '
                                 ,'temp.active'
                                 ,' '
                                 ,SORT_CRITERIA
                                 ,' ');
      END;
             ELSEIF COLUMN_NAME_SORT = 'status' 
    THEN
      BEGIN
        SET SORT_CLAUSE      := concat(
                                  ' ORDER BY '
                                 ,'referalStatusStr'
                                 ,' '
                                 ,SORT_CRITERIA
                                 ,' ');
      END;
      
    ELSE
      BEGIN
        SET COLUMN_NAME_SORT := 'lastUpdated';
        SET SORT_CLAUSE      := concat(
                                  ' ORDER BY '
                                 ,COLUMN_NAME_SORT);
      END;
    END IF;


    IF ACCOUNT_ID <> ''
    THEN
      BEGIN
        SET WHERE_CLAUSE_OUTER                   := concat(
                                                      WHERE_CLAUSE_OUTER
                                                     ,' AND temp.account_id IN('
                                                     ,ACCOUNT_ID
                                                     ,') ');
        SET WHERE_CLAUSE_INDIVIDUAL_RECORDS      := concat(
                                                      WHERE_CLAUSE_INDIVIDUAL_RECORDS
                                                     ,' AND account_id IN('
                                                     ,ACCOUNT_ID
                                                     ,') ');
      END;
    END IF;

    IF TIMESTAMP <> ''
    THEN
      BEGIN
        SET WHERE_CLAUSE_OUTER      := concat(
                                         WHERE_CLAUSE_OUTER
                                        ,' AND  DATE_FORMAT(temp.created_date,''%m/%d/%Y %H:%i:%s'')='''
                                        ,TIMESTAMP
                                        ,''' ');
      END;
    END IF;

    IF CREATED_DATE_START <> '' AND
       CREATED_DATE_END <> ''
    THEN
      BEGIN
        SET WHERE_CLAUSE_OUTER      := concat(
                                         WHERE_CLAUSE_OUTER
                                        ,' AND ( DATE_FORMAT(temp.created_date,''%Y-%m-%d'') between '''
                                        ,CREATED_DATE_START
                                        ,''' AND '''
                                        ,CREATED_DATE_END
                                        ,''') ');
      END;
    END IF;

    IF MEMBER_ID <> ''
    THEN
      BEGIN
        SET WHERE_CLAUSE_OUTER                   := concat(
                                                      WHERE_CLAUSE_OUTER
                                                     ,' AND member_id= '''
                                                     ,MEMBER_ID
                                                     ,''' ');
        SET WHERE_CLAUSE_INDIVIDUAL_RECORDS      := concat(
                                                      WHERE_CLAUSE_INDIVIDUAL_RECORDS
                                                     ,' AND member_id= '''
                                                     ,MEMBER_ID
                                                     ,''' ');
      END;
    END IF;

    IF CLIENT_ID <> ''
    THEN
      BEGIN
        SET WHERE_CLAUSE_OUTER                   := concat(
                                                      WHERE_CLAUSE_OUTER
                                                     ,' AND temp.client_id= '''
                                                     ,CLIENT_ID
                                                     ,''' ');
        SET WHERE_CLAUSE_INDIVIDUAL_RECORDS      := concat(
                                                      WHERE_CLAUSE_INDIVIDUAL_RECORDS
                                                     ,' AND client_id= '''
                                                     ,CLIENT_ID
                                                     ,''' ');
      END;
    END IF;

    IF GROUP_ID <> ''
    THEN
      BEGIN
        SET WHERE_CLAUSE_OUTER      := concat(
                                         WHERE_CLAUSE_OUTER
                                        ,' AND  group_id= '''
                                        ,GROUP_ID
                                        ,''' ');
      END;
    END IF;


    IF MEMBER_FIRST_NAME <> ''
    THEN
      BEGIN
        SET WHERE_CLAUSE_OUTER      := concat(
                                         WHERE_CLAUSE_OUTER
                                        ,' AND UPPER(member_first_name) LIKE ''%'
                                        ,UPPER( MEMBER_FIRST_NAME)
                                        ,'%'' ');
      END;
    END IF;

    IF MEMBER_LAST_NAME <> ''
    THEN
      BEGIN
        SET WHERE_CLAUSE_OUTER      := concat(
                                         WHERE_CLAUSE_OUTER
                                        ,' AND UPPER(member_last_name) LIKE ''%'
                                        ,UPPER( MEMBER_LAST_NAME)
                                        ,'%'' ');
      END;
    END IF;

    SET subUpdateType                   := (SELECT
                                              FIND_IN_SET(
                                                'FILEA'
                                               ,UPDATE_TYPE));

    IF subUpdateType <> 0
    THEN
      BEGIN
        SET CLAUSE_FOR_AUDIT_TYPE      := concat(
                                            CLAUSE_FOR_AUDIT_TYPE
                                           ,' OR (audit_type=''I'' AND data_source_id=''F'') ')
;
      END;
    END IF;

    SET subUpdateType                   := (SELECT
                                              FIND_IN_SET(
                                                'USERA'
                                               ,UPDATE_TYPE));

    IF subUpdateType <> 0
    THEN
      BEGIN
        SET CLAUSE_FOR_AUDIT_TYPE      := concat(
                                            CLAUSE_FOR_AUDIT_TYPE
                                           ,' OR (audit_type=''I'' AND data_source_id=''S'') ')
;
      END;
    END IF;

    SET subUpdateType                   := (SELECT
                                              FIND_IN_SET(
                                                'FILEU'
                                               ,UPDATE_TYPE));

    IF subUpdateType <> 0
    THEN
      BEGIN
        SET CLAUSE_FOR_AUDIT_TYPE      := concat(
                                            CLAUSE_FOR_AUDIT_TYPE
                                           ,' OR (audit_type=''U'' AND data_source_id=''F'') ')
;
      END;
    END IF;

    SET subUpdateType                   := (SELECT
                                              FIND_IN_SET(
                                                'USERU'
                                               ,UPDATE_TYPE));

    IF subUpdateType <> 0
    THEN
      BEGIN
        SET CLAUSE_FOR_AUDIT_TYPE      := concat(
                                            CLAUSE_FOR_AUDIT_TYPE
                                           ,' OR (audit_type=''U'' AND  data_source_id=''S'') ')
;
      END;
    END IF;

    SET subUpdateType                   := (SELECT
                                              FIND_IN_SET(
                                                'ACT'
                                               ,UPDATE_TYPE));

    IF subUpdateType <> 0
    THEN
      BEGIN
        SET CLAUSE_FOR_AUDIT_TYPE      := concat(
                                            CLAUSE_FOR_AUDIT_TYPE
                                           ,' OR (audit_type=''A'') ');
      END;
    END IF;

    SET subUpdateType                   := (SELECT
                                              FIND_IN_SET(
                                                'DEACT'
                                               ,UPDATE_TYPE));

    IF subUpdateType <> 0
    THEN
      BEGIN
        SET CLAUSE_FOR_AUDIT_TYPE      := concat(
                                            CLAUSE_FOR_AUDIT_TYPE
                                           ,' OR (audit_type=''D'') ');
      END;
    END IF;


    IF UPDATE_TYPE <> ''
    THEN
      BEGIN
        SET CLAUSE_FOR_SUBTYPE      := concat(
                                         ' AND('
                                        ,CLAUSE_FOR_AUDIT_TYPE
                                        ,')');
        SET CLAUSE_FOR_SUBTYPE      := REPLACE(
                                         CLAUSE_FOR_SUBTYPE
                                        ,' AND( OR'
                                        ,' AND( ');
        SET WHERE_CLAUSE_OUTER      := concat(
                                         WHERE_CLAUSE_OUTER
                                        ,CLAUSE_FOR_SUBTYPE);
      END;
    END IF;

    IF ELIGIBILITY_DATA_ID <> ''
    THEN
      BEGIN
        SET WHERE_CLAUSE_OUTER      := concat(
                                         WHERE_CLAUSE_OUTER
                                        ,' AND temp.ELIGIBILITY_DATA_ID= '''
                                        ,ELIGIBILITY_DATA_ID
                                        ,''' ');
      END;
    END IF;

    IF WHERE_CLAUSE_OUTER <> ''
    THEN
      BEGIN
        SET WHERE_CLAUSE_OUTER      := concat(
                                         ' WHERE'
                                        ,WHERE_CLAUSE_OUTER);
        SET WHERE_CLAUSE_OUTER      := REPLACE(
                                         WHERE_CLAUSE_OUTER
                                        ,'WHERE AND'
                                        ,'WHERE');
      END;
    END IF;

    IF TIMESTAMP <> ''
    THEN
      BEGIN
        SET @SQL_QUERY      := concat( 'SELECT updated,
lastUpdated,
eligibilityDataId,
lastUpdateSource,
user,
transitionId,
fileId,
CAST(clientId as CHAR (32))  as clientId,
clientIdChangeFlag,
memberId,
memberIdChangeFlag,
accountId,
accountIdChangeFlag,
groupId,
groupIdChangeFlag,
memberFirstName,
memberFirstNameChangeFlag,
memberLastName,
memberLastNameChangeFlag,
CAST(memberMiddleInitial as CHAR (32)) as memberMiddleInitial,
memberMiddleInitialChangeFlag,
CAST(dob as CHAR(25)) as dob,
dobChangeFlag,
CAST(eligibilityEffDateStr as CHAR(20)) as eligibilityEffDateStr,
eligibilityEffDateStrChangeFlag,
CAST(eligibilityEndDateStr as CHAR(20)) as eligibilityEndDateStr,
eligibilityEndDateStrChangeFlag,
relationshipCodeDesc,
relationshipCodeDescChangeFlag,
coverageCodeDesc,
coverageCodeId,
coverageCodeDescChangeFlag,
coverageEffDateStrChangeFlag,
CAST(coverageEffDateStr as CHAR(20)) as coverageEffDateStr,
subsidyOverrideChangeFlag,
subsidyOverride,
genderDesc,
genderId,
genderDescChangeFlag,
address1,
address1ChangeFlag,
address2,
address2ChangeFlag,
city,
cityChangeFlag,
stateChangeFlag,
stateName,
zipcodeChangeFlag,
zipcode,
emailAddressChangeFlag,
emailAddress,
phoneHomeChangeFlag,
phoneHome,
phoneWorkChangeFlag,
phoneWork,
phoneCellChangeFlag,
phoneCell,
locatorIdChangeFlag,
locatorId,
programIndicatorChangeFlag,
programIndicator,
titleChangeFlag,
title,
suffixChangeFlag,
suffix,
billingPassThroughChangeFlag,
billingPassThrough,
clientPassThroughChangeFlag,
clientPassThrough,
filler1ChangeFlag,
filler1,
filler2ChangeFlag,
filler2,
referalStatusStrChangeFlag,
CASE WHEN referalStatusStr <> 0 THEN ''1'' ELSE ''0'' END As referalStatusStr,
CASE WHEN active <> 0 THEN ''1'' ELSE ''0'' END As active,
activeChangeFlag,
dataSourceIdChangeFlag,
CAST(dataSourceId as CHAR (1)) as dataSourceId,
maintenanceCodeDescChangeFlag,
maintenanceCodeDesc,
fileTypeChangeFlag,
fileType,
eligibilityFileTypeIdChangeFlag,
eligibilityFileDesc FROM (SELECT 
CASE  when audit_type= ''I'' and data_source_id=''F'' then ''Added by file''
when audit_type= ''U'' and data_source_id=''F'' then ''Updated by file''
when audit_type= ''I'' and data_source_id=''S'' then ''Added by user'' 
when audit_type= ''U'' and data_source_id=''S'' then ''Updated by user'' 
when audit_type= ''A'' then ''Referred by User''
when audit_type= ''D'' then ''Deactivated Referral'' END  as updated, 
DATE_FORMAT(temp.created_date,''%m/%d/%Y %H:%i:%s'') AS lastUpdated,
