transition_id as transitionId,
temp.file_id as fileId,
CASE WHEN  @client_id IS NULL  AND temp.client_id IS NULL THEN  ''N'' WHEN  @client_id IS NULL AND temp.client_id IS NOT NULL THEN ''Y'' WHEN  @client_id=temp.client_id THEN ''N'' ELSE ''Y'' END clientIdChangeFlag,
@client_id:=temp.client_id as clientId,
