@member_id:=member_id as memberId,
CASE WHEN  @account_id IS NULL  AND temp.account_id IS NULL THEN  ''N'' WHEN  @account_id IS NULL AND temp.account_id IS NOT NULL THEN ''Y'' WHEN  @account_id=temp.account_id THEN ''N'' ELSE ''Y'' END accountIdChangeFlag, 
@account_id:=temp.account_id as accountId,
CASE WHEN  @group_id IS NULL  AND group_id IS NULL THEN  ''N'' WHEN  @group_id IS NULL AND group_id IS NOT NULL THEN ''Y'' WHEN  @group_id=group_id THEN ''N'' ELSE ''Y'' END groupIdChangeFlag, 
@group_id:=group_id as groupId,
CASE WHEN  @member_first_name IS NULL  AND member_first_name IS NULL THEN  ''N'' WHEN  @member_first_name IS NULL AND member_first_name IS NOT NULL THEN ''Y'' WHEN  @member_first_name=member_first_name THEN ''N'' ELSE ''Y'' END memberFirstNameChangeFlag, 
@member_first_name:=member_first_name as memberFirstName,
CASE WHEN  @member_last_name IS NULL  AND member_last_name IS NULL THEN  ''N'' WHEN  @member_last_name IS NULL AND member_last_name IS NOT NULL THEN ''Y'' WHEN  @member_last_name=member_last_name THEN ''N'' ELSE ''Y'' END memberLastNameChangeFlag, 
@member_last_name:=member_last_name as memberLastName,
CASE WHEN  @member_middle_initial IS NULL  AND member_middle_initial IS NULL THEN  ''N'' WHEN  @member_middle_initial IS NULL AND member_middle_initial IS NOT NULL THEN ''Y'' WHEN  @member_middle_initial=member_middle_initial THEN ''N'' ELSE ''Y'' END memberMiddleInitialChangeFlag, 
@member_middle_initial:=member_middle_initial as memberMiddleInitial,
CASE WHEN  @date_of_birth IS NULL  AND date_of_birth IS NULL THEN  ''N'' WHEN  @date_of_birth IS NULL AND date_of_birth IS NOT NULL THEN ''Y'' WHEN  @date_of_birth=date_of_birth THEN ''N'' ELSE ''Y'' END dobChangeFlag, 
@date_of_birth:=date_of_birth as dob,
CASE WHEN  @eligibility_effective_date IS NULL  AND eligibility_effective_date IS NULL THEN  ''N'' WHEN  @eligibility_effective_date IS NULL AND eligibility_effective_date IS NOT NULL THEN ''Y'' WHEN  @eligibility_effective_date=eligibility_effective_date THEN ''N'' ELSE ''Y'' END eligibilityEffDateStrChangeFlag, 
@eligibility_effective_date:=eligibility_effective_date as eligibilityEffDateStr,
CASE WHEN  @eligibility_end_date IS NULL  AND eligibility_end_date IS NULL THEN  ''N'' WHEN  @eligibility_end_date IS NULL AND eligibility_end_date IS NOT NULL THEN ''Y'' WHEN  @eligibility_end_date=eligibility_end_date THEN ''N'' ELSE ''Y'' END eligibilityEndDateStrChangeFlag,
@eligibility_end_date:=eligibility_end_date as eligibilityEndDateStr,
CASE WHEN  @relationship_code_id IS NULL  AND relationship_code_id IS NULL THEN  ''N'' WHEN  @relationship_code_id IS NULL AND relationship_code_id IS NOT NULL THEN ''Y'' WHEN  @relationship_code_id=relationship_code_id THEN ''N'' ELSE ''Y'' END relationshipCodeDescChangeFlag,
@relationship_code_desc:=relationship_code_desc as relationshipCodeDesc,
@relationship_code_id:=relationship_code_id as relationshipCodeId,
CASE WHEN  @coverage_code_id IS NULL  AND coverage_code_id IS NULL THEN  ''N'' WHEN  @coverage_code_id IS NULL AND coverage_code_id IS NOT NULL THEN ''Y'' WHEN  @coverage_code_id=coverage_code_id THEN ''N'' ELSE ''Y'' END coverageCodeDescChangeFlag,
@coverage_code_desc:=coverage_code_desc   as coverageCodeDesc,
@coverage_code_id:=coverage_code_id   as coverageCodeId,
CASE WHEN  @coverage_effective_date IS NULL  AND coverage_effective_date IS NULL THEN  ''N'' WHEN  @coverage_effective_date IS NULL AND coverage_effective_date IS NOT NULL THEN ''Y'' WHEN  @coverage_effective_date=coverage_effective_date THEN ''N'' ELSE ''Y'' END coverageEffDateStrChangeFlag,
@coverage_effective_date:=coverage_effective_date as coverageEffDateStr,
CASE WHEN  @subsidy_override IS NULL  AND subsidy_override IS NULL THEN  ''N'' WHEN  @subsidy_override IS NULL AND subsidy_override IS NOT NULL THEN ''Y'' WHEN  @subsidy_override=subsidy_override THEN ''N'' ELSE ''Y'' END subsidyOverrideChangeFlag,
@subsidy_override:=subsidy_override as subsidyOverride,
CASE WHEN  @gender_id IS NULL  AND gender_id IS NULL THEN  ''N'' WHEN  @gender_id IS NULL AND gender_id IS NOT NULL THEN ''Y'' WHEN  @gender_id=gender_id THEN ''N'' ELSE ''Y'' END genderDescChangeFlag,
@gender_desc:=gender_desc as genderDesc,
@gender_id:=gender_id as genderId,
CASE WHEN  @address_1 IS NULL  AND address_1 IS NULL THEN  ''N'' WHEN  @address_1 IS NULL AND address_1 IS NOT NULL THEN ''Y'' WHEN  @address_1=address_1 THEN ''N'' ELSE ''Y'' END address1ChangeFlag,
@address_1:=address_1 as address1,
CASE WHEN  @address_2 IS NULL  AND address_2 IS NULL THEN  ''N'' WHEN  @address_2 IS NULL AND address_2 IS NOT NULL THEN ''Y'' WHEN  @address_2=address_2 THEN ''N'' ELSE ''Y'' END address2ChangeFlag,
@address_2:=address_2 as address2,
CASE WHEN  @city IS NULL  AND city IS NULL THEN  ''N'' WHEN  @city IS NULL AND city IS NOT NULL THEN ''Y'' WHEN  @city=city THEN ''N'' ELSE ''Y'' END cityChangeFlag,
@city:=city as city,
CASE WHEN  @state_id IS NULL  AND stateDesc.state_name IS NULL THEN  ''N'' WHEN  @state_id IS NULL AND stateDesc.state_name IS NOT NULL THEN ''Y'' WHEN  @state_id=stateDesc.state_name THEN ''N'' ELSE ''Y'' END stateChangeFlag,
@state_id:=stateDesc.state_name as stateName,
CASE WHEN  @zipcode IS NULL  AND zipcode IS NULL THEN  ''N'' WHEN  @zipcode IS NULL AND zipcode IS NOT NULL THEN ''Y'' WHEN  @zipcode=zipcode THEN ''N'' ELSE ''Y'' END zipcodeChangeFlag,
@zipcode:=zipcode as zipcode,
CASE WHEN  @email_address IS NULL  AND email_address IS NULL THEN  ''N'' WHEN  @email_address IS NULL AND email_address IS NOT NULL THEN ''Y'' WHEN  @email_address=email_address THEN ''N'' ELSE ''Y'' END emailAddressChangeFlag,
@email_address:=email_address as emailAddress,
CASE WHEN  @phone_home IS NULL  AND phone_home IS NULL THEN  ''N'' WHEN  @phone_home IS NULL AND phone_home IS NOT NULL THEN ''Y'' WHEN  @phone_home=phone_home THEN ''N'' ELSE ''Y'' END phoneHomeChangeFlag,
@phone_home:=phone_home as phoneHome,
CASE WHEN  @phone_work IS NULL  AND phone_work IS NULL THEN  ''N'' WHEN  @phone_work IS NULL AND phone_work IS NOT NULL THEN ''Y'' WHEN  @phone_work=phone_work THEN ''N'' ELSE ''Y'' END phoneWorkChangeFlag,
@phone_work:=phone_work as phoneWork,
CASE WHEN  @phone_cell IS NULL  AND phone_cell IS NULL THEN  ''N'' WHEN  @phone_cell IS NULL AND phone_cell IS NOT NULL THEN ''Y'' WHEN  @phone_cell=phone_cell THEN ''N'' ELSE ''Y'' END phoneCellChangeFlag,
@phone_cell:=phone_cell as phoneCell,
CASE WHEN  @locator_id IS NULL  AND locator_id IS NULL THEN  ''N'' WHEN  @locator_id IS NULL AND locator_id IS NOT NULL THEN ''Y'' WHEN  @locator_id=locator_id THEN ''N'' ELSE ''Y'' END locatorIdChangeFlag,
@locator_id:=locator_id as locatorId,
CASE WHEN  @program_indicator_id IS NULL  AND program_indicator_id IS NULL THEN  ''N'' WHEN  @program_indicator_id IS NULL AND program_indicator_id IS NOT NULL THEN ''Y'' WHEN  @program_indicator_id=program_indicator_id THEN ''N'' ELSE ''Y'' END programIndicatorChangeFlag,
@program_indicator_id:=program_indicator_id as programIndicator,
CASE WHEN  @title IS NULL  AND title IS NULL THEN  ''N'' WHEN  @title IS NULL AND title IS NOT NULL THEN ''Y'' WHEN  @title=title THEN ''N'' ELSE ''Y'' END titleChangeFlag,
@title:=title as title,
CASE WHEN  @suffix IS NULL  AND suffix IS NULL THEN  ''N'' WHEN  @suffix IS NULL AND suffix IS NOT NULL THEN ''Y'' WHEN  @suffix=suffix THEN ''N'' ELSE ''Y'' END suffixChangeFlag,
@suffix:=suffix as suffix,
CASE WHEN  @billing_pass_through IS NULL  AND billing_pass_through IS NULL THEN  ''N'' WHEN  @billing_pass_through IS NULL AND billing_pass_through IS NOT NULL THEN ''Y'' WHEN  @billing_pass_through=billing_pass_through THEN ''N'' ELSE ''Y'' END billingPassThroughChangeFlag,
@billing_pass_through:=billing_pass_through as billingPassThrough,
CASE WHEN  @client_pass_through IS NULL  AND client_pass_through IS NULL THEN  ''N'' WHEN  @client_pass_through IS NULL AND client_pass_through IS NOT NULL THEN ''Y'' WHEN  @client_pass_through=client_pass_through THEN ''N'' ELSE ''Y'' END clientPassThroughChangeFlag,
@client_pass_through:=client_pass_through as clientPassThrough,
CASE WHEN  @filler_1 IS NULL  AND filler_1 IS NULL THEN  ''N'' WHEN  @filler_1 IS NULL AND filler_1 IS NOT NULL THEN ''Y'' WHEN  @filler_1=filler_1 THEN ''N'' ELSE ''Y'' END filler1ChangeFlag,
@filler_1:=filler_1 as filler1,
CASE WHEN  @filler_2 IS NULL  AND filler_2 IS NULL THEN  ''N'' WHEN  @filler_2 IS NULL AND filler_2 IS NOT NULL THEN ''Y'' WHEN  @filler_2=filler_2 THEN ''N'' ELSE ''Y'' END filler2ChangeFlag,
@filler_2:=filler_2 as filler2,
CASE WHEN  @referral_status IS NULL  AND referral_status IS NULL THEN  ''N'' WHEN  @referral_status IS NULL AND referral_status IS NOT NULL THEN ''Y'' WHEN  @referral_status=referral_status THEN ''N'' ELSE ''Y'' END referalStatusStrChangeFlag,
@referral_status:=referral_status as referalStatusStr,
CASE WHEN  @active IS NULL  AND temp.active IS NULL THEN  ''N'' WHEN  @active IS NULL AND temp.active IS NOT NULL THEN ''Y'' WHEN  @active=temp.active THEN ''N'' ELSE ''Y'' END activeChangeFlag,
@active:= temp.active as active,
CASE WHEN  @data_source_id IS NULL  AND data_source_id IS NULL THEN  ''N'' WHEN  @data_source_id IS NULL AND data_source_id IS NOT NULL THEN ''Y'' WHEN  @data_source_id=data_source_id THEN ''N'' ELSE ''Y'' END dataSourceIdChangeFlag,
@data_source_id:= data_source_id as dataSourceId,
CASE WHEN  @maintenance_code_desc IS NULL  AND maintenance_code_desc IS NULL THEN  ''N'' WHEN  @maintenance_code_desc IS NULL AND maintenance_code_desc IS NOT NULL THEN ''Y'' WHEN  @maintenance_code_desc=maintenance_code_desc THEN ''N'' ELSE ''Y'' END maintenanceCodeDescChangeFlag,
@maintenance_code_desc:= maintenance_code_desc as maintenanceCodeDesc,
@maintenance_code_id:= maintenance_code_id as maintenanceCodeId,
CASE WHEN  @file_type IS NULL  AND eFile.eligibility_file_option_id IS NULL THEN  ''N'' WHEN  @file_type IS NULL AND eFile.eligibility_file_option_id IS NOT NULL THEN ''Y'' WHEN  @file_type=eFile.eligibility_file_option_id THEN ''N'' ELSE ''Y'' END fileTypeChangeFlag,
@file_type:= lkp.lookup_value as fileType,
CASE WHEN  @eligibility_file_type_id IS NULL  AND temp.eligibility_file_type_id IS NULL THEN  ''N'' WHEN  @eligibility_file_type_id IS NULL AND temp.eligibility_file_type_id IS NOT NULL THEN ''Y'' WHEN  @eligibility_file_type_id=temp.eligibility_file_type_id THEN ''N'' ELSE ''Y'' END eligibilityFileTypeIdChangeFlag,
@eligibility_file_type_id:= elgFileType.eligibility_file_type_description as eligibilityFileDesc
FROM ((select * from eligibility_data_history where eligibility_data_id='
                                ,ELIGIBILITY_DATA_ID
                                ,WHERE_CLAUSE_INDIVIDUAL_RECORDS
                                ,' and created_date in(select max(created_date) from eligibility_data_history where created_date<STR_TO_DATE('''
                                ,TIMESTAMP
                                ,''', ''%m/%d/%Y %H:%i:%s'') 
and eligibility_data_id='
                                ,ELIGIBILITY_DATA_ID
                                ,WHERE_CLAUSE_INDIVIDUAL_RECORDS
                                ,' ))
UNION ALL
(select * from eligibility_data_history where eligibility_data_id='
                                ,ELIGIBILITY_DATA_ID
                                ,WHERE_CLAUSE_INDIVIDUAL_RECORDS
                                ,' and DATE_FORMAT(created_date,''%m/%d/%Y %H:%i:%s'')='''
                                ,TIMESTAMP
                                ,''')) as temp
left join 
   state as stateDesc 
      on stateDesc.state_id=temp.state_id  
left join
   eligibility_file_type as elgFileType 
      on elgFileType.eligibility_file_type_id =temp.eligibility_file_type_id
left join eligibility_file eFile
on eFile.file_id=temp.file_id
left join lookup lkp
on lkp.lookup_id=eFile.eligibility_file_option_id and lkp.lookup_group=''FILEOPTION''
CROSS JOIN(SELECT @client_id:=NULL,
@member_id:=NULL,
@account_id:=NULL,
@group_id:=NULL,
@member_first_name:=NULL,
@member_last_name:=NULL,
@member_middle_initial:=NULL,
@date_of_birth:=NULL,
@eligibility_effective_date:=NULL,
@eligibility_end_date:=NULL,
@relationship_code_desc:=NULL,
@relationship_code_id:=NULL,
@coverage_code_desc:=NULL,
@coverage_code_id:=NULL,
@coverage_effective_date:=NULL,
@subsidy_override :=NULL,
@gender_desc:=NULL,
@gender_id:=NULL,
@address_1:=NULL,
@address_2:=NULL,
@city:=NULL,
@state_id:=NULL,
@zipcode:=NULL,
@email_address:=NULL,
@phone_home:=NULL,
@phone_work:=NULL,
@phone_cell:=NULL,
@locator_id:=NULL,
@program_indicator_id:=NULL,
@title:=NULL,
@suffix:=NULL,
@billing_pass_through:=NULL,
@client_pass_through:=NULL,
@filler_1:=NULL,
@filler_2:=NULL,
@referral_status:=NULL,
@active:=NULL, 
@data_source_id:=NULL,
@maintenance_code_desc:=NULL, 
@maintenance_code_id:=NULL, 
@file_type:=NULL,
@eligibility_file_type_id:=NULL) as temp1) as final order by lastUpdated desc LIMIT 1')
;
      END;
    ELSE
      BEGIN
        SET @SQL_QUERY      := concat(
                                 'SELECT 
CASE when audit_type= ''I'' and data_source_id=''F'' then ''Added by file''
when audit_type= ''U'' and data_source_id=''F'' then ''Updated by file''
when audit_type= ''I'' and data_source_id=''S'' then ''Added by user'' 
when audit_type= ''U'' and data_source_id=''S'' then ''Updated by user'' 
when audit_type= ''A'' then ''Referred by User''
when audit_type= ''D'' then ''Deactivated Referral'' END  as updated, 
DATE_FORMAT(temp.created_date,''%m/%d/%Y %H:%i:%s'') AS lastUpdated,
eligibility_data_id as eligibilityDataId,
system_source_desc as lastUpdateSource,
temp.created_by as user,
transition_id as transitionId,
temp.file_id as fileId,
CASE WHEN eFile.file_name is NULL then ''N/A'' ELSE eFile.file_name END  as fileName, 
CAST(temp.client_id as CHAR(32)) as clientId,
member_id as memberId,
temp.account_id as accountId,
group_id as groupId,
member_first_name as memberFirstName,
member_last_name as memberLastName,
CAST(member_middle_initial as CHAR(32)) as memberMiddleInitial,
CAST(date_of_birth as CHAR(25)) as dob,
CAST(eligibility_effective_date as CHAR(25)) as eligibilityEffDateStr,
CAST(eligibility_end_date as CHAR(25)) as eligibilityEndDateStr,
relationship_code_desc as relationshipCodeDesc,
relationship_code_id as relationshipCodeId,
coverage_code_desc   as coverageCodeDesc,
coverage_code_id   as coverageCodeId,
CAST(coverage_effective_date as CHAR(25)) as coverageEffDateStr,
subsidy_override as subsidyOverride,
gender_desc as genderDesc,
gender_id as genderId,
address_1 as address1,
address_2 as address2,
city as city,
stateDesc.state_name as stateName,
zipcode as zipcode,
email_address as emailAddress,
phone_home as phoneHome,
phone_work as phoneWork,
phone_cell as phoneCell,
locator_id as locatorId,
program_indicator_id as programIndicator,
title as title,
suffix as suffix,
billing_pass_through as billingPassThrough,
client_pass_through as clientPassThrough,
filler_1 as filler1,
filler_2 as filler2,
CASE WHEN referral_status <> 0 THEN ''1'' ELSE ''0'' END As referalStatusStr,
CASE WHEN temp.active  <> 0 THEN ''1'' ELSE ''0'' END As active,
CAST(data_source_id as CHAR(1)) as dataSourceId,
maintenance_code_desc as maintenanceCodeDesc,
maintenance_code_id as maintenanceCodeId,
lkp.lookup_value as fileType,
elgFileType.eligibility_file_type_description as eligibilityFileDesc
FROM eligibility_data_history temp
force index (fk_eligibility_data_history_client_id_idx, fk_eligibility_data_history_account_id_idx )
left join 
   state as stateDesc 
      on stateDesc.state_id=temp.state_id  
left join
   eligibility_file_type as elgFileType 
      on elgFileType.eligibility_file_type_id =temp.eligibility_file_type_id
left join eligibility_file eFile
on eFile.file_id=temp.file_id
left join lookup lkp
on lkp.lookup_id=eFile.eligibility_file_option_id and lkp.lookup_group=''FILEOPTION'' '
                                ,WHERE_CLAUSE_OUTER
                                ,' '
                                ,SORT_CLAUSE
                                ,' '
                                ,PAGENATION_STRING);
      END;
    END IF;


    PREPARE stmt3 FROM @SQL_QUERY    ;
    EXECUTE stmt3    ;
SELECT @SQL_QUERY;
   END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
/*!50003 DROP PROCEDURE IF EXISTS `eligibilitydatahistory_fetches_alldata` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8 */ ;
/*!50003 SET character_set_results = utf8 */ ;
/*!50003 SET collation_connection  = utf8_general_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`eligibilityapp`@`%` PROCEDURE `eligibilitydatahistory_fetches_alldata`(
  IN ACCOUNT_ID          VARCHAR(1000)
 ,IN CREATED_DATE_START  VARCHAR(30)
 ,IN CREATED_DATE_END    VARCHAR(30)
 ,IN MEMBER_ID           VARCHAR(15)
 ,IN GROUP_ID            VARCHAR(15)
 ,IN ELIGIBILITY_DATA_ID VARCHAR(20)
 ,IN MEMBER_FIRST_NAME   VARCHAR(20)
 ,IN MEMBER_LAST_NAME    VARCHAR(20)
 ,IN UPDATE_TYPE         VARCHAR(100)
 ,IN CLIENT_ID           VARCHAR(20)
 ,IN SORT_CRITERIA       VARCHAR(20)
 ,IN COLUMN_NAME_SORT    VARCHAR(20)
 ,IN PAGE_SIZE           INT
 ,IN PAGE_NUMBER         INT
 ,IN TIMESTAMP           VARCHAR(20))
BEGIN
    DECLARE WHERE_CLAUSE_OUTER                VARCHAR(2000);
    DECLARE WHERE_CLAUSE_INDIVIDUAL_RECORDS   VARCHAR(2000);
    DECLARE SORT_CLAUSE                       VARCHAR(100);
    DECLARE OFFSET                            BIGINT;
    DECLARE PAGENATION_STRING                 VARCHAR(50);
    DECLARE CLAUSE_FOR_AUDIT_TYPE             VARCHAR(300);
    DECLARE CLAUSE_FOR_HISTORY_DS             VARCHAR(200);
    DECLARE CLAUSE_FOR_SUBTYPE                VARCHAR(300);
    DECLARE subUpdateType                     VARCHAR(50);
    SET CLAUSE_FOR_HISTORY_DS           := '';
    SET CLAUSE_FOR_AUDIT_TYPE           := '';
    SET CLAUSE_FOR_SUBTYPE              := '';
    SET WHERE_CLAUSE_OUTER              := '';
    SET PAGENATION_STRING               := '';
    SET subUpdateType                   := '';
    SET WHERE_CLAUSE_INDIVIDUAL_RECORDS := '';

    IF PAGE_SIZE <> 0
    THEN
      BEGIN
        SET PAGENATION_STRING      := concat(
                                        ' LIMIT '
                                       ,PAGE_SIZE
                                       ,' OFFSET '
                                       ,PAGE_NUMBER);
      END;
    END IF;


    IF COLUMN_NAME_SORT = 'fileName' OR
       COLUMN_NAME_SORT = 'groupId' OR
       COLUMN_NAME_SORT = 'memberId' OR
       COLUMN_NAME_SORT = 'memberFirstName' OR
       COLUMN_NAME_SORT = 'user' OR
       COLUMN_NAME_SORT = 'memberLastName'
    THEN
      BEGIN
        SET SORT_CLAUSE      := concat(
                                  ' ORDER BY '
                                 ,COLUMN_NAME_SORT
                                 ,' '
                                 ,SORT_CRITERIA
                                 ,' ,');
        SET SORT_CLAUSE      := concat(
                                  SORT_CLAUSE
                                 ,' ABS('
                                 ,COLUMN_NAME_SORT
                                 ,') '
                                 ,SORT_CRITERIA
                                 ,' ');
      END;
    ELSEIF COLUMN_NAME_SORT = 'dob' OR
           COLUMN_NAME_SORT = 'accountId' OR
           COLUMN_NAME_SORT = 'lastUpdated' OR
           COLUMN_NAME_SORT = 'updated'
    THEN
      BEGIN
        SET SORT_CLAUSE      := concat(
                                  ' ORDER BY '
                                 ,COLUMN_NAME_SORT
                                 ,' '
                                 ,SORT_CRITERIA
                                 ,' ');
      END;
    ELSE
      BEGIN
        SET COLUMN_NAME_SORT := 'lastUpdated';
        SET SORT_CLAUSE      := concat(
                                  ' ORDER BY '
                                 ,COLUMN_NAME_SORT);
      END;
    END IF;


    IF ACCOUNT_ID <> ''
    THEN
      BEGIN
        SET WHERE_CLAUSE_OUTER                   := concat(
                                                      WHERE_CLAUSE_OUTER
                                                     ,' AND temp.account_id IN('
                                                     ,ACCOUNT_ID
                                                     ,') ');
        SET WHERE_CLAUSE_INDIVIDUAL_RECORDS      := concat(
                                                      WHERE_CLAUSE_INDIVIDUAL_RECORDS
                                                     ,' AND account_id IN('
                                                     ,ACCOUNT_ID
                                                     ,') ');
      END;
    END IF;

    IF TIMESTAMP <> ''
    THEN
      BEGIN
        SET WHERE_CLAUSE_OUTER      := concat(
                                         WHERE_CLAUSE_OUTER
                                        ,' AND  DATE_FORMAT(temp.created_date,''%m/%d/%Y %H:%i'')='''
                                        ,TIMESTAMP
                                        ,''' ');
      END;
    END IF;

    IF CREATED_DATE_START <> '' AND
       CREATED_DATE_END <> ''
    THEN
      BEGIN
        SET WHERE_CLAUSE_OUTER      := concat(
                                         WHERE_CLAUSE_OUTER
                                        ,' AND ( DATE_FORMAT(temp.created_date,''%Y-%m-%d'') between '''
                                        ,CREATED_DATE_START
                                        ,''' AND '''
                                        ,CREATED_DATE_END
                                        ,''') ');
      END;
    END IF;

    IF MEMBER_ID <> ''
    THEN
      BEGIN
        SET WHERE_CLAUSE_OUTER                   := concat(
                                                      WHERE_CLAUSE_OUTER
                                                     ,' AND member_id= '''
                                                     ,MEMBER_ID
                                                     ,''' ');
        SET WHERE_CLAUSE_INDIVIDUAL_RECORDS      := concat(
                                                      WHERE_CLAUSE_INDIVIDUAL_RECORDS
                                                     ,' AND member_id= '''
                                                     ,MEMBER_ID
                                                     ,''' ');
      END;
    END IF;

    IF CLIENT_ID <> ''
    THEN
      BEGIN
        SET WHERE_CLAUSE_OUTER                   := concat(
                                                      WHERE_CLAUSE_OUTER
                                                     ,' AND temp.client_id= '''
                                                     ,CLIENT_ID
                                                     ,''' ');
        SET WHERE_CLAUSE_INDIVIDUAL_RECORDS      := concat(
                                                      WHERE_CLAUSE_INDIVIDUAL_RECORDS
                                                     ,' AND client_id= '''
                                                     ,CLIENT_ID
                                                     ,''' ');
      END;
    END IF;

    IF GROUP_ID <> ''
    THEN
      BEGIN
        SET WHERE_CLAUSE_OUTER      := concat(
                                         WHERE_CLAUSE_OUTER
                                        ,' AND  group_id= '''
                                        ,GROUP_ID
                                        ,''' ');
      END;
    END IF;


    IF MEMBER_FIRST_NAME <> ''
    THEN
      BEGIN
        SET WHERE_CLAUSE_OUTER      := concat(
                                         WHERE_CLAUSE_OUTER
                                        ,' AND UPPER(member_first_name) LIKE ''%'
                                        ,UPPER( MEMBER_FIRST_NAME)
                                        ,'%'' ');
      END;
    END IF;

    IF MEMBER_LAST_NAME <> ''
    THEN
      BEGIN
        SET WHERE_CLAUSE_OUTER      := concat(
                                         WHERE_CLAUSE_OUTER
                                        ,' AND UPPER(member_last_name) LIKE ''%'
                                        ,UPPER( MEMBER_LAST_NAME)
                                        ,'%'' ');
      END;
    END IF;

    SET subUpdateType                   := (SELECT
                                              FIND_IN_SET(
                                                'FILEA'
                                               ,UPDATE_TYPE));

    IF subUpdateType <> 0
    THEN
      BEGIN
        SET CLAUSE_FOR_AUDIT_TYPE      := concat(
                                            CLAUSE_FOR_AUDIT_TYPE
                                           ,' OR (audit_type=''I'' AND data_source_id=''F'') ')
;
      END;
    END IF;

    SET subUpdateType                   := (SELECT
                                              FIND_IN_SET(
                                                'USERA'
                                               ,UPDATE_TYPE));

    IF subUpdateType <> 0
    THEN
      BEGIN
        SET CLAUSE_FOR_AUDIT_TYPE      := concat(
                                            CLAUSE_FOR_AUDIT_TYPE
                                           ,' OR (audit_type=''I'' AND data_source_id=''S'') ')
;
      END;
    END IF;

    SET subUpdateType                   := (SELECT
                                              FIND_IN_SET(
                                                'FILEU'
                                               ,UPDATE_TYPE));

    IF subUpdateType <> 0
    THEN
      BEGIN
        SET CLAUSE_FOR_AUDIT_TYPE      := concat(
                                            CLAUSE_FOR_AUDIT_TYPE
                                           ,' OR (audit_type=''U'' AND data_source_id=''F'') ')
;
      END;
    END IF;

    SET subUpdateType                   := (SELECT
                                              FIND_IN_SET(
                                                'USERU'
                                               ,UPDATE_TYPE));

    IF subUpdateType <> 0
    THEN
      BEGIN
        SET CLAUSE_FOR_AUDIT_TYPE      := concat(
                                            CLAUSE_FOR_AUDIT_TYPE
                                           ,' OR (audit_type=''U'' AND  data_source_id=''S'') ')
;
      END;
    END IF;

    SET subUpdateType                   := (SELECT
                                              FIND_IN_SET(
                                                'ACT'
                                               ,UPDATE_TYPE));

    IF subUpdateType <> 0
    THEN
      BEGIN
        SET CLAUSE_FOR_AUDIT_TYPE      := concat(
                                            CLAUSE_FOR_AUDIT_TYPE
                                           ,' OR (audit_type=''A'') ');
      END;
    END IF;

    SET subUpdateType                   := (SELECT
                                              FIND_IN_SET(
                                                'DEACT'
                                               ,UPDATE_TYPE));

    IF subUpdateType <> 0
    THEN
      BEGIN
        SET CLAUSE_FOR_AUDIT_TYPE      := concat(
                                            CLAUSE_FOR_AUDIT_TYPE
                                           ,' OR (audit_type=''D'') ');
      END;
    END IF;


    IF UPDATE_TYPE <> ''
    THEN
      BEGIN
        SET CLAUSE_FOR_SUBTYPE      := concat(
                                         ' AND('
                                        ,CLAUSE_FOR_AUDIT_TYPE
                                        ,')');
        SET CLAUSE_FOR_SUBTYPE      := REPLACE(
                                         CLAUSE_FOR_SUBTYPE
                                        ,' AND( OR'
                                        ,' AND( ');
        SET WHERE_CLAUSE_OUTER      := concat(
                                         WHERE_CLAUSE_OUTER
                                        ,CLAUSE_FOR_SUBTYPE);
      END;
    END IF;

    IF ELIGIBILITY_DATA_ID <> ''
    THEN
      BEGIN
        SET WHERE_CLAUSE_OUTER      := concat(
                                         WHERE_CLAUSE_OUTER
                                        ,' AND temp.ELIGIBILITY_DATA_ID= '''
                                        ,ELIGIBILITY_DATA_ID
                                        ,''' ');
      END;
    END IF;

    IF WHERE_CLAUSE_OUTER <> ''
    THEN
      BEGIN
        SET WHERE_CLAUSE_OUTER      := concat(
                                         ' WHERE'
                                        ,WHERE_CLAUSE_OUTER);
        SET WHERE_CLAUSE_OUTER      := REPLACE(
                                         WHERE_CLAUSE_OUTER
                                        ,'WHERE AND'
                                        ,'WHERE');
      END;
    END IF;

    IF ELIGIBILITY_DATA_ID <> ''
    THEN
      BEGIN
        SET @SQL_QUERY      := concat(
                                 'SELECT * FROM (SELECT 
CASE  when audit_type= ''U'' and data_source_id=''F'' then ''Updated by file''
when audit_type= ''I'' and data_source_id=''S'' then ''Added by user'' 
when audit_type= ''U'' and data_source_id=''S'' then ''Updated by user'' 
when audit_type= ''A'' then ''Referred by User''
when audit_type= ''D'' then ''Deactivated Referral'' END  as updated, 
DATE_FORMAT(temp.created_date,''%m/%d/%Y %H:%i'') AS lastUpdated,
eligibility_data_id as eligibilityDataId,
system_source_desc as lastUpdateSource,
temp.created_by as user,
transition_id as transitionId,
temp.file_id as fileId,
CASE WHEN  @client_id IS NULL  AND temp.client_id IS NULL THEN  ''N'' WHEN  @client_id IS NULL AND temp.client_id IS NOT NULL THEN ''Y'' WHEN  @client_id=temp.client_id THEN ''N'' ELSE ''Y'' END clientIdChangeFlag,
@client_id:=temp.client_id as clientId,
CASE  WHEN  @member_id IS NULL  AND member_id IS NULL THEN  ''N'' WHEN  @member_id IS NULL AND member_id IS NOT NULL THEN ''Y'' WHEN  @member_id=member_id THEN ''N'' ELSE ''Y'' END memberIdChangeFlag,
@member_id:=member_id as memberId,
CASE WHEN  @account_id IS NULL  AND temp.account_id IS NULL THEN  ''N'' WHEN  @account_id IS NULL AND temp.account_id IS NOT NULL THEN ''Y'' WHEN  @account_id=temp.account_id THEN ''N'' ELSE ''Y'' END accountIdChangeFlag, 
@account_id:=temp.account_id as accountId,
CASE WHEN  @group_id IS NULL  AND group_id IS NULL THEN  ''N'' WHEN  @group_id IS NULL AND group_id IS NOT NULL THEN ''Y'' WHEN  @group_id=group_id THEN ''N'' ELSE ''Y'' END groupIdChangeFlag, 
@group_id:=group_id as groupId,
CASE WHEN  @member_first_name IS NULL  AND member_first_name IS NULL THEN  ''N'' WHEN  @member_first_name IS NULL AND member_first_name IS NOT NULL THEN ''Y'' WHEN  @member_first_name=member_first_name THEN ''N'' ELSE ''Y'' END memberFirstNameChangeFlag, 
@member_first_name:=member_first_name as memberFirstName,
CASE WHEN  @member_last_name IS NULL  AND member_last_name IS NULL THEN  ''N'' WHEN  @member_last_name IS NULL AND member_last_name IS NOT NULL THEN ''Y'' WHEN  @member_last_name=member_last_name THEN ''N'' ELSE ''Y'' END memberLastNameChangeFlag, 
@member_last_name:=member_last_name as memberLastName,
CASE WHEN  @member_middle_initial IS NULL  AND member_middle_initial IS NULL THEN  ''N'' WHEN  @member_middle_initial IS NULL AND member_middle_initial IS NOT NULL THEN ''Y'' WHEN  @member_middle_initial=member_middle_initial THEN ''N'' ELSE ''Y'' END memberMiddleInitialChangeFlag, 
@member_middle_initial:=member_middle_initial as memberMiddleInitial,
CASE WHEN  @date_of_birth IS NULL  AND date_of_birth IS NULL THEN  ''N'' WHEN  @date_of_birth IS NULL AND date_of_birth IS NOT NULL THEN ''Y'' WHEN  @date_of_birth=date_of_birth THEN ''N'' ELSE ''Y'' END dobChangeFlag, 
@date_of_birth:=date_of_birth as dob,
CASE WHEN  @eligibility_effective_date IS NULL  AND eligibility_effective_date IS NULL THEN  ''N'' WHEN  @eligibility_effective_date IS NULL AND eligibility_effective_date IS NOT NULL THEN ''Y'' WHEN  @eligibility_effective_date=eligibility_effective_date THEN ''N'' ELSE ''Y'' END eligibilityEffDateStrChangeFlag, 
@eligibility_effective_date:=eligibility_effective_date as eligibilityEffDateStr,
CASE WHEN  @eligibility_end_date IS NULL  AND eligibility_end_date IS NULL THEN  ''N'' WHEN  @eligibility_end_date IS NULL AND eligibility_end_date IS NOT NULL THEN ''Y'' WHEN  @eligibility_end_date=eligibility_end_date THEN ''N'' ELSE ''Y'' END eligibilityEndDateStrChangeFlag,
@eligibility_end_date:=eligibility_end_date as eligibilityEndDateStr,
CASE WHEN  @relationship_code_id IS NULL  AND relationship_code_id IS NULL THEN  ''N'' WHEN  @relationship_code_id IS NULL AND relationship_code_id IS NOT NULL THEN ''Y'' WHEN  @relationship_code_id=relationship_code_id THEN ''N'' ELSE ''Y'' END relationshipCodeDescChangeFlag,
@relationship_code_desc:=relationship_code_desc as relationshipCodeDesc,
@relationship_code_id:=relationship_code_id as relationshipCodeId,
CASE WHEN  @coverage_code_id IS NULL  AND coverage_code_id IS NULL THEN  ''N'' WHEN  @coverage_code_id IS NULL AND coverage_code_id IS NOT NULL THEN ''Y'' WHEN  @coverage_code_id=coverage_code_id THEN ''N'' ELSE ''Y'' END coverageCodeDescChangeFlag,
@coverage_code_desc:=coverage_code_desc   as coverageCodeDesc,
@coverage_code_id:=coverage_code_id   as coverageCodeId,
CASE WHEN  @coverage_effective_date IS NULL  AND coverage_effective_date IS NULL THEN  ''N'' WHEN  @coverage_effective_date IS NULL AND coverage_effective_date IS NOT NULL THEN ''Y'' WHEN  @coverage_effective_date=coverage_effective_date THEN ''N'' ELSE ''Y'' END coverageEffDateStrChangeFlag,
@coverage_effective_date:=coverage_effective_date as coverageEffDateStr,
CASE WHEN  @subsidy_override IS NULL  AND subsidy_override IS NULL THEN  ''N'' WHEN  @subsidy_override IS NULL AND subsidy_override IS NOT NULL THEN ''Y'' WHEN  @subsidy_override=subsidy_override THEN ''N'' ELSE ''Y'' END subsidyOverrideChangeFlag,
@subsidy_override:=subsidy_override as subsidyOverride,
CASE WHEN  @gender_desc IS NULL  AND gender_desc IS NULL THEN  ''N'' WHEN  @gender_desc IS NULL AND gender_desc IS NOT NULL THEN ''Y'' WHEN  @gender_desc=gender_desc THEN ''N'' ELSE ''Y'' END genderDescChangeFlag,
@gender_desc:=gender_desc as genderDesc,
@gender_id:=gender_id as genderId,
CASE WHEN  @address_1 IS NULL  AND address_1 IS NULL THEN  ''N'' WHEN  @address_1 IS NULL AND address_1 IS NOT NULL THEN ''Y'' WHEN  @address_1=address_1 THEN ''N'' ELSE ''Y'' END address1ChangeFlag,
@address_1:=address_1 as address1,
CASE WHEN  @address_2 IS NULL  AND address_2 IS NULL THEN  ''N'' WHEN  @address_2 IS NULL AND address_2 IS NOT NULL THEN ''Y'' WHEN  @address_2=address_2 THEN ''N'' ELSE ''Y'' END address2ChangeFlag,
@address_2:=address_2 as address2,
CASE WHEN  @city IS NULL  AND city IS NULL THEN  ''N'' WHEN  @city IS NULL AND city IS NOT NULL THEN ''Y'' WHEN  @city=city THEN ''N'' ELSE ''Y'' END cityChangeFlag,
@city:=city as city,
CASE WHEN  @state_id IS NULL  AND temp.state_id IS NULL THEN  ''N'' WHEN  @state_id IS NULL AND temp.state_id IS NOT NULL THEN ''Y'' WHEN  @state_id=temp.state_id THEN ''N'' ELSE ''Y'' END stateChangeFlag,
@state_id:=stateDesc.state_name as stateName,
CASE WHEN  @zipcode IS NULL  AND zipcode IS NULL THEN  ''N'' WHEN  @zipcode IS NULL AND zipcode IS NOT NULL THEN ''Y'' WHEN  @zipcode=zipcode THEN ''N'' ELSE ''Y'' END zipcodeChangeFlag,
@zipcode:=zipcode as zipcode,
CASE WHEN  @email_address IS NULL  AND email_address IS NULL THEN  ''N'' WHEN  @email_address IS NULL AND email_address IS NOT NULL THEN ''Y'' WHEN  @email_address=email_address THEN ''N'' ELSE ''Y'' END emailAddressChangeFlag,
@email_address:=email_address as emailAddress,
CASE WHEN  @phone_home IS NULL  AND phone_home IS NULL THEN  ''N'' WHEN  @phone_home IS NULL AND phone_home IS NOT NULL THEN ''Y'' WHEN  @phone_home=phone_home THEN ''N'' ELSE ''Y'' END phoneHomeChangeFlag,
@phone_home:=phone_home as phoneHome,
CASE WHEN  @phone_work IS NULL  AND phone_work IS NULL THEN  ''N'' WHEN  @phone_work IS NULL AND phone_work IS NOT NULL THEN ''Y'' WHEN  @phone_work=phone_work THEN ''N'' ELSE ''Y'' END phoneWorkChangeFlag,
@phone_work:=phone_work as phoneWork,
CASE WHEN  @phone_cell IS NULL  AND phone_cell IS NULL THEN  ''N'' WHEN  @phone_cell IS NULL AND phone_cell IS NOT NULL THEN ''Y'' WHEN  @phone_cell=phone_cell THEN ''N'' ELSE ''Y'' END phoneCellChangeFlag,
@phone_cell:=phone_cell as phoneCell,
CASE WHEN  @locator_id IS NULL  AND locator_id IS NULL THEN  ''N'' WHEN  @locator_id IS NULL AND locator_id IS NOT NULL THEN ''Y'' WHEN  @locator_id=locator_id THEN ''N'' ELSE ''Y'' END locatorIdChangeFlag,
@locator_id:=locator_id as locatorId,
CASE WHEN  @program_indicator_id IS NULL  AND program_indicator_id IS NULL THEN  ''N'' WHEN  @program_indicator_id IS NULL AND program_indicator_id IS NOT NULL THEN ''Y'' WHEN  @program_indicator_id=program_indicator_id THEN ''N'' ELSE ''Y'' END programIndicatorChangeFlag,
@program_indicator_id:=program_indicator_id as programIndicator,
CASE WHEN  @title IS NULL  AND title IS NULL THEN  ''N'' WHEN  @title IS NULL AND title IS NOT NULL THEN ''Y'' WHEN  @title=title THEN ''N'' ELSE ''Y'' END titleChangeFlag,
@title:=title as title,
CASE WHEN  @suffix IS NULL  AND suffix IS NULL THEN  ''N'' WHEN  @suffix IS NULL AND suffix IS NOT NULL THEN ''Y'' WHEN  @suffix=suffix THEN ''N'' ELSE ''Y'' END suffixChangeFlag,
@suffix:=suffix as suffix,
CASE WHEN  @billing_pass_through IS NULL  AND billing_pass_through IS NULL THEN  ''N'' WHEN  @billing_pass_through IS NULL AND billing_pass_through IS NOT NULL THEN ''Y'' WHEN  @billing_pass_through=billing_pass_through THEN ''N'' ELSE ''Y'' END billingPassThroughChangeFlag,
@billing_pass_through:=billing_pass_through as billingPassThrough,
CASE WHEN  @client_pass_through IS NULL  AND client_pass_through IS NULL THEN  ''N'' WHEN  @client_pass_through IS NULL AND client_pass_through IS NOT NULL THEN ''Y'' WHEN  @client_pass_through=client_pass_through THEN ''N'' ELSE ''Y'' END clientPassThroughChangeFlag,
@client_pass_through:=client_pass_through as clientPassThrough,
CASE WHEN  @filler_1 IS NULL  AND filler_1 IS NULL THEN  ''N'' WHEN  @filler_1 IS NULL AND filler_1 IS NOT NULL THEN ''Y'' WHEN  @filler_1=filler_1 THEN ''N'' ELSE ''Y'' END filler1ChangeFlag,
@filler_1:=filler_1 as filler1,
CASE WHEN  @filler_2 IS NULL  AND filler_2 IS NULL THEN  ''N'' WHEN  @filler_2 IS NULL AND filler_2 IS NOT NULL THEN ''Y'' WHEN  @filler_2=filler_2 THEN ''N'' ELSE ''Y'' END filler2ChangeFlag,
@filler_2:=filler_2 as filler2,
CASE WHEN  @referral_status IS NULL  AND referral_status IS NULL THEN  ''N'' WHEN  @referral_status IS NULL AND referral_status IS NOT NULL THEN ''Y'' WHEN  @referral_status=referral_status THEN ''N'' ELSE ''Y'' END referalStatusStrChangeFlag,
@referral_status:=referral_status as referalStatusStr,
CASE WHEN  @active IS NULL  AND temp.active IS NULL THEN  ''N'' WHEN  @active IS NULL AND temp.active IS NOT NULL THEN ''Y'' WHEN  @active=temp.active THEN ''N'' ELSE ''Y'' END activeChangeFlag,
@active:= temp.active as active,
CASE WHEN  @data_source_id IS NULL  AND data_source_id IS NULL THEN  ''N'' WHEN  @data_source_id IS NULL AND data_source_id IS NOT NULL THEN ''Y'' WHEN  @data_source_id=data_source_id THEN ''N'' ELSE ''Y'' END dataSourceIdChangeFlag,
@data_source_id:= data_source_id as dataSourceId,
CASE WHEN  @maintenance_code_desc IS NULL  AND maintenance_code_desc IS NULL THEN  ''N'' WHEN  @maintenance_code_desc IS NULL AND maintenance_code_desc IS NOT NULL THEN ''Y'' WHEN  @maintenance_code_desc=maintenance_code_desc THEN ''N'' ELSE ''Y'' END maintenanceCodeDescChangeFlag,
@maintenance_code_desc:= maintenance_code_desc as maintenanceCodeDesc,
@maintenance_code_id:= maintenance_code_id as maintenanceCodeId,
CASE WHEN  @file_type IS NULL  AND eFile.eligibility_file_option_id IS NULL THEN  ''N'' WHEN  @file_type IS NULL AND eFile.eligibility_file_option_id IS NOT NULL THEN ''Y'' WHEN  @file_type=eFile.eligibility_file_option_id THEN ''N'' ELSE ''Y'' END fileTypeChangeFlag,
@file_type:= lkp.lookup_value as fileType,
CASE WHEN  @eligibility_file_type_id IS NULL  AND temp.eligibility_file_type_id IS NULL THEN  ''N'' WHEN  @eligibility_file_type_id IS NULL AND temp.eligibility_file_type_id IS NOT NULL THEN ''Y'' WHEN  @eligibility_file_type_id=temp.eligibility_file_type_id THEN ''N'' ELSE ''Y'' END eligibilityFileTypeIdChangeFlag,
@eligibility_file_type_id:= elgFileType.eligibility_file_type_description as eligibilityFileDesc
FROM ((select * from eligibility_data_history where eligibility_data_id='
                                ,ELIGIBILITY_DATA_ID
                                ,WHERE_CLAUSE_INDIVIDUAL_RECORDS
                                ,' and created_date in(select max(created_date) from eligibility_data_history where created_date<STR_TO_DATE('''
                                ,TIMESTAMP
                                ,''', ''%m/%d/%Y %H:%i'') 
and eligibility_data_id='
                                ,ELIGIBILITY_DATA_ID
                                ,WHERE_CLAUSE_INDIVIDUAL_RECORDS
                                ,' ))
UNION ALL
(select * from eligibility_data_history where eligibility_data_id='
                                ,ELIGIBILITY_DATA_ID
                                ,WHERE_CLAUSE_INDIVIDUAL_RECORDS
                                ,' and DATE_FORMAT(created_date,''%m/%d/%Y %H:%i'')='''
                                ,TIMESTAMP
                                ,''')) as temp
left join 
   state as stateDesc 
      on stateDesc.state_id=temp.state_id  
left join
   eligibility_file_type as elgFileType 
      on elgFileType.eligibility_file_type_id =temp.eligibility_file_type_id
left join eligibility_file eFile
on eFile.file_id=temp.file_id
left join lookup lkp
on lkp.lookup_id=eFile.eligibility_file_option_id and lkp.lookup_group=''FILEOPTION''
CROSS JOIN(SELECT @client_id:=NULL,
@member_id:=NULL,
@account_id:=NULL,
@group_id:=NULL,
@member_first_name:=NULL,
@member_last_name:=NULL,
@member_middle_initial:=NULL,
@date_of_birth:=NULL,
@eligibility_effective_date:=NULL,
@eligibility_end_date:=NULL,
@relationship_code_desc:=NULL,
@relationship_code_id:=NULL,
@coverage_code_desc:=NULL,
@coverage_code_id:=NULL,
@coverage_effective_date:=NULL,
@subsidy_override :=NULL,
@gender_desc:=NULL,
@gender_id:=NULL,
@address_1:=NULL,
@address_2:=NULL,
@city:=NULL,
@state_id:=NULL,
@zipcode:=NULL,
@email_address:=NULL,
@phone_home:=NULL,
@phone_work:=NULL,
@phone_cell:=NULL,
@locator_id:=NULL,
@program_indicator_id:=NULL,
@title:=NULL,
@suffix:=NULL,
@billing_pass_through:=NULL,
@client_pass_through:=NULL,
@filler_1:=NULL,
@filler_2:=NULL,
@referral_status:=NULL,
@active:=NULL, 
@data_source_id:=NULL,
@maintenance_code_desc:=NULL, 
@maintenance_code_id:=NULL, 
@file_type:=NULL,
@eligibility_file_type_id:=NULL) as temp1) as final order by lastUpdated desc LIMIT 1')
;
      END;
    ELSE
      BEGIN
        SET @SQL_QUERY      := concat(
                                 'SELECT 
CASE  when audit_type= ''U'' and data_source_id=''F'' then ''Updated by file''
when audit_type= ''I'' and data_source_id=''S'' then ''Added by user'' 
when audit_type= ''U'' and data_source_id=''S'' then ''Updated by user'' 
when audit_type= ''A'' then ''Referred by User''
when audit_type= ''D'' then ''Deactivated Referral'' END  as updated, 
DATE_FORMAT(temp.created_date,''%m/%d/%Y %H:%i'') AS lastUpdated,
eligibility_data_id as eligibilityDataId,
system_source_desc as lastUpdateSource,
temp.created_by as user,
transition_id as transitionId,
temp.file_id as fileId,
CASE WHEN eFile.file_name is NULL then ''N/A'' ELSE eFile.file_name END  as fileName, 
temp.client_id as clientId,
member_id as memberId,
temp.account_id as accountId,
group_id as groupId,
member_first_name as memberFirstName,
member_last_name as memberLastName,
member_middle_initial as memberMiddleInitial,
date_of_birth as dob,
eligibility_effective_date as eligibilityEffDateStr,
eligibility_end_date as eligibilityEndDateStr,
relationship_code_desc as relationshipCodeDesc,
relationship_code_id as relationshipCodeId,
coverage_code_desc   as coverageCodeDesc,
coverage_code_id   as coverageCodeId,
coverage_effective_date as coverageEffDateStr,
subsidy_override as subsidyOverride,
gender_desc as genderDesc,
gender_id as genderId,
address_1 as address1,
address_2 as address2,
city as city,
stateDesc.state_name as stateName,
zipcode as zipcode,
email_address as emailAddress,
phone_home as phoneHome,
phone_work as phoneWork,
phone_cell as phoneCell,
locator_id as locatorId,
program_indicator_id as programIndicator,
title as title,
suffix as suffix,
billing_pass_through as billingPassThrough,
client_pass_through as clientPassThrough,
filler_1 as filler1,
filler_2 as filler2,
referral_status as referalStatusStr,
temp.active as active,
data_source_id as dataSourceId,
maintenance_code_desc as maintenanceCodeDesc,
maintenance_code_id as maintenanceCodeId,
lkp.lookup_value as fileType,
elgFileType.eligibility_file_type_description as eligibilityFileDesc
FROM eligibility_data_history temp
left join 
   state as stateDesc 
      on stateDesc.state_id=temp.state_id  
left join
   eligibility_file_type as elgFileType 
      on elgFileType.eligibility_file_type_id =temp.eligibility_file_type_id
left join eligibility_file eFile
on eFile.file_id=temp.file_id
left join lookup lkp
on lkp.lookup_id=eFile.eligibility_file_option_id and lkp.lookup_group=''FILEOPTION'' '
                                ,WHERE_CLAUSE_OUTER
                                ,' '
                                ,SORT_CLAUSE
                                ,' '
                                ,PAGENATION_STRING);
      END;
    END IF;


    PREPARE stmt3 FROM @SQL_QUERY    ;
    EXECUTE stmt3    ;

    SELECT
      @SQL_QUERY;
  END ;;
