            WHEN sql_column_name = ''system_source_id'' THEN newvalue 

         END) system_source_id,

         MAX(CASE 

            WHEN sql_column_name = ''member_record_number'' THEN newvalue 

         END) member_record_number,

         MAX(CASE 

            WHEN sql_column_name = ''number_of_columns'' THEN newvalue 

         END) number_of_columns,

         MAX(CASE 

            WHEN sql_column_name = ''mem_rec_count'' THEN newvalue 

         END) mem_rec_count,

         MAX(CASE 

            WHEN sql_column_name = ''maintenance_code'' THEN newvalue 

         END) maintenance_code_id,

         MAX(CASE 

            WHEN sql_column_name = ''file_type'' THEN newvalue 

         END) file_type,

         MAX(CASE 

            WHEN sql_column_name = ''eligibility_file_option_id'' THEN newvalue 

         END) eligibility_file_type_id,

         MAX(CASE 

            WHEN sql_column_name = ''date_sent'' THEN newvalue 

         END) date_sent,

         MAX(CASE 

            WHEN sql_column_name = ''date_file_sent'' THEN newvalue 

         END) date_file_sent,

         MAX(CASE 

            WHEN sql_column_name = ''transition_id'' THEN newvalue 

         END) transition_id,

         MAX(CASE 

            WHEN sql_column_name = ''active'' THEN newvalue 

