         MAX(CASE 

            WHEN sql_column_name = ''member_id'' THEN newvalue 

         END) member_id,

         MAX(CASE 

            WHEN sql_column_name = ''client_id'' THEN newvalue 

         END) client_id,

         MAX(CASE 

            WHEN sql_column_name = ''account_id'' THEN newvalue 

         END) account_id,

         MAX(CASE 

            WHEN sql_column_name = ''group_id'' THEN newvalue 

         END) group_id,

         MAX(CASE 

            WHEN sql_column_name = ''member_first_name'' THEN newvalue 

         END) as member_first_name,

         MAX(CASE 

            WHEN sql_column_name = ''member_middle_initial'' THEN newvalue 

         END)  member_middle_initial,

         MAX(CASE 

            WHEN sql_column_name = ''member_last_name'' THEN newvalue 

         END) member_last_name,

         MAX(CASE 

            WHEN sql_column_name = ''date_of_birth'' THEN newvalue 

         END) as date_of_birth,

         MAX(CASE 

            WHEN sql_column_name = ''eligibility_effective_date'' THEN newvalue 

         END) eligibility_effective_date,

         MAX(CASE 

            WHEN sql_column_name = ''eligibility_end_date'' THEN newvalue 

         END) eligibility_end_date,

         MAX(CASE 

            WHEN sql_column_name = ''relationship_code'' THEN newvalue 

         END) relationship_code_id,

         MAX(CASE 

            WHEN sql_column_name = ''coverage_code'' THEN newvalue 

         END) coverage_code_id,

         MAX(CASE 

            WHEN sql_column_name = ''coverage_effective_date'' THEN newvalue 

         END) coverage_effective_date,

         MAX(CASE 

            WHEN sql_column_name = ''subsidy_override'' THEN newvalue 

         END) subsidy_override,

         MAX(CASE 

            WHEN sql_column_name = ''gender'' THEN newvalue 

         END) gender_id,

         MAX(CASE 

            WHEN sql_column_name = ''address_1'' THEN newvalue 

         END)  address_1,

         MAX(CASE 

            WHEN sql_column_name = ''address_2'' THEN newvalue 

         END) address_2,

         MAX(CASE 

            WHEN sql_column_name = ''city'' THEN newvalue 

         END) city,

         MAX(CASE 

            WHEN sql_column_name = ''state'' THEN newvalue 

         END) state_id,

         MAX(CASE 

            WHEN sql_column_name = ''zipcode'' THEN newvalue 

         END) zipcode,

         MAX(CASE 

            WHEN sql_column_name = ''email_address'' THEN newvalue 

         END) email_address,

         MAX(CASE 

            WHEN sql_column_name = ''phone_work'' THEN newvalue 

         END) phone_work,

         MAX(CASE 

            WHEN sql_column_name = ''phone_home'' THEN newvalue 

         END) phone_home,

         MAX(CASE 

            WHEN sql_column_name = ''phone_cell'' THEN newvalue 

         END) as phone_cell,

         MAX(CASE 

            WHEN sql_column_name = ''locator_id'' THEN newvalue 

         END) as locator_id,

         MAX(CASE 

            WHEN sql_column_name = ''program_indicator'' THEN newvalue 

         END) as program_indicator_id,

         MAX(CASE 

            WHEN sql_column_name = ''title'' THEN newvalue 

         END) title,

         MAX(CASE 

            WHEN sql_column_name = ''suffix'' THEN newvalue 

         END) suffix,

         MAX(CASE 

            WHEN sql_column_name = ''billing_pass_through'' THEN newvalue 

         END) billing_pass_through,

         MAX(CASE 

            WHEN sql_column_name = ''client_pass_through'' THEN newvalue 

         END) as client_pass_through,

         MAX(CASE 

            WHEN sql_column_name = ''filler_1'' THEN newvalue 

         END)  filler_1,

         MAX(CASE 

            WHEN sql_column_name = ''filler_2'' THEN newvalue 

         END) filler_2,

         MAX(CASE 

            WHEN sql_column_name = ''referral_status'' THEN newvalue 

         END) referral_status,

              MAX(CASE 

            WHEN sql_column_name = ''coverage_code_desc'' THEN newvalue 

         END) coverage_code_desc  ,

              MAX(CASE 

            WHEN sql_column_name = ''maintenance_code_desc'' THEN newvalue 

         END) maintenance_code_desc  ,

              MAX(CASE 

            WHEN sql_column_name = ''relationship_code_desc'' THEN newvalue 

         END) relationship_code_desc  ,

              MAX(CASE 

            WHEN sql_column_name = ''system_source_desc'' THEN newvalue 

         END) system_source_desc  ,

              MAX(CASE 

            WHEN sql_column_name = ''gender_desc'' THEN newvalue 

         END) gender_desc  

      FROM

         eligibility_file_column filecolumn 

      left join

         eligibility_data_column_history history 

            on history.column_id =filecolumn.column_id   

      left join

         eligibility_file eligFile 

            on eligFile.file_id=history.file_id 

      join

         eligibility_data elgdata 

            on elgdata.eligibility_data_id = history.eligibility_data_id ',WHERE_CLAUSE_INNER,' GROUP BY

         history.created_date,

         elgdata.eligibility_data_id

      order by

         elgdata.eligibility_data_id,

         history.created_date )results  CROSS 

   JOIN

      (

         SELECT

            @prevEligibilityId:= NULL,

            @billing_pass_through:= NULL,

            @address_1:= NULL,

            @address_2:= NULL,

            @city:= NULL,

            @active:=NULL,

            @account_id:=NULL,

            @client_pass_through:= NULL,

            @coverage_code_id:= NULL,

            @data_source_id:=NULL,

            @date_file_sent:=NULL,

            @date_sent:=NULL,

            @coverage_effective_date:= NULL,

            @date_of_birth:= NULL,

            @eligibility_effective_date:= NULL,

            @eligibility_end_date:= NULL,

            @eligibility_file_type_id:= NULL,

            @maintenance_code_id:= NULL,

            @email_address:= NULL,

            @file_type:= NULL,

            @filler_1:= NULL,

            @filler_2:= NULL,

            @group_id:= NULL,

            @gender_id:= NULL,

            @locator_id:= NULL,

            @member_first_name:= NULL,

            @member_id:= NULL,

            @member_last_name:= NULL,

            @member_middle_initial:= NULL,

            @phone_cell:= NULL,

            @phone_home:= NULL,

            @phone_work:= NULL,

            @program_indicator_id:= NULL,

            @relationship_code_id:= NULL,

            @state_id:= NULL,

            @subsidy_override:= NULL,

            @client_id:=NULL,

            @transition_id:=NULL,

            @suffix:= NULL,

            @time_sent:= NULL,

            @title:= NULL,

            @zipcode:= NULL,

            @referral_status:= NULL,

            @coverage_code_desc:= NULL,

            @maintenance_code_desc:= NULL,

            @relationship_code_desc:= NULL,

            @system_source_desc:= NULL,

            @system_source_id:= NULL,

            @gender_desc:= NULL

      ) dummy

   )temp   

left join

   state as stateDesc 

      on stateDesc.state_id=state  

left join

   eligibility_file_type as elgFileType 

      on elgFileType.eligibility_file_type_id =eligibilityFileTypeId ', WHERE_CLAUSE_OUTER,' ',SORT_CLAUSE ,' ',PAGENATION_STRING); 

    



     

     

    PREPARE stmt3 FROM @SQL_QUERY;

    EXECUTE stmt3;

    

      

END ;;
