DELIMITER ;;
CREATE DEFINER=`eligibilityapp`@`%` PROCEDURE `eligibilitydatahistory_fetch_backoup_column_history_with_inserts`(

IN ACCOUNT_ID VARCHAR(1000),

IN CREATED_DATE_START VARCHAR(30),

IN CREATED_DATE_END VARCHAR(30),

IN MEMBER_ID VARCHAR(15),

IN GROUP_ID VARCHAR(15),

IN ELIGIBILITY_DATA_ID VARCHAR(20),

IN MEMBER_FIRST_NAME VARCHAR(20),

IN MEMBER_LAST_NAME VARCHAR(20),

IN UPDATE_TYPE VARCHAR(100),

IN CLIENT_ID VARCHAR(20),

IN SORT_CRITERIA VARCHAR(20),

IN COLUMN_NAME_SORT VARCHAR(20),

IN PAGE_SIZE INT ,

IN PAGE_NUMBER INT ,

IN TIMESTAMP VARCHAR(20))
BEGIN



DECLARE WHERE_CLAUSE_OUTER VARCHAR(2000);

DECLARE WHERE_CLAUSE_INNER VARCHAR(200);

DECLARE SORT_CLAUSE VARCHAR(100);

DECLARE OFFSET BIGINT;

DECLARE PAGENATION_STRING VARCHAR(50);

DECLARE CLAUSE_FOR_AUDIT_TYPE VARCHAR(300);

DECLARE CLAUSE_FOR_HISTORY_DS VARCHAR(200);

DECLARE CLAUSE_FOR_SUBTYPE  VARCHAR(300) ;

DECLARE subUpdateType  VARCHAR(50) ;

SET CLAUSE_FOR_HISTORY_DS:='';

SET CLAUSE_FOR_AUDIT_TYPE:='';

SET CLAUSE_FOR_SUBTYPE:='';

SET WHERE_CLAUSE_OUTER:='';

SET WHERE_CLAUSE_INNER:='';

SET PAGENATION_STRING:='';

SET subUpdateType:='';





IF PAGE_SIZE<>0 THEN

 BEGIN

 

 SET PAGENATION_STRING:=concat(' LIMIT ',PAGE_SIZE,' OFFSET ', PAGE_NUMBER);

 END;

END IF;







IF COLUMN_NAME_SORT='fileName'  OR COLUMN_NAME_SORT='groupId' 

OR COLUMN_NAME_SORT='memberId' OR COLUMN_NAME_SORT='memberFirstName' OR COLUMN_NAME_SORT='user' 

OR COLUMN_NAME_SORT='memberLastName' 

THEN

   BEGIN

   SET SORT_CLAUSE:=concat(' ORDER BY ',COLUMN_NAME_SORT,' ',SORT_CRITERIA,' ,');

   SET SORT_CLAUSE:=concat(SORT_CLAUSE,' ABS(',COLUMN_NAME_SORT,') ',SORT_CRITERIA,' ');

    END;

    ELSEIF COLUMN_NAME_SORT='dob' OR COLUMN_NAME_SORT='accountId' OR COLUMN_NAME_SORT='lastUpdated' OR COLUMN_NAME_SORT='updated' THEN

    BEGIN

      SET SORT_CLAUSE:=concat(' ORDER BY ',COLUMN_NAME_SORT,' ',SORT_CRITERIA,' ');  

    END;

    ELSE

   BEGIN

   SET COLUMN_NAME_SORT:='lastUpdated';

    SET SORT_CLAUSE:=concat(' ORDER BY ',COLUMN_NAME_SORT);

    END;

 END IF;

 

 

 



  

 

 

 

 

 

  

IF ACCOUNT_ID <> '' THEN

    BEGIN

   SET WHERE_CLAUSE_OUTER:=concat(WHERE_CLAUSE_OUTER,' AND accountId IN(',ACCOUNT_ID,') ');

    END;

  END IF;

 

 IF TIMESTAMP <> '' THEN

    BEGIN

   SET WHERE_CLAUSE_OUTER:=concat(WHERE_CLAUSE_OUTER,' AND  DATE_FORMAT(cdate,''%m/%d/%Y %H:%i'')=''',TIMESTAMP,''' ');

    END;

  END IF;

  

IF CREATED_DATE_START <> ''  AND CREATED_DATE_END<> ''  THEN

    BEGIN

   

   SET WHERE_CLAUSE_OUTER:=concat(WHERE_CLAUSE_OUTER, ' AND ( DATE_FORMAT(cdate,''%Y-%m-%d'') between ''',CREATED_DATE_START,''' AND ''',CREATED_DATE_END,''') ');

    END;

  END IF;

  

  IF MEMBER_ID<>'' THEN

  BEGIN

   SET WHERE_CLAUSE_OUTER:=concat(WHERE_CLAUSE_OUTER ,' AND memberId= ''',MEMBER_ID,''' ');

  END;

  END IF; 

  

  IF CLIENT_ID<>'' THEN

  BEGIN

   SET WHERE_CLAUSE_OUTER:=concat(WHERE_CLAUSE_OUTER ,' AND clientId= ''',CLIENT_ID,''' ');

  END;

  END IF;   

    

  IF GROUP_ID<>'' THEN

  BEGIN

   SET WHERE_CLAUSE_OUTER:=concat(WHERE_CLAUSE_OUTER, ' AND  groupId= ''',GROUP_ID,''' ');

  END;

  END IF;

    

  IF ELIGIBILITY_DATA_ID<>'' THEN

  BEGIN

   SET WHERE_CLAUSE_INNER:=concat(WHERE_CLAUSE_INNER, ' AND elgdata.ELIGIBILITY_DATA_ID= ''',ELIGIBILITY_DATA_ID,''' ');

  END;

  END IF;

  

  IF MEMBER_FIRST_NAME<>'' THEN

  BEGIN

   SET WHERE_CLAUSE_OUTER:=concat(WHERE_CLAUSE_OUTER, ' AND UPPER(firstName) LIKE ''%',UPPER(MEMBER_FIRST_NAME),'%'' ');

  END;

  END IF;

  

  IF MEMBER_LAST_NAME<>'' THEN

  BEGIN

   SET WHERE_CLAUSE_OUTER:=concat(WHERE_CLAUSE_OUTER, ' AND UPPER(lastName) LIKE ''%',UPPER(MEMBER_LAST_NAME),'%'' ');

  END;

  END IF;

  

  

 SET subUpdateType:=(SELECT FIND_IN_SET('FILEA',UPDATE_TYPE));  

 

  IF subUpdateType<>0 THEN

  BEGIN

   SET CLAUSE_FOR_AUDIT_TYPE := concat(CLAUSE_FOR_AUDIT_TYPE,' OR (updatedImm=''I'' AND dataSourceId=''F'') ');

  END;

  END IF;

 

 SET subUpdateType:=(SELECT FIND_IN_SET('USERA',UPDATE_TYPE));

  IF subUpdateType<>0 THEN

  BEGIN

   SET CLAUSE_FOR_AUDIT_TYPE := concat(CLAUSE_FOR_AUDIT_TYPE,' OR (updatedImm=''I'' AND dataSourceId=''S'') ');

  END;

  END IF;

  

  SET subUpdateType:=(SELECT FIND_IN_SET('FILEU',UPDATE_TYPE));

  IF subUpdateType<>0 THEN

  BEGIN

   SET CLAUSE_FOR_AUDIT_TYPE := concat(CLAUSE_FOR_AUDIT_TYPE,' OR (updatedImm=''U'' AND dataSourceId=''F'') ');

  END;

  END IF;

 

  SET subUpdateType:=(SELECT FIND_IN_SET('USERU',UPDATE_TYPE));

  IF subUpdateType<>0 THEN

  BEGIN

   SET CLAUSE_FOR_AUDIT_TYPE := concat(CLAUSE_FOR_AUDIT_TYPE,' OR (updatedImm=''U'' AND  dataSourceId=''S'') ');

  END;

  END IF;

  

  SET subUpdateType:=(SELECT FIND_IN_SET('ACT',UPDATE_TYPE));

  IF subUpdateType<>0 THEN

  BEGIN

   SET CLAUSE_FOR_AUDIT_TYPE := concat(CLAUSE_FOR_AUDIT_TYPE,' OR (updatedImm=''A'') ');

  END;

  END IF;

  

  SET subUpdateType:=(SELECT FIND_IN_SET('DEACT',UPDATE_TYPE));

  IF subUpdateType<>0 THEN

  BEGIN

   SET CLAUSE_FOR_AUDIT_TYPE := concat(CLAUSE_FOR_AUDIT_TYPE,' OR (updatedImm=''D'') ');

  END;

  END IF; 

  

  

  

  IF UPDATE_TYPE<>'' THEN

  BEGIN

  SET CLAUSE_FOR_SUBTYPE:=concat(' AND(',CLAUSE_FOR_AUDIT_TYPE,')');

  SET CLAUSE_FOR_SUBTYPE:= REPLACE (CLAUSE_FOR_SUBTYPE,' AND( OR',' AND( ');

  SET WHERE_CLAUSE_OUTER:=concat(WHERE_CLAUSE_OUTER,CLAUSE_FOR_SUBTYPE);

   END;

  END IF; 

  

  IF WHERE_CLAUSE_OUTER<>'' THEN

  BEGIN

   SET WHERE_CLAUSE_OUTER:= concat(' WHERE',WHERE_CLAUSE_OUTER);

   SET WHERE_CLAUSE_OUTER:= REPLACE (WHERE_CLAUSE_OUTER,'WHERE AND','WHERE');

  END;

  END IF;

   

  IF WHERE_CLAUSE_INNER<>'' THEN

  BEGIN

     SET WHERE_CLAUSE_INNER:= concat(' WHERE',WHERE_CLAUSE_INNER);

      SET WHERE_CLAUSE_INNER:= REPLACE (WHERE_CLAUSE_INNER,'WHERE AND','WHERE');

  END;

  END IF;

  

  

 

  

SET @SQL_QUERY:=concat('SELECT

  case when updatedImm= ''I'' and dataSourceId=''F'' then ''Added by file'' 

  when updatedImm= ''U'' and dataSourceId=''F'' then ''Updated by file''

  when updatedImm= ''I'' and dataSourceId=''S'' then ''Added by user''

  when updatedImm= ''U'' and dataSourceId=''S'' then ''Updated by user''

  when updatedImm= ''A'' then ''Referred by User''

  when updatedImm= ''D'' then ''Deactivated Referral'' END  as updated, 

  DATE_FORMAT(cdate,''%m/%d/%Y %H:%i'') AS lastUpdated,

  CASE WHEN fileName is NULL then ''N/A''

  ELSE fileName END  as fileName, 

   eligibility_data_id as eligibilityDataId,

   systemSourceDesc as lastUpdateSource,

   user,

   transition_id as transitionId,

   member_missing as memberMissing,

   member_record_number as memberRecordNumber,

   mem_rec_count as memRecCount,

   file_id as fileId,

   clientIdChangeFlag,

   clientId,

   memberIdChangeFlag,

   memberId,

   accountIdChangeFlag,

   accountId,

   groupIdChangeFlag,

   groupId,

   firstNameChangeFlag as memberFirstNameChangeFlag,

   firstName as memberFirstName,

   lastNameChangeFlag as memberLastNameChangeFlag,

   lastName as memberLastName,

   middleNameChangeFlag as memberMiddleInitialChangeFlag,

   middleName as memberMiddleInitial,

   dobChangeFlag,

   dob,

   eligibilityEffectiveDateChangeFlag as eligibilityEffDateStrChangeFlag,

   eligibilityEffectiveDate as eligibilityEffDateStr,

   eligibilityEndDateChangeFlag as eligibilityEndDateStrChangeFlag,

   eligibilityEndDate as eligibilityEndDateStr,

   relationshipCodeChangeFlag as relationshipCodeDescChangeFlag,

   relationshipCodeDesc as relationshipCodeDesc,

   relationshipCodeId,

   coverageCodeChangeFlag as coverageCodeDescChangeFlag,

   coverageCodeDesc as coverageCodeDesc,

   coverageCodeId as coverageCodeId,

   coverageEffectiveDateChangeFlag as coverageEffDateStrChangeFlag,

   coverageEffectiveDate as coverageEffDateStr,

   subsidyOverrideChangeFlag,

   subsidyOverride,

   genderIdChangeFlag as genderDescChangeFlag,

   genderDesc as genderDesc,

   genderId,

   address1ChangeFlag,

   address1,

   address2ChangeFlag,

   address2,

   cityChangeFlag,

   city,

   stateChangeFlag,

   stateDesc.state_name stateName,

   zipcodeChangeFlag,

   zipcode,

   emailIdChangeFlag as emailAddressChangeFlag,

   emailId as emailAddress,

   phoneHomeChangeFlag,

   phoneHome,

   phoneWorkChangeFlag,

   phoneWork,

   phoneCellChangeFlag,

   phoneCell,

   locatorIdChangeFlag,

   locatorId,

   programIndicatorChangeFlag,

   programIndicator,

   titleChangeFlag,

   title,

   suffixChangeFlag,

   suffix,

   billingPassThroughChangeFlag,

   billingPassThrough,

   clientPassThroughChangeFlag,

   clientPassThrough,

   filler1ChangeFlag,

   filler1,

   filler2ChangeFlag,

   filler2,

   referalStatusChangeFlag as referalStatusStrChangeFlag,

   referalStatus as referalStatusStr,

   activeChangeFlag,

   temp.active as active,

   dataSourceIdChangeFlag,

   dataSourceId,

   dataFileSentChangeFlag,

   dataFileSent,

   dateSentChangeFlag,

   dateSent,

   maintenanceCodeIdChangeFlag as maintenanceCodeDescChangeFlag,

   maintenanceCodeDesc as  maintenanceCodeDesc,

   maintenanceCodeId,

   fileTypeChangeFlag,

   fileType,

   elgFileType.eligibility_file_type_description eligibilityFileDesc,

   eligibilityFileTypeIdChangeFlag  eligibilityFileTypeIdChangeFlag  

FROM

   (SELECT

      created_date AS cdate,

      file_name AS fileName,

      eligibility_data_id AS eligibility_data_id,

      created_by AS user,

      transition_id AS transition_id,

      member_missing AS member_missing,

      member_record_number AS member_record_number,

      number_of_columns AS number_of_columns,

      mem_rec_count as mem_rec_count,

      file_id as file_id,

      (CASE 

         WHEN  @prevEligibilityId=eligibility_data_id  

         and  client_id IS NULL THEN  ''N'' 

         ELSE ''Y'' 

      END) clientIdChangeFlag,

      (CASE 

         WHEN  @prevEligibilityId=eligibility_data_id  

         and  client_id IS NULL THEN  @client_id 

         ELSE @client_id:=client_id 

      END) clientId,

      (CASE 

         WHEN  @prevEligibilityId=eligibility_data_id  

         and  eligibility_file_type_id IS NULL THEN  ''N'' 

         ELSE ''Y'' 

      END) eligibilityFileTypeIdChangeFlag,

      (CASE 

         WHEN  @prevEligibilityId=eligibility_data_id  

         and  eligibility_file_type_id IS NULL THEN  @eligibility_file_type_id 

         ELSE @eligibility_file_type_id:=eligibility_file_type_id 

      END) eligibilityFileTypeId,

      (CASE 

         WHEN  @prevEligibilityId=eligibility_data_id  

         and  member_id IS NULL THEN  ''N'' 

         ELSE ''Y'' 

      END) memberIdChangeFlag,

      (CASE 

         WHEN  @prevEligibilityId=eligibility_data_id  

         and  member_id IS NULL THEN  @member_id 

         ELSE @member_id:=member_id 

      END) memberId,

      (CASE 

         WHEN  @prevEligibilityId=eligibility_data_id  

         and  account_id IS NULL THEN  ''N'' 

         ELSE ''Y'' 

      END) accountIdChangeFlag,

      (CASE 

         WHEN  @prevEligibilityId=eligibility_data_id  

         and  account_id IS NULL THEN @account_id 

         ELSE @account_id:=account_id 

      END) accountId,

      (CASE 

         WHEN  @prevEligibilityId=eligibility_data_id  

         and  group_id IS NULL THEN  ''N'' 

         ELSE ''Y'' 

      END) groupIdChangeFlag,

      (CASE 

         WHEN  @prevEligibilityId=eligibility_data_id  

         and  group_id IS NULL THEN  @group_id  

         ELSE @group_id:=group_id 

      END) groupId,

      (CASE 

         WHEN  @prevEligibilityId=eligibility_data_id  

         and  member_first_name IS NULL THEN  ''N'' 

         ELSE ''Y'' 

      END) firstNameChangeFlag,

      (CASE 

         WHEN  @prevEligibilityId=eligibility_data_id  

         and  member_first_name IS NULL THEN  @member_first_name 

         ELSE @member_first_name:=member_first_name 

      END) firstName,

      (CASE 

         WHEN  @prevEligibilityId=eligibility_data_id  

         and  member_last_name IS NULL THEN  ''N'' 

         ELSE ''Y'' 

      END) lastNameChangeFlag,

      (CASE 

         WHEN  @prevEligibilityId=eligibility_data_id  

         and  member_last_name IS NULL THEN  @member_last_name 

         ELSE @member_last_name:=member_last_name 

      END) lastName,

      (CASE 

         WHEN  @prevEligibilityId=eligibility_data_id  

         and  member_middle_initial IS NULL THEN  ''N'' 

         ELSE ''Y'' 

      END) middleNameChangeFlag,

      (CASE 

         WHEN  @prevEligibilityId=eligibility_data_id  

         and  member_middle_initial IS NULL THEN  @member_middle_initial 

         ELSE @member_middle_initial:=member_middle_initial 

      END) middleName,

      (CASE 

         WHEN  @prevEligibilityId=eligibility_data_id  

         and  date_of_birth IS NULL THEN  ''N'' 

         ELSE ''Y'' 

      END) dobChangeFlag,

      (CASE 

         WHEN  @prevEligibilityId=eligibility_data_id  

         and  date_of_birth IS NULL THEN  @date_of_birth 

         ELSE @date_of_birth:=date_of_birth 

      END) dob,

      (CASE 

         WHEN  @prevEligibilityId=eligibility_data_id  

         and  eligibility_effective_date IS NULL THEN  ''N'' 

         ELSE ''Y'' 

      END) eligibilityEffectiveDateChangeFlag,

      (CASE 

         WHEN  @prevEligibilityId=eligibility_data_id  

         and  eligibility_effective_date IS NULL THEN  @eligibility_effective_date 

         ELSE @eligibility_effective_date:=eligibility_effective_date 

      END) eligibilityEffectiveDate,

      (CASE 

         WHEN  @prevEligibilityId=eligibility_data_id  

         and  eligibility_end_date IS NULL THEN  ''N'' 

         ELSE ''Y'' 

      END) eligibilityEndDateChangeFlag,

      (CASE 

         WHEN  @prevEligibilityId=eligibility_data_id  

         and  eligibility_end_date IS NULL THEN  @eligibility_end_date 

         ELSE @eligibility_end_date:=eligibility_end_date 

      END) eligibilityEndDate,

      (CASE 

