CREATE DEFINER=`wwhsadmin`@`%` PROCEDURE `eligibilitydatahistory_fetch_with_changes`(

IN ACCOUNT_ID VARCHAR(1000),

IN CREATED_DATE_START VARCHAR(30),

IN CREATED_DATE_END VARCHAR(30),

IN MEMBER_ID VARCHAR(15),

IN GROUP_ID VARCHAR(15),

IN ELIGIBILITY_DATA_ID VARCHAR(20),

IN MEMBER_FIRST_NAME VARCHAR(20),

IN MEMBER_LAST_NAME VARCHAR(20),

IN UPDATE_TYPE VARCHAR(100),

IN CLIENT_ID VARCHAR(20),

IN SORT_CRITERIA VARCHAR(20),

IN COLUMN_NAME_SORT VARCHAR(20),

IN PAGE_SIZE INT ,

IN PAGE_NUMBER INT ,

IN TIMESTAMP VARCHAR(20))
BEGIN



DECLARE WHERE_CLAUSE_OUTER VARCHAR(2000);

DECLARE WHERE_CLAUSE_INNER VARCHAR(200);

DECLARE SORT_CLAUSE VARCHAR(100);

DECLARE OFFSET BIGINT;

DECLARE PAGENATION_STRING VARCHAR(50);

DECLARE CLAUSE_FOR_AUDIT_TYPE VARCHAR(300);

DECLARE CLAUSE_FOR_HISTORY_DS VARCHAR(200);

DECLARE CLAUSE_FOR_SUBTYPE  VARCHAR(300) ;

DECLARE subUpdateType  VARCHAR(50) ;

SET CLAUSE_FOR_HISTORY_DS:='';

SET CLAUSE_FOR_AUDIT_TYPE:='';

SET CLAUSE_FOR_SUBTYPE:='';

SET WHERE_CLAUSE_OUTER:='';

SET WHERE_CLAUSE_INNER:='';

SET PAGENATION_STRING:='';

SET subUpdateType:='';





IF PAGE_SIZE<>0 THEN

 BEGIN

 

 SET PAGENATION_STRING:=concat(' LIMIT ',PAGE_SIZE,' OFFSET ', PAGE_NUMBER);

 END;

END IF;







IF COLUMN_NAME_SORT='fileName'  OR COLUMN_NAME_SORT='groupId' 

OR COLUMN_NAME_SORT='memberId' OR COLUMN_NAME_SORT='memberFirstName' OR COLUMN_NAME_SORT='user' 

OR COLUMN_NAME_SORT='memberLastName' 

THEN

   BEGIN

   SET SORT_CLAUSE:=concat(' ORDER BY ',COLUMN_NAME_SORT,' ',SORT_CRITERIA,' ,');

   SET SORT_CLAUSE:=concat(SORT_CLAUSE,' ABS(',COLUMN_NAME_SORT,') ',SORT_CRITERIA,' ');

    END;

    ELSEIF COLUMN_NAME_SORT='dob' OR COLUMN_NAME_SORT='accountId' OR COLUMN_NAME_SORT='lastUpdated' OR COLUMN_NAME_SORT='updated' THEN

    BEGIN

      SET SORT_CLAUSE:=concat(' ORDER BY ',COLUMN_NAME_SORT,' ',SORT_CRITERIA,' ');  

    END;

    ELSE

   BEGIN

   SET COLUMN_NAME_SORT:='lastUpdated';

    SET SORT_CLAUSE:=concat(' ORDER BY ',COLUMN_NAME_SORT);

    END;

 END IF;

 

 

 



  

 

 

 

 

 

  

IF ACCOUNT_ID <> '' THEN

    BEGIN

   SET WHERE_CLAUSE_OUTER:=concat(WHERE_CLAUSE_OUTER,' AND accountId IN(',ACCOUNT_ID,') ');

    END;

  END IF;

 

 IF TIMESTAMP <> '' THEN

    BEGIN

   SET WHERE_CLAUSE_OUTER:=concat(WHERE_CLAUSE_OUTER,' AND  DATE_FORMAT(cdate,''%m/%d/%Y %H:%i'')=''',TIMESTAMP,''' ');

    END;

  END IF;

  

IF CREATED_DATE_START <> ''  AND CREATED_DATE_END<> ''  THEN

    BEGIN

   

   SET WHERE_CLAUSE_OUTER:=concat(WHERE_CLAUSE_OUTER, ' AND ( DATE_FORMAT(cdate,''%Y-%m-%d'') between ''',CREATED_DATE_START,''' AND ''',CREATED_DATE_END,''') ');

    END;

  END IF;

  

  IF MEMBER_ID<>'' THEN

  BEGIN

   SET WHERE_CLAUSE_OUTER:=concat(WHERE_CLAUSE_OUTER ,' AND memberId= ''',MEMBER_ID,''' ');

  END;

  END IF; 

  

  IF CLIENT_ID<>'' THEN

  BEGIN

   SET WHERE_CLAUSE_OUTER:=concat(WHERE_CLAUSE_OUTER ,' AND clientId= ''',CLIENT_ID,''' ');

  END;

  END IF;   

    

  IF GROUP_ID<>'' THEN

  BEGIN

   SET WHERE_CLAUSE_OUTER:=concat(WHERE_CLAUSE_OUTER, ' AND  groupId= ''',GROUP_ID,''' ');

  END;

  END IF;

    

  IF ELIGIBILITY_DATA_ID<>'' THEN

  BEGIN

   SET WHERE_CLAUSE_INNER:=concat(WHERE_CLAUSE_INNER, ' AND elgdata.ELIGIBILITY_DATA_ID= ''',ELIGIBILITY_DATA_ID,''' ');

  END;

  END IF;

  

  IF MEMBER_FIRST_NAME<>'' THEN

  BEGIN

   SET WHERE_CLAUSE_OUTER:=concat(WHERE_CLAUSE_OUTER, ' AND UPPER(firstName) LIKE ''%',UPPER(MEMBER_FIRST_NAME),'%'' ');

  END;

  END IF;

  

  IF MEMBER_LAST_NAME<>'' THEN

  BEGIN

   SET WHERE_CLAUSE_OUTER:=concat(WHERE_CLAUSE_OUTER, ' AND UPPER(lastName) LIKE ''%',UPPER(MEMBER_LAST_NAME),'%'' ');

  END;

  END IF;

  

  

 SET subUpdateType:=(SELECT FIND_IN_SET('FILEA',UPDATE_TYPE));  

 

  IF subUpdateType<>0 THEN

  BEGIN

   SET CLAUSE_FOR_AUDIT_TYPE := concat(CLAUSE_FOR_AUDIT_TYPE,' OR (updatedImm=''I'' AND dataSourceId=''F'') ');

  END;

  END IF;

 

 SET subUpdateType:=(SELECT FIND_IN_SET('USERA',UPDATE_TYPE));

  IF subUpdateType<>0 THEN

  BEGIN

   SET CLAUSE_FOR_AUDIT_TYPE := concat(CLAUSE_FOR_AUDIT_TYPE,' OR (updatedImm=''I'' AND dataSourceId=''S'') ');

  END;

  END IF;

  

  SET subUpdateType:=(SELECT FIND_IN_SET('FILEU',UPDATE_TYPE));

  IF subUpdateType<>0 THEN

  BEGIN

   SET CLAUSE_FOR_AUDIT_TYPE := concat(CLAUSE_FOR_AUDIT_TYPE,' OR (updatedImm=''U'' AND dataSourceId=''F'') ');

  END;

  END IF;

 

  SET subUpdateType:=(SELECT FIND_IN_SET('USERU',UPDATE_TYPE));

  IF subUpdateType<>0 THEN

  BEGIN

   SET CLAUSE_FOR_AUDIT_TYPE := concat(CLAUSE_FOR_AUDIT_TYPE,' OR (updatedImm=''U'' AND  dataSourceId=''S'') ');

  END;

  END IF;

  

  SET subUpdateType:=(SELECT FIND_IN_SET('ACT',UPDATE_TYPE));

  IF subUpdateType<>0 THEN

  BEGIN

   SET CLAUSE_FOR_AUDIT_TYPE := concat(CLAUSE_FOR_AUDIT_TYPE,' OR (updatedImm=''A'') ');

  END;

  END IF;

  

  SET subUpdateType:=(SELECT FIND_IN_SET('DEACT',UPDATE_TYPE));

  IF subUpdateType<>0 THEN

  BEGIN

   SET CLAUSE_FOR_AUDIT_TYPE := concat(CLAUSE_FOR_AUDIT_TYPE,' OR (updatedImm=''D'') ');

  END;

  END IF; 

  

  

  

  IF UPDATE_TYPE<>'' THEN

  BEGIN

  SET CLAUSE_FOR_SUBTYPE:=concat(' AND(',CLAUSE_FOR_AUDIT_TYPE,')');

  SET CLAUSE_FOR_SUBTYPE:= REPLACE (CLAUSE_FOR_SUBTYPE,' AND( OR',' AND( ');

  SET WHERE_CLAUSE_OUTER:=concat(WHERE_CLAUSE_OUTER,CLAUSE_FOR_SUBTYPE);

   END;

  END IF; 

  

  IF WHERE_CLAUSE_OUTER<>'' THEN

  BEGIN

   SET WHERE_CLAUSE_OUTER:= concat(' WHERE',WHERE_CLAUSE_OUTER);

   SET WHERE_CLAUSE_OUTER:= REPLACE (WHERE_CLAUSE_OUTER,'WHERE AND','WHERE');

  END;

  END IF;

   

  IF WHERE_CLAUSE_INNER<>'' THEN

  BEGIN

     SET WHERE_CLAUSE_INNER:= concat(' WHERE',WHERE_CLAUSE_INNER);

      SET WHERE_CLAUSE_INNER:= REPLACE (WHERE_CLAUSE_INNER,'WHERE AND','WHERE');

  END;

  END IF;

  

  

 

  

SET @SQL_QUERY:=concat('SELECT

  case when updatedImm= ''I'' and dataSourceId=''F'' then ''Added by file'' 

  when updatedImm= ''U'' and dataSourceId=''F'' then ''Updated by file''

  when updatedImm= ''I'' and dataSourceId=''S'' then ''Added by user''

  when updatedImm= ''U'' and dataSourceId=''S'' then ''Updated by user''

  when updatedImm= ''A'' then ''Referred by User''

  when updatedImm= ''D'' then ''Deactivated Referral'' END  as updated, 

  DATE_FORMAT(cdate,''%m/%d/%Y %H:%i'') AS lastUpdated,

  CASE WHEN fileName is NULL then ''N/A''

  ELSE fileName END  as fileName, 

   eligibility_data_id as eligibilityDataId,

   systemSourceDesc as lastUpdateSource,

   user,

   transition_id as transitionId,

   file_id as fileId,

   clientIdChangeFlag,

   clientId,

   memberIdChangeFlag,

   memberId,

   accountIdChangeFlag,

   accountId,

   groupIdChangeFlag,

   groupId,

   firstNameChangeFlag as memberFirstNameChangeFlag,

   firstName as memberFirstName,

   lastNameChangeFlag as memberLastNameChangeFlag,

   lastName as memberLastName,

   middleNameChangeFlag as memberMiddleInitialChangeFlag,

   middleName as memberMiddleInitial,

   dobChangeFlag,

   dob,

   eligibilityEffectiveDateChangeFlag as eligibilityEffDateStrChangeFlag,

   eligibilityEffectiveDate as eligibilityEffDateStr,

   eligibilityEndDateChangeFlag as eligibilityEndDateStrChangeFlag,

   eligibilityEndDate as eligibilityEndDateStr,

   relationshipCodeChangeFlag as relationshipCodeDescChangeFlag,

   relationshipCodeDesc as relationshipCodeDesc,

   relationshipCodeId,

   coverageCodeChangeFlag as coverageCodeDescChangeFlag,

   coverageCodeDesc as coverageCodeDesc,

   coverageCodeId as coverageCodeId,

   coverageEffectiveDateChangeFlag as coverageEffDateStrChangeFlag,

   coverageEffectiveDate as coverageEffDateStr,

   subsidyOverrideChangeFlag,

   subsidyOverride,

   genderIdChangeFlag as genderDescChangeFlag,

   genderDesc as genderDesc,

   genderId,

   address1ChangeFlag,

   address1,

   address2ChangeFlag,

   address2,

   cityChangeFlag,

   city,

   stateChangeFlag,

   stateDesc.state_name stateName,

   zipcodeChangeFlag,

   zipcode,

   emailIdChangeFlag as emailAddressChangeFlag,

   emailId as emailAddress,

   phoneHomeChangeFlag,

   phoneHome,

   phoneWorkChangeFlag,

   phoneWork,

   phoneCellChangeFlag,

   phoneCell,

   locatorIdChangeFlag,

   locatorId,

   programIndicatorChangeFlag,

   programIndicator,

   titleChangeFlag,

   title,

   suffixChangeFlag,

   suffix,

   billingPassThroughChangeFlag,

   billingPassThrough,

   clientPassThroughChangeFlag,

   clientPassThrough,

   filler1ChangeFlag,

   filler1,

   filler2ChangeFlag,

   filler2,

   referalStatusChangeFlag as referalStatusStrChangeFlag,

   referalStatus as referalStatusStr,

   activeChangeFlag,

   dummy3.active as active,

   dataSourceIdChangeFlag,

   dataSourceId,

   maintenanceCodeIdChangeFlag as maintenanceCodeDescChangeFlag,

   maintenanceCodeDesc as  maintenanceCodeDesc,

   maintenanceCodeId,

   fileTypeChangeFlag,

   fileType,

   elgFileType.eligibility_file_type_description eligibilityFileDesc,

   eligibilityFileTypeIdChangeFlag  eligibilityFileTypeIdChangeFlag  FROM

(SELECT 

eligibility_data_id,

CASE WHEN @prevEligibilityId=eligibility_data_id THEN @modified_date  ELSE created_date END cdate,

@modified_date:=modified_date as modified_date1,

CASE WHEN @prevEligibilityId=eligibility_data_id THEN @modified_by  ELSE created_by END as user,

@modified_by:=modified_by as modified_by1,

transition_id,

file_id,

CASE WHEN @client_id=client_id THEN ''N''  ELSE ''Y'' END clientIdChangeFlag,

@client_id:=client_id  as clientId,

@file_name:=file_name  as fileName,

CASE WHEN @eligibility_file_type_id=eligibility_file_type_id THEN ''N''  ELSE ''Y'' END eligibilityFileTypeIdChangeFlag,

@eligibility_file_type_id:=eligibility_file_type_id  as eligibilityFileTypeId,

CASE WHEN @member_id=member_id THEN ''N''  ELSE ''Y'' END memberIdChangeFlag,

@member_id:=member_id  as memberId,

CASE WHEN @account_id=account_id THEN ''N''  ELSE ''Y'' END accountIdChangeFlag,

@account_id:=account_id  as accountId,

CASE WHEN @group_id=group_id THEN ''N''  ELSE ''Y'' END groupIdChangeFlag,

@group_id:=group_id  as groupId,

CASE WHEN @member_first_name=member_first_name THEN ''N''  ELSE ''Y'' END firstNameChangeFlag,

@member_first_name:=member_first_name  as firstName,

CASE WHEN @member_last_name=member_last_name THEN ''N''  ELSE ''Y'' END lastNameChangeFlag,

@member_last_name:=member_last_name  as lastName,

CASE WHEN @member_middle_initial=member_middle_initial THEN ''N''  ELSE ''Y'' END middleNameChangeFlag,

@member_middle_initial:=member_middle_initial  as middleName,

CASE WHEN @date_of_birth=date_of_birth THEN ''N''  ELSE ''Y'' END dobChangeFlag,

@date_of_birth:=date_of_birth  as dob,

CASE WHEN @eligibility_effective_date=eligibility_effective_date THEN ''N''  ELSE ''Y'' END eligibilityEffectiveDateChangeFlag,

@eligibility_effective_date:=eligibility_effective_date  as eligibilityEffectiveDate,

CASE WHEN @eligibility_end_date=eligibility_end_date THEN ''N''  ELSE ''Y'' END eligibilityEndDateChangeFlag,

@eligibility_end_date:=eligibility_end_date  as  eligibilityEndDate,

CASE WHEN @relationship_code_id=relationship_code_id THEN ''N''  ELSE ''Y'' END relationshipCodeChangeFlag,

@relationship_code_id:=relationship_code_id  as relationshipCodeId,

CASE WHEN @coverage_code_id=coverage_code_id THEN ''N''  ELSE ''Y'' END coverageCodeChangeFlag,

@coverage_code_id:=coverage_code_id  as coverageCodeId,

CASE WHEN @coverage_effective_date=coverage_effective_date THEN ''N''  ELSE ''Y'' END coverageEffectiveDateChangeFlag,

@coverage_effective_date:=coverage_effective_date  as coverageEffectiveDate,

CASE WHEN @subsidy_override=subsidy_override THEN ''N''  ELSE ''Y'' END subsidyOverrideChangeFlag,

@subsidy_override:=subsidy_override  as subsidyOverride,

CASE WHEN @gender_id=gender_id THEN ''N''  ELSE ''Y'' END genderIdChangeFlag,

@gender_id:=gender_id  as genderId,

CASE WHEN @address_1=address_1 THEN ''N''  ELSE ''Y'' END address1ChangeFlag,

@address_1:=address_1  as address1,

CASE WHEN @address_2=address_2 THEN ''N''  ELSE ''Y'' END address2ChangeFlag,

@address_2:=address_2  as address2,

CASE WHEN @city=city THEN ''N''  ELSE ''Y'' END cityChangeFlag,

@city:=city  as city,

CASE WHEN @state_id=state_id THEN ''N''  ELSE ''Y'' END stateChangeFlag,

@state_id:=state_id  as state,

CASE WHEN @zipcode=zipcode THEN ''N''  ELSE ''Y'' END zipcodeChangeFlag,

@zipcode:=zipcode  as zipcode,

CASE WHEN @email_address=email_address THEN ''N''  ELSE ''Y'' END emailIdChangeFlag,

@email_address:=email_address  as emailId,

CASE WHEN @phone_home=phone_home THEN ''N''  ELSE ''Y'' END phoneHomeChangeFlag,

@phone_home:=phone_home  as phoneHome,

CASE WHEN @phone_work=phone_work THEN ''N''  ELSE ''Y'' END phoneWorkChangeFlag,

@phone_work:=phone_work  as phoneWork,

CASE WHEN @phone_cell=phone_cell THEN ''N''  ELSE ''Y'' END phoneCellChangeFlag,

@phone_cell:=phone_cell  as phoneCell,

CASE WHEN @locator_id=locator_id THEN ''N''  ELSE ''Y'' END locatorIdChangeFlag,

@locator_id:=locator_id  as locatorId,

CASE WHEN @program_indicator_id=program_indicator_id THEN ''N''  ELSE ''Y'' END programIndicatorChangeFlag,

@program_indicator_id:=program_indicator_id  as programIndicator,

CASE WHEN @title=title THEN ''N''  ELSE ''Y'' END titleChangeFlag,

@title:=title  as title,

CASE WHEN @suffix=suffix THEN ''N''  ELSE ''Y'' END suffixChangeFlag,

@suffix:=suffix  as suffix,

CASE WHEN @billing_pass_through=billing_pass_through THEN ''N''  ELSE ''Y'' END billingPassThroughChangeFlag,

@billing_pass_through:=billing_pass_through  as billingPassThrough,

CASE WHEN @client_pass_through=client_pass_through THEN ''N''  ELSE ''Y'' END clientPassThroughChangeFlag,

@client_pass_through:=client_pass_through  as clientPassThrough,

CASE WHEN @filler_1=filler_1 THEN ''N''  ELSE ''Y'' END filler1ChangeFlag,

@filler_1:=filler_1  as filler1,

CASE WHEN @filler_2=filler_2 THEN ''N''  ELSE ''Y'' END filler2ChangeFlag,

@filler_2:=filler_2  as filler2,

CASE WHEN @referral_status=referral_status THEN ''N''  ELSE ''Y'' END referalStatusChangeFlag,

CASE WHEN  @prevEligibilityId=eligibility_data_id THEN

  CASE WHEN (@referral_status IS NULL OR @referral_status=0) AND referral_status=1  THEN ''A''

   WHEN (@referral_status=1) AND referral_status=0 THEN ''D''

   ELSE ''U'' END

ELSE ''I'' END updatedImm,

@referral_status:=referral_status as referalStatus,

CASE WHEN @active=active THEN ''N'' ELSE ''Y'' END activeChangeFlag,

@active:=active  as active,

CASE WHEN @data_source_id=data_source_id THEN ''N''  ELSE ''Y'' END dataSourceIdChangeFlag,

@data_source_id:=data_source_id  as dataSourceId,

CASE WHEN @maintenance_code_id=maintenance_code_id THEN ''N''  ELSE ''Y'' END maintenanceCodeIdChangeFlag,

@maintenance_code_id:=maintenance_code_id  as maintenanceCodeId,

CASE WHEN @file_type=file_type THEN ''N''  ELSE ''Y'' END fileTypeChangeFlag,

@file_type:=file_type  as fileType,

CASE WHEN @coverage_code_desc=coverage_code_desc THEN ''N''  ELSE ''Y'' END coverageCodeDescChangeFlag,

@coverage_code_desc:=coverage_code_desc  as coverageCodeDesc,

CASE WHEN @maintenance_code_desc=maintenance_code_desc THEN ''N''  ELSE ''Y'' END maintenanceCodeDescChangeFlag,

@maintenance_code_desc:=maintenance_code_desc  as maintenanceCodeDesc,

CASE WHEN @system_source_desc=system_source_desc THEN ''N''  ELSE ''Y'' END systemSourceDescChangeFlag,

@system_source_desc:=system_source_desc  as systemSourceDesc,

CASE WHEN @relationship_code_desc=relationship_code_desc THEN ''N''  ELSE ''Y'' END relationshipCodeDescChangeFlag,

@relationship_code_desc:=relationship_code_desc  as relationshipCodeDesc,

CASE WHEN @gender_desc=gender_desc THEN ''N''  ELSE ''Y'' END genderDescChangeFlag,

@gender_desc:=gender_desc  as genderDesc,

CASE WHEN @prevEligibilityId=eligibility_data_id  THEN  @prevEligibilityId ELSE @prevEligibilityId:= eligibility_data_id  END previous_eligibility_data_id  

 FROM (SELECT * FROM (SELECT

modified_date,

modified_by,

eligibility_data_id,

CASE WHEN @prevEligibilityId=eligibility_data_id AND audit_type IS NULL THEN @audit_type ELSE @audit_type:=audit_type END audit_type,

CASE WHEN @prevEligibilityId=eligibility_data_id  THEN @created_date ELSE @created_date:=created_date  END created_date,

CASE WHEN @prevEligibilityId=eligibility_data_id AND file_name IS NULL THEN @file_name ELSE @file_name:=file_name END file_name,

CASE WHEN @prevEligibilityId=eligibility_data_id AND created_by IS NULL THEN @created_by ELSE @created_by:=created_by END created_by,

CASE WHEN @prevEligibilityId=eligibility_data_id AND file_id IS NULL THEN @file_id ELSE @file_id:=file_id END file_id,

CASE WHEN @prevEligibilityId=eligibility_data_id AND client_id IS NULL THEN @client_id ELSE @client_id:=client_id END client_id,               

