			ed.maintenance_code_desc = (select lookup_value from lookup where lookup_group='MAINTENANCE' and lookup_key=(SELECT maintenance_code from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id)),
			ed.coverage_code_desc = (select lookup_value from lookup where lookup_group='COVERAGE' and lookup_key=(SELECT coverage_code from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id)),
			ed.gender_desc = (select lookup_value from lookup where lookup_group='GENDER' and lookup_key=(SELECT gender from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id))
			where ed.eligibility_data_id=v_eligibility_data_id
			and v_eligibility_data_id is not null
			and ed.eligibility_data_id > 0;			

SET SQL_SAFE_UPDATES=1;

end if;			
SET SQL_SAFE_UPDATES=0;

set v_error = 'going into file status updation block';
SET FOREIGN_KEY_CHECKS=1;

set v_update = (Select v_update1 + v_update2 + v_update3);
set v_no_change = (select (v_total - v_insert)-v_update);

update eligibility_file_status
set error_count = 
(select  count(*) as no_of_rows  
from
eligibility_file_error_row
where file_id = v_file_id

),
member_count = (select v_total),
records_added = (select v_insert),
records_updated = (select v_update),
records_no_change = (select v_no_change)
where file_id = v_file_id
and eligibility_file_status_id>0
;
SET SQL_SAFE_UPDATES=1;

end ;;
