CREATE DEFINER=`wwhsadmin`@`%` PROCEDURE `eligibilitydata_create_check`(v_file_id bigint, v_data_source char(1), v_system_source_id varchar(10), v_staging_type varchar(10),v_staging_id bigint, v_eligibility_data_id bigint)
begin

declare v_column_name , v_column_id, v_file_type, v_file_class varchar(100);
declare v_threshold, v_staging_count,v_error_count,v_threshold_breach, v_eligibility_file_type_id, v_system_source_lookup_id ,v_upd_count integer;
declare v_error varchar(200);
set v_threshold = 0;
SET v_threshold_breach = 0;

if v_file_id is not null then
	select 
	eligibility_file_type_id
	into v_eligibility_file_type_id
	from eligibility_file ef
	where
	file_id = v_file_id;

	select eligibility_file_type_description
	into v_file_type
	from eligibility_file_type
	where eligibility_file_type_id = v_eligibility_file_type_id;



select lower(lookup_value)
				into v_file_class
				from lookup l
				join eligibility_file ef
				on l.lookup_id = ef.eligibility_file_option_id
				and ef.file_id=v_file_id;


elseif v_staging_id is not null and v_staging_type = 'complete' then
	set v_eligibility_file_type_id = '1';
	
	SELECT lookup_id
	INTO v_system_source_lookup_id
	FROM lookup
	WHERE lookup_group = 'System Source'
	AND lookup_value = v_system_source_id;
elseif v_staging_id is not null and v_staging_type = 'simplified' then
	set v_eligibility_file_type_id = '3';
	
	SELECT lookup_id
	INTO v_system_source_lookup_id
	FROM lookup
	WHERE lookup_group = 'System Source'
	AND lookup_value = v_system_source_id;
end if;


if lower(v_file_type) = 'complete' and v_file_id is not null then
SET FOREIGN_KEY_CHECKS=0;
	
	
	set sql_safe_updates = 0;	
	update eligibility_file_staging_complete c
	inner join eligibility_file_error_row e on c.eligibility_file_staging_complete_id = e.eligibility_file_staging_row_id
	and c.file_id = e.file_id
	set c.is_invalid_row = 1
	where  e.file_id = v_file_id
	and c.file_id    = v_file_id
	and e.eligibility_file_type ='C'
	and c.eligibility_file_staging_complete_id > 0;
	set sql_safe_updates = 1;
	
	select count(1)
	into v_error_count
	from eligibility_file_error_row
	where file_id=v_file_id;

	
	select count(1)
	into v_staging_count
	from eligibility_file_staging_complete
	where file_id=v_file_id; 

	SELECT (v_error_count/v_staging_count)*100 INTO v_threshold;


	
	select 
        distinct
		evf.eligibility_file_error_threshold
		into v_threshold_breach
		from eligibility_file ef
		inner join eligibility_vendor_file evf
		on ef.account_id= evf.account_vendor_id
        and ef.eligibility_file_option_id=evf.eligibility_file_option_id
		where ef.file_id = v_file_id;

		if v_threshold > v_threshold_breach  then
		
			insert into eligibility_file_suspend
			(
			is_invalid_row,is_duplicate_row,file_id,member_record_number,client_id,member_id,initial_member_id,date_of_birth,member_first_name,member_middle_initial,member_last_name,group_id,eligibility_effective_date,eligibility_end_date,active,relationship_code,coverage_code,coverage_effective_date,maintenance_code,subsidy_override,gender,address_1,address_2,city,state,zipcode,email_address,phone_work,phone_home,phone_cell,locator_id,program_indicator,title,suffix,billing_pass_through,client_pass_through,filler_1,filler_2,transition_id,data_source,enroll,created_by,created_date,modified_by,modified_date
			)
			select
			is_invalid_row,is_duplicate_row,file_id,member_record_number,client_id,member_id,initial_member_id,date_of_birth,member_first_name,member_middle_initial,member_last_name,group_id,eligibility_effective_date,eligibility_end_date,active,relationship_code,coverage_code,coverage_effective_date,maintenance_code,subsidy_override,gender,address_1,address_2,city,state,zipcode,email_address,phone_work,phone_home,phone_cell,locator_id,program_indicator,title,suffix,billing_pass_through,client_pass_through,filler_1,filler_2,transition_id,data_source,referral_status,created_by,created_date,modified_by,modified_date
			from eligibility_file_staging_complete
			where file_id = v_file_id;
							
		else
			if v_file_class = 'change' then
			
				

				insert into eligibility_data	
				(file_id,
					eligibility_file_type_id,client_id,account_id,member_id,initial_member_id,date_of_birth,member_first_name,member_middle_initial,member_last_name,group_id,eligibility_effective_date,eligibility_end_date,referral_status,referral_start_date,referral_end_date,relationship_code_id,coverage_code_id,coverage_effective_date,maintenance_code_id,subsidy_override,gender_id,address_1,address_2,city,state_id,zipcode,email_address,phone_work,phone_home,phone_cell,locator_id,program_indicator_id,title,suffix,billing_pass_through,client_pass_through,filler_1,filler_2,transition_id,data_source_id,system_source_id
					,active,created_by,created_date,modified_by,modified_date
					,relationship_code_desc,coverage_code_desc,gender_desc,maintenance_code_desc
				)
					select
					efsc.file_id,v_eligibility_file_type_id,efsc.client_id,ef.account_id as account_id,efsc.member_id,efsc.initial_member_id,str_to_date(efsc.date_of_birth, "%m%d%Y") as date_of_birth,efsc.member_first_name,efsc.member_middle_initial,efsc.member_last_name,efsc.group_id,str_to_date(efsc.eligibility_effective_date, "%m%d%Y") as eligibility_effective_date,str_to_date(efsc.eligibility_end_date, "%m%d%Y") as eligibility_end_date,efsc.referral_status,efsc.referral_start_date,efsc.referral_end_date,efsc.relationship_code,efsc.coverage_code,str_to_date(efsc.coverage_effective_date, "%m%d%Y") as coverage_effective_date,efsc.maintenance_code,efsc.subsidy_override,efsc.gender,efsc.address_1,efsc.address_2,efsc.city,efsc.state,efsc.zipcode,efsc.email_address,efsc.phone_work,efsc.phone_home,efsc.phone_cell,CASE WHEN efsc.locator_id = '' THEN null else efsc.locator_id end,efsc.program_indicator,efsc.title,efsc.suffix,efsc.billing_pass_through,efsc.client_pass_through,efsc.filler_1,efsc.filler_2,efsc.transition_id,efsc.data_source,v_system_source_id,efsc.active,efsc.created_by,efsc.created_date,efsc.modified_by,efsc.modified_date
					,fn_get_lookup_desc('RELATIONSHIP',efsc.relationship_code),fn_get_lookup_desc('COVERAGE',efsc.coverage_code),fn_get_lookup_desc('GENDER',efsc.gender),fn_get_lookup_desc('MAINTENANCE',efsc.maintenance_code)
					from eligibility_file_staging_complete   efsc	left outer join	eligibility_data as ed	on 
					ed.member_id = efsc.member_id
					and ed.date_of_birth = str_to_date(efsc.date_of_birth, "%m%d%Y")
					and ed.member_first_name = efsc.member_first_name
					and ed.group_id = efsc.group_id
					left outer join eligibility_file ef
					on efsc.file_id = ef.file_id
					where efsc.file_id=v_file_id  
