			,ed.file_id = v_file_id
			,ed.modified_by= efsc.modified_by
                	,ed.modified_date = efsc.modified_date
			where efsc.file_id=v_file_id
			and ed.eligibility_data_id>0 
			
			and efsc.maintenance_code = '02'
					 
			and efsc.is_invalid_row = 0;
			

	
			update eligibility_data ed	
			inner join
				eligibility_file_staging_complete efsc
			     on efsc.member_id = ed.member_id
				and str_to_date(efsc.date_of_birth, "%m%d%Y")=ed.date_of_birth
				and efsc.member_first_name = ed.member_first_name
				and efsc.group_id = ed.group_id
			
			set ed.member_first_name = case when efsc.maintenance_code = '03' then efsc.transition_id else efsc.member_first_name end,
			ed.file_id = v_file_id
			,ed.modified_by= efsc.modified_by
            		,ed.modified_date = efsc.modified_date
			where efsc.file_id=v_file_id
			and ed.eligibility_data_id>0 
			
			and efsc.maintenance_code = '03'
					 
			and efsc.is_invalid_row = 0;
			

		
		SET SQL_SAFE_UPDATES=1;											  

			insert into eligibility_file_suspend	
