					,fn_get_lookup_desc('RELATIONSHIP',efsc.relationship_code),fn_get_lookup_desc('COVERAGE',efsc.coverage_code),fn_get_lookup_desc('GENDER',efsc.gender),fn_get_lookup_desc('MAINTENANCE',efsc.maintenance_code)
					from eligibility_file_staging_complete   efsc	left outer join	eligibility_data as ed	on 
