					,active,created_by,created_date,modified_by,modified_date
					,relationship_code_desc,coverage_code_desc,gender_desc,maintenance_code_desc,system_source_desc
				)
					select
					efsc.file_id,v_eligibility_file_type_id,efsc.client_id,ef.account_id as account_id,efsc.member_id,efsc.initial_member_id,str_to_date(efsc.date_of_birth, "%m%d%Y") as date_of_birth,efsc.member_first_name,efsc.member_middle_initial,efsc.member_last_name,efsc.group_id,str_to_date(efsc.eligibility_effective_date, "%m%d%Y") as eligibility_effective_date,CASE WHEN efsc.eligibility_end_date = '' THEN '2099-01-01' ELSE str_to_date(efsc.eligibility_end_date, "%m%d%Y") END,efsc.referral_status,efsc.referral_start_date,efsc.referral_end_date,efsc.relationship_code,efsc.coverage_code,str_to_date(efsc.coverage_effective_date, "%m%d%Y") as coverage_effective_date,efsc.maintenance_code,efsc.subsidy_override,efsc.gender, CASE WHEN efsc.locator_id = '' THEN null else efsc.locator_id end,efsc.program_indicator ,efsc.billing_pass_through,efsc.client_pass_through,efsc.filler_1,efsc.filler_2,efsc.transition_id,efsc.data_source,v_system_source_id,efsc.active,efsc.created_by,efsc.created_date,efsc.modified_by,efsc.modified_date
					,fn_get_lookup_desc('RELATIONSHIP',efsc.relationship_code),fn_get_lookup_desc('COVERAGE',efsc.coverage_code),fn_get_lookup_desc('GENDER',efsc.gender),fn_get_lookup_desc('MAINTENANCE',efsc.maintenance_code),v_system_source_id
				from 
					eligibility_file_staging_simplified as efsc
					left outer join
					(select * from eligibility_data where client_id=v_client and account_id=v_account) as ed
					on ed.member_id = efsc.member_id
					and ed.date_of_birth = str_to_date(efsc.date_of_birth, "%m%d%Y")
					and ed.member_first_name = efsc.member_first_name
					and ed.group_id = efsc.group_id

					left outer join eligibility_file ef
					on efsc.file_id=ef.file_id 
					 where efsc.file_id = v_file_id 
					 
					 and (efsc.transition_id is null or efsc.transition_id='')
					 and ed.date_of_birth is null
					 and ed.member_first_name is null
					 and ed.member_id  is null
					 and ed.group_id is null
					 
					 and efsc.is_invalid_row = 0;
					 
					 
			select row_count()	into v_insert;										  

				insert into eligibility_file_suspend
				(is_invalid_row,is_duplicate_row,file_id,member_record_number,client_id,member_id,initial_member_id,date_of_birth,member_first_name,member_middle_initial,member_last_name,group_id,eligibility_effective_date,eligibility_end_date,active,relationship_code,coverage_code,coverage_effective_date,maintenance_code,subsidy_override,gender
				,locator_id,program_indicator
				,billing_pass_through,client_pass_through,filler_1,filler_2,transition_id,data_source
				,created_by,created_date,modified_by,modified_date, eligibility_file_staging_suspend_id)
		select
		distinct
		efsc.is_invalid_row,efsc.is_duplicate_row,efsc.file_id,efsc.member_record_number,efsc.client_id,efsc.member_id,efsc.initial_member_id,efsc.date_of_birth,efsc.member_first_name,efsc.member_middle_initial,efsc.member_last_name,efsc.group_id,efsc.eligibility_effective_date,efsc.eligibility_end_date,efsc.active,efsc.relationship_code,efsc.coverage_code,efsc.coverage_effective_date,efsc.maintenance_code,efsc.subsidy_override,efsc.gender
		,efsc.locator_id,efsc.program_indicator
		,efsc.billing_pass_through,efsc.client_pass_through,efsc.filler_1,efsc.filler_2,efsc.transition_id,efsc.data_source
		,efsc.created_by,efsc.created_date,efsc.modified_by,efsc.modified_date, eligibility_file_staging_simplified_id
		from eligibility_file_staging_simplified efsc
			inner join eligibility_file_error_row efer
			on efsc.eligibility_file_staging_simplified_id = efer.eligibility_file_staging_row_id
			and efsc.file_id= efer.file_id
			inner join eligibility_file_error_log efel
			on efer.eligibility_file_error_row_id = efel.eligibility_file_error_row_id
			
			inner join eligibility_file_error_code efec
			on efel.error_code = efec.error_code 
			where efer.eligibility_file_type ='S'
			and efec.wwhs_review = 1
			and efel.active = 1
			and efsc.file_id = v_file_id;
	SET FOREIGN_KEY_CHECKS=1;											  

			end if; 
end if ; 
SET SQL_SAFE_UPDATES=1;
SET FOREIGN_KEY_CHECKS=1;

set v_update = (Select v_update1 + v_update2 + v_update3);
set v_no_change = (select (v_total - v_insert)-v_update);

SET SQL_SAFE_UPDATES=0;

update eligibility_file_status
set error_count = 
(select  count(*) as no_of_rows  
from
eligibility_file_error_row
where file_id = v_file_id

),
member_count = (select v_total),
records_added = (select v_insert),
records_updated = (select v_update),
records_no_change = (select v_no_change)
where file_id = v_file_id
and eligibility_file_status_id = (select val1 from (select max(eligibility_file_status_id) as val1, file_id from eligibility_file_status where file_id = v_file_id group by file_id) as A)
and eligibility_file_status_id>0
;
SET SQL_SAFE_UPDATES=1;



end ;;
