		ed.email_address = efsc.email_address,
		ed.phone_work = efsc.phone_work,
		ed.phone_home = efsc.phone_home,
		ed.phone_cell = efsc.phone_cell,
		ed.locator_id = CASE WHEN efsc.locator_id = '' THEN null else efsc.locator_id end,
		
		ed.title = efsc.title,
		ed.suffix = efsc.suffix,
		ed.billing_pass_through = efsc.billing_pass_through,
		ed.client_pass_through = efsc.client_pass_through,
		ed.filler_1 = efsc.filler_1,
		ed.filler_2 = efsc.filler_2,
		ed.transition_id = efsc.transition_id,
		ed.system_source_id = v_system_source_id,
		ed.system_source_desc = v_system_source_id,
		ed.active = efsc.active,
		ed.created_by = efsc.created_by,
		ed.created_date = efsc.created_date,
		ed.relationship_code_desc = (select lookup_value from lookup where lookup_group='RELATIONSHIP' and lookup_key=efsc.relationship_code),
		ed.maintenance_code_desc = (select lookup_value from lookup where lookup_group='MAINTENANCE' and lookup_key=efsc.maintenance_code),
		ed.coverage_code_desc = (select lookup_value from lookup where lookup_group='COVERAGE' and lookup_key=efsc.coverage_code),
		ed.gender_desc = (select lookup_value from lookup where lookup_group='GENDER' and lookup_key=efsc.gender)
			where efsc.file_id=v_file_id
			and ed.eligibility_data_id>0 
			
			and efsc.maintenance_code = '01'
					 
			
			and efsc.is_invalid_row = 0;

            select row_count()	into v_update1;	   
	
			update eligibility_data ed	
			inner join
				eligibility_file_staging_complete efsc
			     on efsc.member_id = ed.member_id
				and str_to_date(efsc.date_of_birth, "%m%d%Y")=ed.date_of_birth
				and efsc.member_first_name = ed.member_first_name
				and efsc.group_id = ed.group_id
			set ed.date_of_birth = case when efsc.maintenance_code = '02' then str_to_date(efsc.transition_id, "%m%d%Y") else str_to_date(efsc.date_of_birth, "%m%d%Y") end
			,ed.file_id = v_file_id
			,ed.modified_by= efsc.modified_by
                	,ed.modified_date = efsc.modified_date
			where efsc.file_id=v_file_id
			and ed.eligibility_data_id>0 
			
			and efsc.maintenance_code = '02'
					 
			and efsc.is_invalid_row = 0;
			
            select row_count()	into v_update2;	 
	
			update eligibility_data ed	
			inner join
				eligibility_file_staging_complete efsc
			     on efsc.member_id = ed.member_id
				and str_to_date(efsc.date_of_birth, "%m%d%Y")=ed.date_of_birth
				and efsc.member_first_name = ed.member_first_name
				and efsc.group_id = ed.group_id
			
			set ed.member_first_name = case when efsc.maintenance_code = '03' then efsc.transition_id else efsc.member_first_name end,
			ed.file_id = v_file_id
			,ed.modified_by= efsc.modified_by
            		,ed.modified_date = efsc.modified_date
			where efsc.file_id=v_file_id
			and ed.eligibility_data_id>0 
			
			and efsc.maintenance_code = '03'
					 
			and efsc.is_invalid_row = 0;
			select row_count()	into v_update3;	
		
		SET SQL_SAFE_UPDATES=1;											  

			insert into eligibility_file_suspend	
				(is_invalid_row,is_duplicate_row,file_id,member_record_number,client_id,member_id,initial_member_id,date_of_birth,member_first_name,member_middle_initial,member_last_name,group_id,eligibility_effective_date,eligibility_end_date,active,relationship_code,coverage_code,coverage_effective_date,maintenance_code,subsidy_override,gender,address_1,address_2,city,state,zipcode,email_address,phone_work,phone_home,phone_cell,locator_id,program_indicator,title,suffix,billing_pass_through,client_pass_through,filler_1,filler_2,transition_id,data_source
				,created_by,created_date,modified_by,modified_date, eligibility_file_staging_suspend_id)
				select 
				distinct
				efsc.is_invalid_row,efsc.is_duplicate_row,efsc.file_id,efsc.member_record_number,efsc.client_id,efsc.member_id,efsc.initial_member_id,efsc.date_of_birth,efsc.member_first_name,efsc.member_middle_initial,efsc.member_last_name,efsc.group_id,efsc.eligibility_effective_date,efsc.eligibility_end_date,efsc.active,efsc.relationship_code,efsc.coverage_code,efsc.coverage_effective_date,efsc.maintenance_code,efsc.subsidy_override,efsc.gender,efsc.address_1,efsc.address_2,efsc.city,efsc.state,efsc.zipcode,efsc.email_address,efsc.phone_work,efsc.phone_home,efsc.phone_cell,efsc.locator_id,efsc.program_indicator,efsc.title,efsc.suffix,efsc.billing_pass_through,efsc.client_pass_through,efsc.filler_1,efsc.filler_2,efsc.transition_id,efsc.data_source
				,efsc.created_by,efsc.created_date,efsc.modified_by,efsc.modified_date, efsc.eligibility_file_staging_complete_id
				from eligibility_file_staging_complete efsc
					inner join eligibility_file_error_row efer
				on efsc.eligibility_file_staging_complete_id = efer.eligibility_file_staging_row_id
				and efsc.file_id= efer.file_id
				inner join eligibility_file_error_log efel
				on efer.eligibility_file_error_row_id = efel.eligibility_file_error_row_id
				inner join eligibility_file_error_code efec
				on efel.error_code = efec.error_code 
				where efer.eligibility_file_type ='C'
				and efec.wwhs_review = 1
