file_id,eligibility_file_type_id,client_id,account_id,member_id,initial_member_id,date_of_birth,member_first_name,member_middle_initial,member_last_name,group_id,eligibility_effective_date,eligibility_end_date,referral_status,referral_start_date,referral_end_date,relationship_code_id,coverage_code_id,coverage_effective_date,maintenance_code_id,subsidy_override,gender_id
,locator_id,program_indicator_id
,billing_pass_through,client_pass_through,filler_1,filler_2,transition_id,data_source_id,system_source_id
,active,created_by,created_date,modified_by,modified_date,relationship_code_desc,coverage_code_desc,gender_desc,maintenance_code_desc,system_source_desc
)
			select			
efsc.file_id,v_eligibility_file_type_id,efsc.client_id,efsc.account_id as account_id,efsc.member_id,efsc.initial_member_id,str_to_date(efsc.date_of_birth, "%m%d%Y") as date_of_birth,efsc.member_first_name,efsc.member_middle_initial,efsc.member_last_name,efsc.group_id,str_to_date(efsc.eligibility_effective_date, "%m%d%Y") as eligibility_effective_date,CASE WHEN efsc.eligibility_end_date = '' THEN '2099-01-01'  WHEN efsc.eligibility_end_date IS NULL THEN '2099-01-01'  ELSE str_to_date(efsc.eligibility_end_date, "%m%d%Y") END as eligibility_end_date,efsc.referral_status,efsc.referral_start_date,efsc.referral_end_date,efsc.relationship_code,efsc.coverage_code,str_to_date(efsc.coverage_effective_date, "%m%d%Y") as coverage_effective_date,efsc.maintenance_code,efsc.subsidy_override,efsc.gender
,CASE WHEN efsc.locator_id = '' THEN null else efsc.locator_id end,efsc.program_indicator
,efsc.billing_pass_through,efsc.client_pass_through,efsc.filler_1,efsc.filler_2,efsc.transition_id,efsc.data_source,v_system_source_id,efsc.active,efsc.created_by,efsc.created_date,efsc.modified_by,efsc.modified_date
,fn_get_lookup_desc('RELATIONSHIP',efsc.relationship_code),fn_get_lookup_desc('COVERAGE',efsc.coverage_code),fn_get_lookup_desc('GENDER',efsc.gender),fn_get_lookup_desc('MAINTENANCE',efsc.maintenance_code),v_system_source_id
		from 
		    eligibility_file_staging_simplified as efsc	
			left outer join
			eligibility_data as ed
			on ed.member_id = efsc.member_id
			and ed.date_of_birth = str_to_date(efsc.date_of_birth, "%m%d%Y")
			and ed.member_first_name = efsc.member_first_name
			and ed.group_id = efsc.group_id
		     where efsc.eligibility_file_staging_simplified_id = v_staging_id  
		      
		     and ed.date_of_birth is null
		     and ed.member_first_name is null
		     and ed.member_id  is null
    		     and ed.group_id is null
		     and efsc.is_invalid_row = 0
		   	and v_eligibility_data_id is null;

SET SQL_SAFE_UPDATES=0;
			update eligibility_data ed
			set ed.member_id = (SELECT member_id from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.date_of_birth = (SELECT str_to_date(date_of_birth, "%m%d%Y") from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.member_first_name = (SELECT member_first_name from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.modified_by = (SELECT modified_by from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.modified_date = (SELECT modified_date from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			
			
			ed.client_id = (SELECT client_id from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			
			ed.initial_member_id = (SELECT initial_member_id from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.member_middle_initial = (SELECT member_middle_initial from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.member_last_name = (SELECT member_last_name from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.group_id = (SELECT group_id from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.eligibility_effective_date = (SELECT str_to_date(eligibility_effective_date, "%m%d%Y") from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.eligibility_end_date = (SELECT CASE WHEN eligibility_end_date = '' THEN '2099-01-01'  WHEN eligibility_end_date is null THEN '2099-01-01'  ELSE str_to_date(eligibility_end_date, "%m%d%Y") END from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.referral_status = (SELECT referral_status from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.referral_start_date = (SELECT referral_start_date from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.referral_end_date = (SELECT referral_end_date from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.relationship_code_id = (select relationship_code from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.coverage_code_id = (select coverage_code from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.coverage_effective_date = (SELECT str_to_date(coverage_effective_date, "%m%d%Y") from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.maintenance_code_id = (select maintenance_code from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.subsidy_override = (SELECT subsidy_override from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.gender_id = (select gender from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.locator_id = (SELECT CASE WHEN locator_id = '' THEN null else locator_id end from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			
			ed.billing_pass_through = (SELECT billing_pass_through from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.client_pass_through = (SELECT client_pass_through from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.filler_1 = (SELECT filler_1 from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.filler_2 = (SELECT filler_2 from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.transition_id = (SELECT transition_id from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.system_source_id = v_system_source_id,
			ed.system_source_desc = v_system_source_id,			
			ed.active = (SELECT active from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.created_by = (SELECT created_by from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.created_date = (SELECT created_date from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id),
			ed.relationship_code_desc = (select lookup_value from lookup where lookup_group='RELATIONSHIP' and lookup_key=(SELECT relationship_code from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id)),
			ed.maintenance_code_desc = (select lookup_value from lookup where lookup_group='MAINTENANCE' and lookup_key=(SELECT maintenance_code from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id)),
			ed.coverage_code_desc = (select lookup_value from lookup where lookup_group='COVERAGE' and lookup_key=(SELECT coverage_code from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id)),
			ed.gender_desc = (select lookup_value from lookup where lookup_group='GENDER' and lookup_key=(SELECT gender from eligibility_file_staging_simplified where eligibility_file_staging_simplified_id = v_staging_id))
			where ed.eligibility_data_id=v_eligibility_data_id
			and v_eligibility_data_id is not null
			and ed.eligibility_data_id > 0;			

SET SQL_SAFE_UPDATES=1;

end if;			
SET SQL_SAFE_UPDATES=0;

set v_error = 'going into file status updation block';
SET FOREIGN_KEY_CHECKS=1;

set v_update = (Select v_update1 + v_update2 + v_update3);
set v_no_change = (select (v_total - v_insert)-v_update);

update eligibility_file_status
set error_count = 
(select  count(*) as no_of_rows  
from
eligibility_file_error_row
where file_id = v_file_id

),
member_count = (select v_total),
records_added = (select v_insert),
records_updated = (select v_update),
records_no_change = (select v_no_change)
where file_id = v_file_id
and eligibility_file_status_id>0
;
SET SQL_SAFE_UPDATES=1;

end ;;
DELIMITER ;
