CREATE DEFINER=`wwhsadmin`@`%` PROCEDURE `eligibilitydata_load`(v_file_id bigint, v_data_source char(1), v_system_source_id varchar(10), v_staging_type varchar(10),v_staging_id bigint unsigned, v_eligibility_data_id bigint)
proc_label: BEGIN

DECLARE v_error_row_count INT;
DECLARE v_error varchar(200);
DECLARE v_date datetime;
DECLARE v_file_type varchar(10);

DECLARE EXIT HANDLER FOR sqlexception
BEGIN
SELECT v_error;
ROLLBACK;
end;

START TRANSACTION;
SET v_date = utc_timestamp();

IF(v_data_source = 'F') THEN

               SELECT eligibility_file_type_description 
                INTO v_file_type
                FROM eligibility_file_type
                WHERE eligibility_file_type_id = (SELECT eligibility_file_type_id FROM eligibility_file WHERE file_id = v_file_id);

ELSEIF(v_data_source = 'S') THEN
SET v_file_type = v_staging_type;
END IF;

select @@SQL_MODE into @OLD_SQL_MODE;
set SQL_MODE = "NO_ENGINE_SUBSTITUTION";



SET v_error = 'procedure eligibilityfile_check_duplicate_primary failed';
CALL eligibilityfile_check_duplicate_primary(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id,v_eligibility_data_id);

