SET v_error = 'procedure eligibilityfile_relationship_code_id failed';
CALL eligibilityfile_relationship_code_id(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);


SET v_error = 'procedure eligibilityfile_address1 failed';
CALL eligibilityfile_address_1(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_member_record_number failed';
CALL eligibilityfile_member_record_number(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_address_2 failed';
CALL eligibilityfile_address_2(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_billing_pass_through failed';
CALL eligibilityfile_billing_pass_through(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_city failed';
CALL eligibilityfile_city(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_date_of_birth failed';
CALL eligibilityfile_date_of_birth(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_client_pass_through failed';
CALL eligibilityfile_client_pass_through(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

#SET v_error = 'procedure eligibilityfile_coverage_code failed';
#CALL eligibilityfile_coverage_code(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_coverage_effective_date failed';
CALL eligibilityfile_coverage_effective_date(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_eligibility_effective_date failed';
CALL eligibilityfile_eligibility_effective_date(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_eligibility_end_date failed';
CALL eligibilityfile_eligibility_end_date(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_email_address failed';
CALL eligibilityfile_email_address(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_filler_1 failed';
CALL eligibilityfile_filler_1(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_filler_2 failed';
CALL eligibilityfile_filler_2(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_group_id failed';
CALL eligibilityfile_group_id(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_locator_id failed';
CALL eligibilityfile_locator_id(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_maintenance_code_id failed';
CALL eligibilityfile_maintenance_code_id(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_multi_mc failed';
call eligibilityfile_multi_mc(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'eligibilityfile_validate_maintenance_code_id failed';
CALL eligibilityfile_validate_maintenance_code_id(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_member_first_name failed';
CALL eligibilityfile_member_first_name(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_member_id failed';
CALL eligibilityfile_member_id(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_member_last_name failed';
CALL eligibilityfile_member_last_name(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_member_middle_initial failed';
CALL eligibilityfile_member_middle_initial(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_phone_cell failed';
CALL eligibilityfile_phone_cell(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_phone_home failed';
CALL eligibilityfile_phone_home(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_phone_work failed';
CALL eligibilityfile_phone_work(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

#SET v_error = 'procedure eligibilityfile_state_id failed';
#CALL eligibilityfile_state_id(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_suffix failed';
CALL eligibilityfile_suffix(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_title failed';
CALL eligibilityfile_title(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_transition_id failed';
CALL eligibilityfile_transition_id(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_zipcode failed';
CALL eligibilityfile_zipcode(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_validatefullfile failed';
CALL eligibilityfile_validatefullfile(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error ='procedure eligibilityfile_validatesubsidyoverride failed';
CALL eligibilityfile_validatesubsidyoverride(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error ='procedure eligibilityfile_validateprogramindicator failed';
CALL eligibilityfile_validateprogramindicator(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_validatestategendercode failed';
CALL eligibilityfile_validatestategendercode(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_validatecoveragecode failed';
CALL eligibilityfile_validatecoveragecode(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure EligibilityFile_ValidateCoverageDate failed';
CALL EligibilityFile_ValidateCoverageDate(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_validateeligenddate failed';
CALL eligibilityfile_validateeligenddate(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_validaterelationshipcode failed';
CALL eligibilityfile_validaterelationshipcode(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure EligibilityFile_CCEDMismatch_Single failed';
CALL eligibilityFile_CCEDMismatch_Single(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure EligibilityFile_CCEDMismatch_File failed';
CALL eligibilityFile_CCEDMismatch_File(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure EligibilityFile_check_valid_primary failed';
CALL EligibilityFile_check_valid_primary(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);



set SQL_MODE = @OLD_SQL_MODE;


IF v_data_source='S' 
	THEN SELECT COUNT(*)
    INTO v_error_row_count  
	FROM eligibility_file_error_row
    WHERE eligibility_file_staging_row_id = v_staging_id
    and lower(eligibility_file_type)= lower(SUBSTR(v_staging_type,1,1))
	and file_id is null;
    COMMIT;

	IF v_error_row_count>0
	THEN 
    SELECT distinct
           a.error_code,
           a.error_message
    FROM eligibility_file_error_code a
    INNER JOIN eligibility_file_error_log b
    ON a.error_code = b.error_code 
    INNER JOIN eligibility_file_error_row c
    on b.eligibility_file_error_row_id = c.eligibility_file_error_row_id
    WHERE c.eligibility_file_staging_row_id = v_staging_id
    and lower(eligibility_file_type)= lower(SUBSTR(v_staging_type,1,1))
	and c.file_id is null;
   END if;
    
    IF v_error_row_count>0
	THEN LEAVE proc_label;
    END IF; 
    
    IF v_error_row_count=0
    THEN
    SET v_error = 'procedure eligibilitydata_create failed for UI'; 
    CALL eligibilitydata_create(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id,v_eligibility_data_id);  

    SET v_error = 'eligibilitydatahistory_create failed for UI';
    CALL eligibilitydatahistory_create(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id,v_eligibility_data_id); 

	set v_error = 'procedure eligibilityfile_dependent_update failed for file';
	call eligibilityfile_dependent_update(v_file_id, v_data_source, v_system_source_id, v_staging_type,v_staging_id,v_eligibility_data_id);

	set v_error = 'procedure eligibilityfile_terminate_dependant failed for file';
	call eligibilityfile_terminate_dependant(v_file_id, v_data_source, v_system_source_id, v_staging_type,v_staging_id,v_eligibility_data_id);

    COMMIT; 
	
		
		if v_eligibility_data_id is null then
			SELECT 'Record Inserted successfully';
		else
			SELECT 'Record Updated successfully';
		end if;
    END IF; 
END if;

IF v_data_source='F'
THEN
SET v_error = 'procedure eligibilitydata_create failed for file'; 
CALL eligibilitydata_create(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id,v_eligibility_data_id);

SET v_error = 'eligibilitydatahistory_create failed for file';
CALL eligibilitydatahistory_create(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id,v_eligibility_data_id);

set v_error = 'procedure eligibilityfile_dependent_update failed for file';
call eligibilityfile_dependent_update(v_file_id, v_data_source, v_system_source_id, v_staging_type,v_staging_id,v_eligibility_data_id);

set v_error = 'procedure eligibilityfile_terminate_dependant failed for file';
call eligibilityfile_terminate_dependant(v_file_id, v_data_source, v_system_source_id, v_staging_type,v_staging_id,v_eligibility_data_id);

SET v_error = 'multi_update_mbr failed for file';
call multi_update_mbr(v_file_id);

SET v_error = 'eligibility_30_day_view failed for UI';
CALL eligibility_30_day_view(); 

COMMIT;
END IF;

IF(lower(v_file_type) = 'complete' and v_data_source='F') THEN
DELETE FROM eligibility_file_staging_complete
where file_id = v_file_id;
END IF;

IF(lower(v_file_type) = 'complete' and v_data_source='S') THEN
DELETE FROM eligibility_file_staging_complete
where eligibility_file_staging_complete_id = v_staging_id;
END IF;

IF(lower(v_file_type) = 'simplified' and v_data_source='F') THEN
DELETE FROM eligibility_file_staging_simplified
where file_id = v_file_id;
END IF;

IF(lower(v_file_type) = 'simplified' and v_data_source='S') THEN
DELETE FROM eligibility_file_staging_simplified
where eligibility_file_staging_simplified_id = v_staging_id;
END IF;
COMMIT;
