CREATE DEFINER=`wwhsadmin`@`%` PROCEDURE `eligibilitydata_testcreate`(v_file_id bigint, v_data_source char(1), v_system_source_id varchar(10), v_staging_type varchar(10),v_staging_id bigint, v_eligibility_data_id bigint)
begin

declare v_column_name , v_column_id, v_file_type, v_file_class varchar(100);
declare v_threshold, v_threshold_breach, v_eligibility_file_type_id, v_system_source_lookup_id ,v_upd_count integer;


if v_file_id is not null then
	select 
	eligibility_file_type_id
	into v_eligibility_file_type_id
	from eligibility_file ef
	where
	file_id = v_file_id;

	select eligibility_file_type_description
	into v_file_type
	from eligibility_file_type
	where eligibility_file_type_id = v_eligibility_file_type_id;


select lower(lookup_value)
				into v_file_class
				from lookup l
				join eligibility_file ef
				on l.lookup_id = ef.eligibility_file_option_id
				and ef.file_id=v_file_id;


elseif v_staging_id is not null and v_staging_type = 'complete' then
	set v_eligibility_file_type_id = '1';
	
	SELECT lookup_id
	INTO v_system_source_lookup_id
	FROM lookup
	WHERE lookup_group = 'System Source'
	AND lookup_value = v_system_source_id;
elseif v_staging_id is not null and v_staging_type = 'simplified' then
	set v_eligibility_file_type_id = '3';
	
	SELECT lookup_id
	INTO v_system_source_lookup_id
	FROM lookup
	WHERE lookup_group = 'System Source'
	AND lookup_value = v_system_source_id;
end if;


if lower(v_file_type) = 'complete' and v_file_id is not null then

		select count(log1.eligibility_file_error_row_id)/count(src1.eligibility_file_staging_complete_id) * 100 into v_threshold
		from `eligibility`.eligibility_file_staging_complete as src1 
		left outer join	`eligibility`.eligibility_file_error_row as log1 on log1.file_id = src1.file_id
		and log1.eligibility_file_staging_row_id = src1.eligibility_file_staging_complete_id
		where src1.file_id = v_file_id;

		select 
		evf.eligibility_file_error_threshold
		into v_threshold_breach
		from eligibility_file ef
		inner join client_eligibility_vendor cev
		on ef.client_id = cev.client_id
		inner join eligibility_vendor_account eva
		on cev.client_eligibility_vendor_id = eva.client_eligibility_vendor_id
		inner join account_vendor av
		on eva.account_vendor_id = av.account_vendor_id
		inner join eligibility_vendor_file evf
		on av.account_vendor_id= evf.account_vendor_id
		where ef.file_id = v_file_id;

		if v_threshold > v_threshold_breach  then
				
			insert into eligibility_file_suspend
			(
			is_invalid_row,is_duplicate_row,file_id,member_record_number,client_id,member_id,initial_member_id,date_of_birth,member_first_name,member_middle_initial,member_last_name,group_id,eligibility_effective_date,eligibility_end_date,active,relationship_code,coverage_code,coverage_effective_date,maintenance_code,subsidy_override,gender,address_1,address_2,city,state,zipcode,email_address,phone_work,phone_home,phone_cell,locator_id,program_indicator,title,suffix,billing_pass_through,client_pass_through,filler_1,filler_2,transition_id,data_source,enroll,created_by,created_date,modified_by,modified_date
			)
			select
			is_invalid_row,is_duplicate_row,file_id,member_record_number,client_id,member_id,initial_member_id,str_to_date(date_of_birth, "%m%d%Y") as date_of_birth,member_first_name,member_middle_initial,member_last_name,group_id,str_to_date(eligibility_effective_date, "%m%d%Y") as eligibility_effective_date,str_to_date(eligibility_end_date, "%m%d%Y") as eligibility_end_date,active,relationship_code,coverage_code,str_to_date(coverage_effective_date, "%m%d%Y") as coverage_effective_date,maintenance_code,subsidy_override,gender,address_1,address_2,city,state,zipcode,email_address,phone_work,phone_home,phone_cell,locator_id,program_indicator,title,suffix,billing_pass_through,client_pass_through,filler_1,filler_2,transition_id,data_source,referral_status,created_by,created_date,modified_by,modified_date
			from eligibility_file_staging_complete
			where file_id = v_file_id;
							
		else

				

				insert into `eligibility`.eligibility_data	
				(file_id,
					eligibility_file_type_id,client_id,account_id,member_id,initial_member_id,date_of_birth,member_first_name,member_middle_initial,member_last_name,group_id,eligibility_effective_date,eligibility_end_date,referral_status,referral_start_date,referral_end_date,relationship_code_id,coverage_code_id,coverage_effective_date,maintenance_code_id,subsidy_override,gender_id,address_1,address_2,city,state_id,zipcode,email_address,phone_work,phone_home,phone_cell,locator_id,program_indicator_id,title,suffix,billing_pass_through,client_pass_through,filler_1,filler_2,transition_id,data_source_id,system_source_id
					,active,created_by,created_date,modified_by,modified_date
					
				)
					select			
					efsc.file_id,v_eligibility_file_type_id,efsc.client_id,eva.account_vendor_id as account_id,efsc.member_id,efsc.initial_member_id,str_to_date(efsc.date_of_birth, "%m%d%Y") as date_of_birth,efsc.member_first_name,efsc.member_middle_initial,efsc.member_last_name,efsc.group_id,str_to_date(efsc.eligibility_effective_date, "%m%d%Y") as eligibility_effective_date,str_to_date(efsc.eligibility_end_date, "%m%d%Y") as eligibility_end_date,efsc.referral_status,efsc.referral_start_date,efsc.referral_end_date,lr.lookup_id,lc.lookup_id,str_to_date(efsc.coverage_effective_date, "%m%d%Y") as coverage_effective_date,lm.lookup_id,efsc.subsidy_override,lg.lookup_id,efsc.address_1,efsc.address_2,efsc.city,s.state_id,efsc.zipcode,efsc.email_address,efsc.phone_work,efsc.phone_home,efsc.phone_cell,CASE WHEN efsc.locator_id = '' THEN null else efsc.locator_id end,efsc.program_indicator,efsc.title,efsc.suffix,efsc.billing_pass_through,efsc.client_pass_through,efsc.filler_1,efsc.filler_2,efsc.transition_id,efsc.data_source,v_system_source_lookup_id,efsc.active,efsc.created_by,efsc.created_date,efsc.modified_by,efsc.modified_date
					from eligibility_file_staging_complete   efsc	left outer join	eligibility_data as ed	on 
					ed.member_id = efsc.member_id
					and ed.date_of_birth = str_to_date(efsc.date_of_birth, "%m%d%Y")
					and ed.member_first_name = efsc.member_first_name
					and ed.group_id = efsc.group_id
					left outer join	client_eligibility_vendor as cev
					on efsc.client_id = cev.client_id
					left outer join	eligibility_vendor_account as eva
					on eva.client_eligibility_vendor_id = cev.client_eligibility_vendor_id
					left outer join lookup lr on efsc.relationship_code = lr.lookup_key
					and lr.lookup_group='RELATIONSHIP'
					left outer join lookup lc on efsc.coverage_code = lc.lookup_key
					and lc.lookup_group='COVERAGE'
					left outer join lookup lg
					on efsc.gender = lg.lookup_key
					and lg.lookup_group='GENDER'
					left outer join lookup lm
					on efsc.maintenance_code = lm.lookup_key
					and lm.lookup_group='MAINTENANCE'
					left outer join state s
					on efsc.state = s.state_abbreviation 
					where efsc.file_id=v_file_id  
					
					and case when v_file_class = 'change' then efsc.maintenance_code='00'
							 when v_file_class = 'full' then efsc.maintenance_code in ('00', null, '')
						end
					and ed.date_of_birth is null
					and ed.member_first_name is null
					and ed.member_id  is null
					and ed.group_id is null
					and efsc.eligibility_file_staging_complete_id not in (select eligibility_file_staging_row_id e
													  from  eligibility_file_error_row e
													  where e.file_id = v_file_id
													  and e.eligibility_file_type ='C')  
					;    

			
			SET SQL_SAFE_UPDATES=0;
			update `eligibility`.eligibility_data ed	
			inner join
				eligibility_file_staging_complete efsc
			     on efsc.member_id = ed.member_id
				and str_to_date(efsc.date_of_birth, "%m%d%Y")=ed.date_of_birth
				and efsc.member_first_name = ed.member_first_name
				and efsc.group_id = ed.group_id
			set ed.member_id = case when efsc.maintenance_code = '01' then efsc.transition_id else efsc.member_id end,
			ed.date_of_birth = case when efsc.maintenance_code = '02' then str_to_date(efsc.transition_id, "%m%d%Y") else str_to_date(efsc.date_of_birth, "%m%d%Y") end,
			ed.member_first_name = case when efsc.maintenance_code = '03' then efsc.transition_id else efsc.member_first_name end,
			ed.modified_by = efsc.modified_by,
			ed.modified_date = efsc.modified_date,
			ed.file_id = efsc.file_id,
		
		ed.client_id = efsc.client_id,
		
		ed.initial_member_id = efsc.initial_member_id,
		ed.member_middle_initial = efsc.member_middle_initial,
		ed.member_last_name = efsc.member_last_name,
		ed.group_id = efsc.group_id,
		ed.eligibility_effective_date = str_to_date(efsc.eligibility_effective_date, "%m%d%Y"),
		ed.eligibility_end_date = str_to_date(efsc.eligibility_end_date, "%m%d%Y"),
		ed.referral_status = efsc.referral_status,
		ed.referral_start_date = efsc.referral_start_date,
		ed.referral_end_date = efsc.referral_end_date,
		ed.relationship_code_id = (SELECT LOOKUP_ID FROM `eligibility`.lookup where lookup_group = 'RELATIONSHIP' AND lookup_key=efsc.relationship_code),
		ed.coverage_code_id = (SELECT LOOKUP_ID FROM `eligibility`.lookup where lookup_group = 'COVERAGE' AND lookup_key=efsc.coverage_code),
		ed.coverage_effective_date = str_to_date(efsc.coverage_effective_date, "%m%d%Y"),
		ed.maintenance_code_id = (SELECT LOOKUP_ID FROM `eligibility`.lookup where lookup_group = 'MAINTENANCE' AND lookup_key=efsc.maintenance_code),
		ed.subsidy_override = efsc.subsidy_override,
		ed.gender_id = (SELECT LOOKUP_ID FROM `eligibility`.lookup where lookup_group = 'GENDER' AND lookup_key=efsc.gender),
		ed.address_1 = efsc.address_1,
		ed.address_2 = efsc.address_2,
		ed.city = efsc.city,
		ed.state_id = (SELECT state_id from state where state_abbreviation = efsc.state),
		ed.zipcode = efsc.zipcode,
		ed.email_address = efsc.email_address,
		ed.phone_work = efsc.phone_work,
		ed.phone_home = efsc.phone_home,
		ed.phone_cell = efsc.phone_cell,
		ed.locator_id = CASE WHEN efsc.locator_id = '' THEN null else efsc.locator_id end,
		
		ed.title = efsc.title,
		ed.suffix = efsc.suffix,
		ed.billing_pass_through = efsc.billing_pass_through,
		ed.client_pass_through = efsc.client_pass_through,
		ed.filler_1 = efsc.filler_1,
		ed.filler_2 = efsc.filler_2,
		ed.transition_id = efsc.transition_id,
		
		
		ed.active = efsc.active,
		ed.created_by = efsc.created_by,
		ed.created_date = efsc.created_date
			where efsc.file_id=v_file_id
			and ed.eligibility_data_id>0 
			
			and case when v_file_class = 'change' then efsc.maintenance_code in ('01','02','03')
					 when v_file_class = 'full' then efsc.maintenance_code in ('00','01','02','03', null, '')
				end
			and efsc.eligibility_file_staging_complete_id not in   (select eligibility_file_staging_row_id 
										      from  eligibility_file_error_row e 
										      where e.file_id = v_file_id
										      and eligibility_file_type ='C')
										      ;
SET SQL_SAFE_UPDATES=1;

			insert into eligibility_file_suspend	
				(is_invalid_row,is_duplicate_row,file_id,member_record_number,client_id,member_id,initial_member_id,date_of_birth,member_first_name,member_middle_initial,member_last_name,group_id,eligibility_effective_date,eligibility_end_date,active,relationship_code,coverage_code,coverage_effective_date,maintenance_code,subsidy_override,gender,address_1,address_2,city,state,zipcode,email_address,phone_work,phone_home,phone_cell,locator_id,program_indicator,title,suffix,billing_pass_through,client_pass_through,filler_1,filler_2,transition_id,data_source
				,created_by,created_date,modified_by,modified_date)
