CREATE DEFINER=`eligibilityapp`@`%` PROCEDURE `eligibilityemail_insert`(v_email_error_code varchar(20),v_file_name varchar(50),v_processed_records varchar(20),v_error_records varchar(20),error_codes varchar(5),v_client_name varchar(50),v_uploaded_by varchar(50),v_to_address varchar(50),v_path_to_report varchar(50))
BEGIN

