DECLARE v_email_notification_id INT(20);
DECLARE v_lookup_id INT(20);
DECLARE v_error varchar(200);
DECLARE v_created_by varchar(20);
DECLARE EXIT HANDLER FOR sqlexception

BEGIN

SELECT v_error;

ROLLBACK;

END;

START TRANSACTION;

SET v_created_by:='batchProcess';

SELECT email_master_id INTO v_email_master_id FROM eligibility.email_master WHERE email_name = v_email_error_code ;

SELECT lookup_id INTO v_lookup_id FROM lookup where lookup_group='EMAILSTATUS' and lookup_key='PR';

SET v_error:='error while inserting email_notification';
INSERT INTO eligibility.email_notification(email_master_id,email_sent_on, active, created_by, created_date, modified_by, modified_date, status_lookup_id) values (v_email_master_id ,CURRENT_TIMESTAMP, true, v_created_by, CURRENT_TIMESTAMP, v_created_by, CURRENT_TIMESTAMP,v_lookup_id);

