  INSERT INTO eligibility.email_notification_parameter (email_notification_id, email_master_parameter_id, email_parameter_date_value, active, created_by, created_date) values 
 (v_email_notification_id, (SELECT email_master_parameter_id FROM eligibility.email_master_parameter WHERE email_master_id = v_email_master_id and parameter_name = 'uploaded_on' AND parameter_type='O'), CURRENT_TIMESTAMP, true, v_created_by, CURRENT_TIMESTAMP);

WHEN 'EMAIL_112' THEN
SET v_error:='error while inserting email_notification_parameter for: EMAIL_112';
INSERT INTO eligibility.email_notification_parameter (email_notification_id, email_master_parameter_id, email_parameter_string_value, active, created_by, created_date) values 
 (v_email_notification_id, (SELECT email_master_parameter_id FROM eligibility.email_master_parameter WHERE email_master_id = v_email_master_id and parameter_name = 'to_address' AND parameter_type='T'), v_to_address, true, v_created_by, CURRENT_TIMESTAMP),
 (v_email_notification_id, (SELECT email_master_parameter_id FROM eligibility.email_master_parameter WHERE email_master_id = v_email_master_id and parameter_name = 'path_to_report' AND parameter_type='A'), v_path_to_report, true, v_created_by, CURRENT_TIMESTAMP),
 (v_email_notification_id, (SELECT email_master_parameter_id FROM eligibility.email_master_parameter WHERE email_master_id = v_email_master_id and parameter_name = 'file_name' AND parameter_type='O'), v_file_name, true, v_created_by, CURRENT_TIMESTAMP),
 (v_email_notification_id, (SELECT email_master_parameter_id FROM eligibility.email_master_parameter WHERE email_master_id = v_email_master_id and parameter_name = 'uploaded_by' AND parameter_type='O'), v_uploaded_by, true, v_created_by, CURRENT_TIMESTAMP),
 (v_email_notification_id, (SELECT email_master_parameter_id FROM eligibility.email_master_parameter WHERE email_master_id = v_email_master_id and parameter_name = 'processed_records' AND parameter_type='O'), v_processed_records, true, v_created_by, CURRENT_TIMESTAMP),
 (v_email_notification_id, (SELECT email_master_parameter_id FROM eligibility.email_master_parameter WHERE email_master_id = v_email_master_id and parameter_name = 'error_records' AND parameter_type='O'),v_error_records, true, v_created_by, CURRENT_TIMESTAMP);
 
  INSERT INTO eligibility.email_notification_parameter (email_notification_id, email_master_parameter_id, email_parameter_date_value, active, created_by, created_date) values 
 (v_email_notification_id, (SELECT email_master_parameter_id FROM eligibility.email_master_parameter WHERE email_master_id = v_email_master_id and parameter_name = 'uploaded_on' AND parameter_type='O'), CURRENT_TIMESTAMP, true, v_created_by, CURRENT_TIMESTAMP);

WHEN 'EMAIL_117' THEN
SET v_error:='error while inserting email_notification_parameter for: EMAIL_117';
INSERT INTO eligibility.email_notification_parameter (email_notification_id, email_master_parameter_id, email_parameter_string_value, active, created_by, created_date) values 
 (v_email_notification_id, (SELECT email_master_parameter_id FROM eligibility.email_master_parameter WHERE email_master_id = v_email_master_id and parameter_name = 'to_address' AND parameter_type='T'), v_to_address, true, v_created_by, CURRENT_TIMESTAMP),
 (v_email_notification_id, (SELECT email_master_parameter_id FROM eligibility.email_master_parameter WHERE email_master_id = v_email_master_id and parameter_name = 'path_to_report' AND parameter_type='A'), v_path_to_report, true, v_created_by, CURRENT_TIMESTAMP),
 (v_email_notification_id, (SELECT email_master_parameter_id FROM eligibility.email_master_parameter WHERE email_master_id = v_email_master_id and parameter_name = 'file_name' AND parameter_type='O'), v_file_name, true, v_created_by, CURRENT_TIMESTAMP),
 (v_email_notification_id, (SELECT email_master_parameter_id FROM eligibility.email_master_parameter WHERE email_master_id = v_email_master_id and parameter_name = 'uploaded_by' AND parameter_type='O'), v_uploaded_by, true, v_created_by, CURRENT_TIMESTAMP),
 (v_email_notification_id, (SELECT email_master_parameter_id FROM eligibility.email_master_parameter WHERE email_master_id = v_email_master_id and parameter_name = 'error_codes' AND parameter_type='O'), error_codes, true, v_created_by, CURRENT_TIMESTAMP),
 (v_email_notification_id, (SELECT email_master_parameter_id FROM eligibility.email_master_parameter WHERE email_master_id = v_email_master_id and parameter_name = 'client_name' AND parameter_type='O'), v_client_name, true, v_created_by, CURRENT_TIMESTAMP),
 (v_email_notification_id, (SELECT email_master_parameter_id FROM eligibility.email_master_parameter WHERE email_master_id = v_email_master_id and parameter_name = 'client_name' AND parameter_type='S'), v_client_name, true, v_created_by, CURRENT_TIMESTAMP);
  
  INSERT INTO eligibility.email_notification_parameter (email_notification_id, email_master_parameter_id, email_parameter_date_value, active, created_by, created_date) values 
 (v_email_notification_id, (SELECT email_master_parameter_id FROM eligibility.email_master_parameter WHERE email_master_id = v_email_master_id and parameter_name = 'uploaded_on' AND parameter_type='O'), CURRENT_TIMESTAMP, true, v_created_by, CURRENT_TIMESTAMP);
END CASE;

SET v_error:='success';

COMMIT;

END ;;
