CREATE DEFINER=`wwhsadmin`@`%` PROCEDURE `eligibilityfile_check_duplicate_primary`(v_file_id bigint, v_data_source char(1), v_system_source_id varchar(10), v_staging_type varchar(10),v_staging_id bigint, v_eligibility_data_id bigint)
begin
DECLARE v_column_name varchar(100);
DECLARE v_column_id ,v_system_source_lookup_id bigint;
DECLARE v_error, v_file_type varchar(500);
DECLARE v_cnt bigint default 0;
DECLARE v_account_id varchar(100);
DROP TEMPORARY TABLE IF EXISTS temp_primary_check;
DROP TEMPORARY TABLE IF EXISTS temp_primary_duplicates;
DROP TEMPORARY TABLE IF EXISTS temp_file_dup;
SET v_column_name = 'relationship_code';
SELECT lookup_id
INTO v_system_source_lookup_id
FROM lookup
WHERE lookup_group = 'System Source'
AND lookup_value = v_system_source_id;
IF(v_data_source = 'F') THEN
	SET  v_column_id := fn_get_column_id(v_column_name,v_file_id,null,'P');	
	SELECT eligibility_file_type_description
	INTO v_file_type
	FROM eligibility_file_type
	WHERE eligibility_file_type_id = (SELECT eligibility_file_type_id FROM eligibility_file WHERE file_id = v_file_id);
	SELECT account_id INTO v_account_id FROM eligibility_file WHERE file_id=v_file_id limit 1;
if lower(v_file_type) = 'complete' then
	
	CREATE TEMPORARY TABLE temp_primary_duplicates as select * from eligibility_file_staging_complete where 1=2;
	CREATE TEMPORARY TABLE temp_primary_check as select * from eligibility_file_staging_complete where 1=2;
	
	ALTER TABLE temp_primary_duplicates ADD PRIMARY KEY (eligibility_file_staging_complete_id);
	ALTER TABLE temp_primary_check	ADD INDEX fk_temp_composite_idx (member_id(100), group_id(100), client_id, account_id(5));
	
	INSERT INTO temp_primary_check 
	SELECT c.* FROM eligibility_file_staging_complete c
	where c.file_id = v_file_id
	and  c.relationship_code = '01'
	and  c.maintenance_code  = '00';

	CREATE TEMPORARY TABLE temp_file_dup
	select client_id,group_id,member_id,member_first_name,date_of_birth,count(1) as cnt from eligibility_file_staging_complete c
	WHERE c.file_id = v_file_id
	and  c.relationship_code = '01'
	and  c.maintenance_code  = '00'
	group by client_id,group_id,member_id
	having count(1) > 1;
	
	
	INSERT INTO temp_primary_duplicates
	SELECT c.* FROM temp_primary_check c inner join temp_file_dup d
	on c.member_id = d.member_id
	AND c.group_id  = d.group_id
	AND c.client_id = d.client_id;
	
	
	INSERT IGNORE INTO temp_primary_duplicates
	SELECT d.* FROM temp_primary_check d 
	where exists ( 
			select 1 from eligibility_data c
			where  c.relationship_code_id = '01'
			and    c.member_id = d.member_id
			AND    c.group_id  = d.group_id
			AND    c.client_id = d.client_id
			AND    c.account_id = v_account_id
			AND    (c.member_first_name <> d.member_first_name
			OR      c.date_of_birth     <> str_to_date(d.date_of_birth,"%m%d%Y"))
			limit 1
		     );
	
	SELECT count(1) INTO v_cnt FROM temp_primary_duplicates;
	if(v_cnt > 0) then 
		
			BEGIN
			SET v_error = 'Comp : SQL Error occured while Insertion into Error Row Table';
			INSERT INTO eligibility_file_error_row(is_invalid_row,is_duplicate_row,eligibility_file_staging_row_id,eligibility_file_type,file_id,member_record_number,client_id,member_id,initial_member_id,date_of_birth,member_first_name,member_middle_initial,member_last_name,group_id,eligibility_effective_date,eligibility_end_date,referral_status,referral_start_date,referral_end_date,relationship_code,coverage_code,coverage_effective_date,maintenance_code,subsidy_override,gender,address_1,address_2,city,state,zipcode,email_address,phone_work,phone_home,phone_cell,locator_id,program_indicator,title,suffix,billing_pass_through,client_pass_through,filler_1,filler_2,transition_id,data_source,system_source_id,active,created_by,created_date,modified_by,modified_date)
			(SELECT  distinct c.is_invalid_row,c.is_duplicate_row,c.eligibility_file_staging_complete_id,SUBSTR(v_file_type,1,1),v_file_id,c.member_record_number,c.client_id,c.member_id,c.initial_member_id,c.date_of_birth,c.member_first_name,c.member_middle_initial,c.member_last_name,c.group_id,c.eligibility_effective_date,c.eligibility_end_date,c.referral_status,c.referral_start_date,c.referral_end_date,c.relationship_code,c.coverage_code,c.coverage_effective_date,c.maintenance_code,c.subsidy_override,c.gender,c.address_1,c.address_2,c.city,c.state,c.zipcode,c.email_address,c.phone_work,c.phone_home,c.phone_cell,c.locator_id,c.program_indicator,c.title,c.suffix,c.billing_pass_through,c.client_pass_through,c.filler_1,c.filler_2,c.transition_id,c.data_source,v_system_source_lookup_id,c.active,c.created_by,c.created_date,c.modified_by,c.modified_date
			FROM temp_primary_duplicates c 
			WHERE NOT EXISTS (SELECT e.eligibility_file_staging_row_id
					  FROM eligibility_file_error_row e USE INDEX (fk_eligibility_file_error_row_composite_idx) 
					  WHERE e.eligibility_file_staging_row_id = c.eligibility_file_staging_complete_id
					  AND   e.eligibility_file_type = SUBSTR(v_file_type,1,1) AND e.file_id=c.file_id));
			END;
		
		BEGIN
		SET v_error = 'Comp : SQL Error occured while Insertion into Error Log Table';
		
			INSERT INTO eligibility_file_error_log
			(file_id,column_id,eligibility_file_error_row_id,error_code,created_by,created_date)
			SELECT distinct c.file_id,v_column_id,c.eligibility_file_error_row_id,
			'165',c.created_by,c.created_date
			FROM eligibility_file_error_row c USE INDEX (fk_eligibility_file_error_row_composite_idx)  JOIN temp_primary_duplicates t ON c.eligibility_file_staging_row_id = t.eligibility_file_staging_complete_id
			AND c.file_id=t.file_id;
			
		END;
		
	END IF; 
END IF;
if lower(v_file_type) = 'simplified' then
	CREATE TEMPORARY TABLE temp_primary_duplicates as select * from eligibility_file_staging_simplified where 1=2;
	CREATE TEMPORARY TABLE temp_primary_check as select * from eligibility_file_staging_simplified where 1=2;
	
	ALTER TABLE temp_primary_duplicates ADD PRIMARY KEY (eligibility_file_staging_simplified_id);
	ALTER TABLE temp_primary_check	ADD INDEX fk_temp_composite_idx (member_id(100), group_id(100), client_id, account_id(5));
	
