					and    c.member_id = d.member_id
					AND    c.group_id  = d.group_id
					AND    c.client_id = d.client_id
					AND    c.account_id = d.account_id
					AND    c.member_first_name = d.member_first_name
					AND    c.date_of_birth     = str_to_date(d.date_of_birth,"%m%d%Y")
					AND    c.eligibility_data_id <> v_eligibility_data_id
					limit 1
				     );
		end if;
