CREATE DEFINER=`wwhsadmin`@`%` PROCEDURE `EligibilityFile_check_valid_primary`(v_file_id bigint, v_data_source char(1), v_system_source_id varchar(10), v_staging_type varchar(10),v_staging_id bigint)
BEGIN



DECLARE v_column_name varchar(100);
DECLARE v_column_id ,v_system_source_lookup_id bigint;
DECLARE v_error, v_file_type varchar(500);

select @@SQL_MODE into @OLD_SQL_MODE;
set SQL_MODE = "NO_ENGINE_SUBSTITUTION";

DROP TEMPORARY TABLE IF EXISTS primary_error_records;
DROP TEMPORARY TABLE IF EXISTS invalid_dependents;


SELECT lookup_id
INTO v_system_source_lookup_id
FROM lookup
WHERE lookup_group = 'System Source'
