	FROM member_mismatch d inner join primary_error_records p
	on  d.member_id	= p.member_id
	and d.group_id  = p.group_id
	and d.client_id = p.client_id;

	if(row_count() > 0) then	

		BEGIN
			SET v_error = 'Comp : SQL Error occured while Insertion into Error Row Table';
			
			INSERT INTO eligibility_file_error_row(is_invalid_row,is_duplicate_row,eligibility_file_staging_row_id,eligibility_file_type,file_id,member_record_number,client_id,member_id,initial_member_id,date_of_birth,member_first_name,member_middle_initial,member_last_name,group_id,eligibility_effective_date,eligibility_end_date,referral_status,referral_start_date,referral_end_date,relationship_code,coverage_code,coverage_effective_date,maintenance_code,subsidy_override,gender,address_1,address_2,city,state,zipcode,email_address,phone_work,phone_home,phone_cell,locator_id,program_indicator,title,suffix,billing_pass_through,client_pass_through,filler_1,filler_2,transition_id,data_source,system_source_id,active,created_by,created_date,modified_by,modified_date)
			(SELECT  
distinct
c.is_invalid_row,c.is_duplicate_row,c.eligibility_file_staging_complete_id,SUBSTR(v_file_type,1,1),v_file_id,c.member_record_number,c.client_id,c.member_id,c.initial_member_id,c.date_of_birth,c.member_first_name,c.member_middle_initial,c.member_last_name,c.group_id,c.eligibility_effective_date,c.eligibility_end_date,c.referral_status,c.referral_start_date,c.referral_end_date,c.relationship_code,c.coverage_code,c.coverage_effective_date,c.maintenance_code,c.subsidy_override,c.gender,c.address_1,c.address_2,c.city,c.state,c.zipcode,c.email_address,c.phone_work,c.phone_home,c.phone_cell,c.locator_id,c.program_indicator,c.title,c.suffix,c.billing_pass_through,c.client_pass_through,c.filler_1,c.filler_2,c.transition_id,c.data_source,v_system_source_lookup_id,c.active,c.created_by,c.created_date,c.modified_by,c.modified_date
			FROM invalid_dependents c 
			WHERE NOT EXISTS (SELECT e.eligibility_file_staging_row_id
					  FROM eligibility_file_error_row e USE INDEX (fk_eligibility_file_error_row_composite_idx) 
					  WHERE e.eligibility_file_staging_row_id = c.eligibility_file_staging_complete_id
					  AND   e.eligibility_file_type = SUBSTR(v_file_type,1,1) AND e.file_id=c.file_id));

		END;

		
		BEGIN
			SET v_error = 'Comp : SQL Error occured while Insertion into Error Log Table';

			INSERT INTO eligibility_file_error_log
			(file_id,column_id,eligibility_file_error_row_id,error_code,created_by,created_date)
			SELECT distinct c.file_id,v_column_id,c.eligibility_file_error_row_id,
			'122',c.created_by,c.created_date
			FROM eligibility_file_error_row c USE INDEX (fk_eligibility_file_error_row_composite_idx)  JOIN invalid_dependents t ON c.eligibility_file_staging_row_id = t.eligibility_file_staging_complete_id
			WHERE c.file_id=t.file_id;

		END;

		
	END IF;		
	
END IF;			

if lower(v_file_type) = 'simplified' AND v_data_source = 'F' then

	CREATE TEMPORARY TABLE primary_error_records as select * from eligibility_file_staging_simplified where 1=2;
	ALTER TABLE primary_error_records ADD INDEX fk_per_idx (member_id(100),group_id(100));
