CREATE DEFINER=`wwhsadmin`@`%` PROCEDURE `eligibilityfile_continuesuspendprocessing`(v_file_id bigint, v_data_source char(1), v_system_source_id varchar(10), v_staging_type varchar(10),v_staging_id bigint unsigned, v_eligibility_data_id bigint)
BEGIN

DECLARE c_wwhs_error bigint;
DECLARE v_file_type char(1);


DECLARE EXIT HANDLER FOR sqlexception
BEGIN

ROLLBACK;
end;

set c_wwhs_error = 0;

START TRANSACTION;
SELECT count(*)
into c_wwhs_error
from eligibility_file_error_log l
inner join eligibility_file_error_code c
on l.error_code = c.error_code
where c.wwhs_review = 1
and l.file_id = v_file_id;

select upper(substring(eligibility_file_type_description, 1,1)) into v_file_type
	from eligibility_file as ef
	inner join eligibility_file_type as eft
	on ef.eligibility_file_type_id = eft.eligibility_file_type_id
	and ef.file_id = v_file_id
	;

if c_wwhs_error=0 then
    SET SQL_SAFE_UPDATES=0;

	DELETE FROM eligibility_file_suspend
    WHERE file_id = v_file_id
    AND is_invalid_row=1
    AND eligibility_file_suspend_id>0;

    SET SQL_SAFE_UPDATES=1;

if v_file_type = 'C' then

                DELETE FROM eligibility_file_staging_complete
                where file_id = v_file_id;
                
                insert into eligibility_file_staging_complete
                (
                
                is_invalid_row
                ,is_duplicate_row
                ,file_id
                ,member_record_number
                ,client_id
                ,member_id
                ,initial_member_id
                ,date_of_birth
                ,member_first_name
                ,member_middle_initial
                ,member_last_name
                ,group_id
                ,eligibility_effective_date
                ,eligibility_end_date
                ,active              
