                is_invalid_row
                ,is_duplicate_row
                ,file_id
                ,member_record_number
                ,client_id
                ,member_id
                ,initial_member_id
                ,date_of_birth
                ,member_first_name
                ,member_middle_initial
                ,member_last_name
                ,group_id
                ,eligibility_effective_date
                ,eligibility_end_date
                ,active
                ,relationship_code
