CALL eligibilitydatahistory_create_suspend(v_file_id, v_data_source, v_system_source_id, v_staging_type,v_staging_id, v_eligibility_data_id);
CALL eligibilityfile_dependent_update(v_file_id, v_data_source, v_system_source_id, v_staging_type,v_staging_id,v_eligibility_data_id);
CALL eligibilityfile_terminate_dependant(v_file_id, v_data_source, v_system_source_id, v_staging_type,v_staging_id,v_eligibility_data_id);
