elseif v_file_type = 'S' then
DELETE FROM eligibility_file_staging_simplified
where file_id = v_file_id;

end if;

SET SQL_SAFE_UPDATES=1;

elseif c_wwhs_error>0
then

drop temporary table if exists track_wwhs_row;
