as
select eligibility_file_staging_suspend_id
from eligibility_file_suspend s
    INNER JOIN eligibility_file_error_row er
    ON s.file_id = er.file_id
    AND s.eligibility_file_staging_suspend_id = er.eligibility_file_staging_row_id
    INNER JOIN eligibility_file_error_log el
    ON er.eligibility_file_error_row_id = el.eligibility_file_error_row_id
    INNER JOIN eligibility_file_error_code c
    ON el.error_code = c.error_code
    WHERE c.wwhs_review = 1
;

	SET SQL_SAFE_UPDATES=0;

	DELETE s FROM eligibility_file_suspend s
	left outer join track_wwhs_row as twr
	on s.eligibility_file_staging_suspend_id = twr.eligibility_file_staging_suspend_id
    INNER JOIN eligibility_file_error_row er
    ON s.file_id = er.file_id
    AND s.eligibility_file_staging_suspend_id = er.eligibility_file_staging_row_id
    INNER JOIN eligibility_file_error_log el
