    AND s.is_invalid_row=1
	and twr.eligibility_file_staging_suspend_id is null
    AND s.eligibility_file_suspend_id>0;

    SET SQL_SAFE_UPDATES=1;


if v_file_type = 'C' then

                DELETE FROM eligibility_file_staging_complete
                where file_id = v_file_id;
                
                  insert into eligibility_file_staging_complete
                (
                
                is_invalid_row
                ,is_duplicate_row
                ,file_id
                ,member_record_number
                ,client_id
                ,member_id
                ,initial_member_id
                ,date_of_birth
                ,member_first_name
                ,member_middle_initial
