                ,client_pass_through
                ,filler_1
                ,filler_2
                ,transition_id
                ,data_source
                ,created_by
                ,created_date
                ,modified_by
                ,modified_date
               )
                select 
                
                is_invalid_row
                ,is_duplicate_row
                ,file_id
                ,member_record_number
                ,client_id
                ,member_id
                ,initial_member_id
                ,date_of_birth
                ,member_first_name
                ,member_middle_initial
                ,member_last_name
                ,group_id
                ,eligibility_effective_date
                ,eligibility_end_date
                ,active
                ,relationship_code
                ,coverage_code
                ,coverage_effective_date
                ,maintenance_code
                ,subsidy_override
                ,gender
                ,address_1
                ,address_2
                ,city
                ,state
                ,zipcode
                ,email_address
                ,phone_work
                ,phone_home
                ,phone_cell
                ,locator_id
                ,program_indicator
                ,title
