DECLARE v_column_id ,v_system_source_lookup_id,v_max_id bigint;
DECLARE v_error, v_file_type varchar(500);

DROP TEMPORARY TABLE IF EXISTS primary_upd_recs;


SELECT lookup_id
INTO v_system_source_lookup_id
FROM lookup
WHERE lookup_group = 'System Source'
AND lookup_value = v_system_source_id;

SET SQL_SAFE_UPDATES=0;

IF(v_data_source = 'F') THEN

		CREATE TEMPORARY TABLE primary_upd_recs as
		select eligibility_data_id,member_id,member_id  as new_member_id,file_id,audit_type,coverage_code_id,coverage_effective_date
		,locator_id,relationship_code_id,client_id,account_id,group_id,'U' as update_required,modified_by,modified_date
		from eligibility_data_history where 1=2;

		ALTER TABLE primary_upd_recs ADD INDEX fk_pur_idx (update_required);
		
		
		
		
		
		INSERT INTO primary_upd_recs
		SELECT u.eligibility_data_id,i.member_id,u.member_id,
		u.file_id,u.audit_type,u.coverage_code_id,u.coverage_effective_date,u.locator_id,u.relationship_code_id,
		u.client_id,u.account_id,u.group_id,
		CASE    WHEN    u.coverage_code_id	  <> i.coverage_code_id THEN 'U'
			WHEN 	u.coverage_effective_date <> i.coverage_effective_date THEN 'U'
			WHEN 	u.locator_id	  <> i.locator_id  THEN 'U'
			WHEN 	u.member_id	  <> i.member_id  THEN 'U'
		ELSE 'N' end AS update_required,
		u.modified_by,u.modified_date
		FROM eligibility_data_history u inner join eligibility_data_history i
		ON u.eligibility_data_id = i.eligibility_data_id
		AND i.audit_type='I'
		WHERE u.file_id = v_file_id
		AND   u.audit_type='U'
		AND   u.maintenance_code_id  = '01'
		AND   u.relationship_code_id = '01';

		UPDATE eligibility_data d inner join primary_upd_recs p
		ON  d.member_id = p.member_id
		AND d.client_id = p.client_id
		AND d.group_id = p.group_id
		AND d.account_id = p.account_id
		SET	d.coverage_code_id	  = p.coverage_code_id,
			d.coverage_effective_date = p.coverage_effective_date,
			d.locator_id		  = p.locator_id,
			d.member_id		  = p.new_member_id,
			d.coverage_code_desc	  = fn_get_lookup_desc('COVERAGE',p.coverage_code_id),
			d.modified_by = p.modified_by,
			d.modified_date = p.modified_date
		WHERE p.update_required = 'U'
		AND   d.relationship_code_id IN ('02','03','04');

END IF;		

IF(v_data_source = 'S' AND v_eligibility_data_id is not null) THEN

		CREATE TEMPORARY TABLE primary_upd_recs as
		select eligibility_data_history_id,eligibility_data_id,member_id,member_id as new_member_id,file_id,audit_type,coverage_code_id,coverage_effective_date
		,locator_id,relationship_code_id,client_id,account_id,group_id,'U' as update_required,modified_by,modified_date
		from eligibility_data_history where 1=2;

		ALTER TABLE primary_upd_recs ADD INDEX fk_pur_idx (update_required);
		
		
		
		
		
		INSERT INTO primary_upd_recs
		SELECT u.eligibility_data_history_id,u.eligibility_data_id,i.member_id,u.member_id,
		u.file_id,u.audit_type,u.coverage_code_id,u.coverage_effective_date,u.locator_id,u.relationship_code_id,
		u.client_id,u.account_id,u.group_id,
		CASE    WHEN    u.coverage_code_id	  <> i.coverage_code_id THEN 'U'
			WHEN 	u.coverage_effective_date <> i.coverage_effective_date THEN 'U'
			WHEN 	u.locator_id	  <> i.locator_id  THEN 'U'
			WHEN 	u.member_id	  <> i.member_id  THEN 'U'
		ELSE 'N' end AS update_required,
		u.modified_by,u.modified_date
		FROM eligibility_data_history u inner join eligibility_data_history i
		ON u.eligibility_data_id = i.eligibility_data_id
		WHERE u.eligibility_data_id = v_eligibility_data_id
		AND i.audit_type='I'
		AND u.audit_type='U'
		AND   u.relationship_code_id = '01';

		select max(eligibility_data_history_id) into v_max_id from primary_upd_recs;


		UPDATE eligibility_data d inner join primary_upd_recs p
		ON  d.member_id = p.new_member_id
		AND d.client_id = p.client_id
		AND d.group_id = p.group_id
		AND d.account_id = p.account_id
		SET	d.coverage_code_id	  = p.coverage_code_id,
			d.coverage_effective_date = p.coverage_effective_date,
			d.locator_id		  = p.locator_id,
			d.member_id		  = p.new_member_id,
			d.coverage_code_desc	  = fn_get_lookup_desc('COVERAGE',p.coverage_code_id),
			d.modified_by = p.modified_by,
			d.modified_date = p.modified_date
		WHERE p.update_required = 'U'
		AND   p.eligibility_data_history_id = v_max_id
		AND   d.relationship_code_id IN ('02','03','04');

END IF;		
SET SQL_SAFE_UPDATES=1;

end ;;
