CREATE DEFINER=`wwhsadmin`@`%` PROCEDURE `eligibilityfile_eligibility_effective_date`(v_file_id bigint, v_data_source char(1), v_system_source_id varchar(10), v_staging_type varchar(10),v_staging_id bigint unsigned)
begin

DECLARE v_column_name varchar(100);
DECLARE v_column_id, v_system_source_lookup_id bigint;
DECLARE v_error ,v_file_type varchar(500);

set v_file_type = '';
SET v_column_name = 'eligibility_effective_date';

select date_format(curdate(),"%Y-%m-%d") into @curdate1;


drop temporary table if exists temp_eligibility_effective_date;

SELECT lookup_id
INTO v_system_source_lookup_id
FROM lookup
WHERE lookup_group = 'System Source'
AND lookup_value = v_system_source_id;

IF(v_data_source = 'F') THEN

	SET  v_column_id := fn_get_column_id(v_column_name,v_file_id,null,'P');	

	SELECT eligibility_file_type_description
	INTO v_file_type
	FROM eligibility_file_type
	WHERE eligibility_file_type_id = (SELECT eligibility_file_type_id FROM eligibility_file WHERE file_id = v_file_id);


if lower(v_file_type) = 'complete' then

	create temporary table temp_eligibility_effective_date as
	select *
	from eligibility_file_staging_complete
	where (fn_str_date_chk(eligibility_effective_date) = 0 or eligibility_effective_date is null or eligibility_effective_date=''
			or case when fn_str_date_chk(eligibility_effective_date) = 1 then (datediff(date_format(str_to_date(eligibility_effective_date , "%m%d%Y"),"%Y-%m-%d"),@curdate1)/365 not between -1 and 1) end
			)
	AND  file_id = v_file_id;

	if(row_count() > 0) then
		
		INSERT INTO eligibility_file_error_row(is_invalid_row,is_duplicate_row,eligibility_file_staging_row_id,eligibility_file_type,file_id,member_record_number,client_id,member_id,initial_member_id,date_of_birth,member_first_name,member_middle_initial,member_last_name,group_id,eligibility_effective_date,eligibility_end_date,referral_status,referral_start_date,referral_end_date,relationship_code,coverage_code,coverage_effective_date,maintenance_code,subsidy_override,gender,address_1,address_2,city,state,zipcode,email_address,phone_work,phone_home,phone_cell,locator_id,program_indicator,title,suffix,billing_pass_through,client_pass_through,filler_1,filler_2,transition_id,data_source,system_source_id,active,created_by,created_date,modified_by,modified_date)
			(SELECT  distinct c.is_invalid_row,c.is_duplicate_row,c.eligibility_file_staging_complete_id,SUBSTR(v_file_type,1,1),v_file_id,c.member_record_number,c.client_id,c.member_id,c.initial_member_id,c.date_of_birth,c.member_first_name,c.member_middle_initial,c.member_last_name,c.group_id,c.eligibility_effective_date,c.eligibility_end_date,c.referral_status,c.referral_start_date,c.referral_end_date,c.relationship_code,c.coverage_code,c.coverage_effective_date,c.maintenance_code,c.subsidy_override,c.gender,c.address_1,c.address_2,c.city,c.state,c.zipcode,c.email_address,c.phone_work,c.phone_home,c.phone_cell,c.locator_id,c.program_indicator,c.title,c.suffix,c.billing_pass_through,c.client_pass_through,c.filler_1,c.filler_2,c.transition_id,c.data_source,v_system_source_lookup_id,c.active,c.created_by,c.created_date,c.modified_by,c.modified_date
			FROM temp_eligibility_effective_date c 
			WHERE NOT EXISTS (SELECT e.eligibility_file_staging_row_id
					  FROM eligibility_file_error_row e
					  WHERE e.eligibility_file_staging_row_id = c.eligibility_file_staging_complete_id
					  AND   e.eligibility_file_type = SUBSTR(v_file_type,1,1) AND e.file_id=c.file_id));

		
		
		INSERT INTO eligibility_file_error_log
			(file_id,column_id,eligibility_file_error_row_id,error_code,created_by,created_date)
			SELECT distinct c.file_id,v_column_id,c.eligibility_file_error_row_id,
			'119',c.created_by,c.created_date
			FROM eligibility_file_error_row c JOIN temp_eligibility_effective_date t ON c.eligibility_file_staging_row_id = t.eligibility_file_staging_complete_id AND c.file_id=t.file_id;
	end if;		
end if;			



if lower(v_file_type) = 'simplified' then

	create temporary table temp_eligibility_effective_date as
	select *
	from eligibility_file_staging_simplified
	where (fn_str_date_chk(eligibility_effective_date) = 0 or eligibility_effective_date is null or eligibility_effective_date=''
			or case when fn_str_date_chk(eligibility_effective_date) = 1 then (datediff(date_format(str_to_date(eligibility_effective_date , "%m%d%Y"),"%Y-%m-%d"),@curdate1)/365 not between -1 and 1) end
			)
	AND  file_id = v_file_id;

	if(row_count() > 0) then	
	
		INSERT INTO eligibility_file_error_row(is_invalid_row,is_duplicate_row,eligibility_file_staging_row_id,eligibility_file_type,file_id,member_record_number,client_id,member_id,initial_member_id,date_of_birth,member_first_name,member_middle_initial,member_last_name,group_id,eligibility_effective_date,eligibility_end_date,referral_status,referral_start_date,referral_end_date,relationship_code,coverage_code,coverage_effective_date,maintenance_code,subsidy_override,gender, locator_id,program_indicator,billing_pass_through,client_pass_through,filler_1,filler_2,transition_id,data_source,system_source_id,active,created_by,created_date,modified_by,modified_date)
			(SELECT  distinct c.is_invalid_row,c.is_duplicate_row,c.eligibility_file_staging_simplified_id,SUBSTR(v_file_type,1,1),v_file_id,c.member_record_number,c.client_id,c.member_id,c.initial_member_id,c.date_of_birth,c.member_first_name,c.member_middle_initial,c.member_last_name,c.group_id,c.eligibility_effective_date,c.eligibility_end_date,c.referral_status,c.referral_start_date,c.referral_end_date,c.relationship_code,c.coverage_code,c.coverage_effective_date,c.maintenance_code,c.subsidy_override,c.gender, c.locator_id,c.program_indicator,c.billing_pass_through,c.client_pass_through,c.filler_1,c.filler_2,c.transition_id,c.data_source,v_system_source_lookup_id,c.active,c.created_by,c.created_date,c.modified_by,c.modified_date
			FROM temp_eligibility_effective_date c
			WHERE NOT EXISTS (SELECT e.eligibility_file_staging_row_id
					  FROM eligibility_file_error_row e
					  WHERE e.eligibility_file_staging_row_id = c.eligibility_file_staging_simplified_id
					  AND   e.eligibility_file_type = SUBSTR(v_file_type,1,1) AND e.file_id=c.file_id));

		
		
		INSERT INTO eligibility_file_error_log
			(file_id,column_id,eligibility_file_error_row_id,error_code,created_by,created_date)
			SELECT distinct c.file_id,v_column_id,c.eligibility_file_error_row_id,
			'119',c.created_by,c.created_date
			FROM eligibility_file_error_row c JOIN temp_eligibility_effective_date t ON c.eligibility_file_staging_row_id = t.eligibility_file_staging_simplified_id AND c.file_id=t.file_id;


	end if;		

end if;	


ELSEIF(v_data_source = 'S') THEN

	SET v_column_id := fn_get_column_id(v_column_name,null,v_staging_type,'P');	
	SET v_file_type = v_staging_type;

if lower(v_file_type) = 'complete' then

	create temporary table temp_eligibility_effective_date as
	select *
	from eligibility_file_staging_complete
	where (fn_str_date_chk(eligibility_effective_date) = 0 or eligibility_effective_date is null or eligibility_effective_date=''
			or case when fn_str_date_chk(eligibility_effective_date) = 1 then (datediff(date_format(str_to_date(eligibility_effective_date , "%m%d%Y"),"%Y-%m-%d"),@curdate1)/365 not between -1 and 1) end
			)
	AND  eligibility_file_staging_complete_id = v_staging_id;
	
	if(row_count() > 0) then
		
		INSERT INTO eligibility_file_error_row(is_invalid_row,is_duplicate_row,eligibility_file_staging_row_id,eligibility_file_type,file_id,member_record_number,client_id,member_id,initial_member_id,date_of_birth,member_first_name,member_middle_initial,member_last_name,group_id,eligibility_effective_date,eligibility_end_date,referral_status,referral_start_date,referral_end_date,relationship_code,coverage_code,coverage_effective_date,maintenance_code,subsidy_override,gender,address_1,address_2,city,state,zipcode,email_address,phone_work,phone_home,phone_cell,locator_id,program_indicator,title,suffix,billing_pass_through,client_pass_through,filler_1,filler_2,transition_id,data_source,system_source_id,active,created_by,created_date,modified_by,modified_date)
			(SELECT  distinct c.is_invalid_row,c.is_duplicate_row,c.eligibility_file_staging_complete_id,SUBSTR(v_file_type,1,1),v_file_id,c.member_record_number,c.client_id,c.member_id,c.initial_member_id,c.date_of_birth,c.member_first_name,c.member_middle_initial,c.member_last_name,c.group_id,c.eligibility_effective_date,c.eligibility_end_date,c.referral_status,c.referral_start_date,c.referral_end_date,c.relationship_code,c.coverage_code,c.coverage_effective_date,c.maintenance_code,c.subsidy_override,c.gender,c.address_1,c.address_2,c.city,c.state,c.zipcode,c.email_address,c.phone_work,c.phone_home,c.phone_cell,c.locator_id,c.program_indicator,c.title,c.suffix,c.billing_pass_through,c.client_pass_through,c.filler_1,c.filler_2,c.transition_id,c.data_source,v_system_source_lookup_id,c.active,c.created_by,c.created_date,c.modified_by,c.modified_date
			FROM temp_eligibility_effective_date c 
			WHERE NOT EXISTS (SELECT e.eligibility_file_staging_row_id
					  FROM eligibility_file_error_row e
					  WHERE e.eligibility_file_staging_row_id = c.eligibility_file_staging_complete_id
					  AND   e.eligibility_file_type = SUBSTR(v_file_type,1,1) AND e.file_id is null));

		
		
		INSERT INTO eligibility_file_error_log
			(file_id,column_id,eligibility_file_error_row_id,error_code,created_by,created_date)
			SELECT distinct c.file_id,v_column_id,c.eligibility_file_error_row_id,
			'119',c.created_by,c.created_date
			FROM eligibility_file_error_row c JOIN temp_eligibility_effective_date t ON c.eligibility_file_staging_row_id = t.eligibility_file_staging_complete_id;
	end if;		
end if;			



if lower(v_file_type) = 'simplified' then

	create temporary table temp_eligibility_effective_date as
	select *
	from eligibility_file_staging_simplified
	where (fn_str_date_chk(eligibility_effective_date) = 0 or eligibility_effective_date is null or eligibility_effective_date=''
			or case when fn_str_date_chk(eligibility_effective_date) = 1 then (datediff(date_format(str_to_date(eligibility_effective_date , "%m%d%Y"),"%Y-%m-%d"),@curdate1)/365 not between -1 and 1) end
			)
	AND  eligibility_file_staging_simplified_id = v_staging_id;

	if(row_count() > 0) then	
	
		INSERT INTO eligibility_file_error_row(is_invalid_row,is_duplicate_row,eligibility_file_staging_row_id,eligibility_file_type,file_id,member_record_number,client_id,member_id,initial_member_id,date_of_birth,member_first_name,member_middle_initial,member_last_name,group_id,eligibility_effective_date,eligibility_end_date,referral_status,referral_start_date,referral_end_date,relationship_code,coverage_code,coverage_effective_date,maintenance_code,subsidy_override,gender,locator_id,program_indicator,billing_pass_through,client_pass_through,filler_1,filler_2,transition_id,data_source,system_source_id,active,created_by,created_date,modified_by,modified_date)
			(SELECT  distinct c.is_invalid_row,c.is_duplicate_row,c.eligibility_file_staging_simplified_id,SUBSTR(v_file_type,1,1),v_file_id,c.member_record_number,c.client_id,c.member_id,c.initial_member_id,c.date_of_birth,c.member_first_name,c.member_middle_initial,c.member_last_name,c.group_id,c.eligibility_effective_date,c.eligibility_end_date,c.referral_status,c.referral_start_date,c.referral_end_date,c.relationship_code,c.coverage_code,c.coverage_effective_date,c.maintenance_code,c.subsidy_override,c.gender,c.locator_id,c.program_indicator,c.billing_pass_through,c.client_pass_through,c.filler_1,c.filler_2,c.transition_id,c.data_source,v_system_source_lookup_id,c.active,c.created_by,c.created_date,c.modified_by,c.modified_date
			FROM temp_eligibility_effective_date c
			WHERE NOT EXISTS (SELECT e.eligibility_file_staging_row_id
					  FROM eligibility_file_error_row e
					  WHERE e.eligibility_file_staging_row_id = c.eligibility_file_staging_simplified_id
					  AND   e.eligibility_file_type = SUBSTR(v_file_type,1,1) AND e.file_id is null));

		
		
		INSERT INTO eligibility_file_error_log
			(file_id,column_id,eligibility_file_error_row_id,error_code,created_by,created_date)
			SELECT distinct c.file_id,v_column_id,c.eligibility_file_error_row_id,
			'119',c.created_by,c.created_date
			FROM eligibility_file_error_row c JOIN temp_eligibility_effective_date t ON c.eligibility_file_staging_row_id = t.eligibility_file_staging_simplified_id;


	end if;		

end if;	

END IF;

drop temporary table if exists temp_eligibility_effective_date;

end ;;
