CREATE DEFINER=`wwhsadmin`@`%` PROCEDURE `eligibilityfile_prevalidation_errors`(v_client_id varchar(100), v_account_id varchar(100), v_file_name varchar(500), v_error_code varchar(500), OUT v_gen_filename varchar(500))
BEGIN

DECLARE v_file_type_id, v_file_id bigint;
DECLARE v_file_type, v_file_ext,v_gen_file_name,v_file_status_id_f,v_part_1,v_part_2 varchar(500);
DECLARE v_date DATETIME DEFAULT UTC_TIMESTAMP();




SELECT CASE WHEN SUBSTR(v_file_name,1,3) = 'UI_' THEN 'UI' ELSE 'FTP' END INTO v_file_type;



if v_file_type = 'FTP' then
	INSERT INTO eligibility_file
	(file_name,generated_file_name,
	active,created_by,created_date,modified_by,modified_date)
	VALUES
	(
	 v_file_name,v_file_name
	 ,1,'DBUSER',v_date,'DBUSER',v_date
	);

	SET v_file_id  = LAST_INSERT_ID(); 
	SET v_file_ext = SUBSTRING_INDEX(v_file_name,'.',-1);
end if;



if v_file_type = 'FTP' then
	SELECT CONCAT('FTP_',SUBSTRING_INDEX(v_file_name,'.',1),'_',v_file_id,'_',date_format(v_date,'%Y%m%d_%h%i%s'),'.',v_file_ext) into v_gen_file_name;
else
	SET v_part_2 = SUBSTRING_INDEX(v_file_name,'_',-2);
	SET v_part_1 = SUBSTRING(v_file_name,1,INSTR(v_file_name,v_part_2) - 2);
	SELECT file_id into v_file_id from eligibility_file where generated_file_name = v_file_name limit 1;
	SELECT CONCAT(v_part_1,'_',v_file_id,'_',v_part_2) into v_gen_file_name;
end if;



		select lookup_id into v_file_status_id_f from lookup where lookup_group='FILE_STATUS_E_O' and lookup_value='Failed';




		INSERT INTO eligibility_file_error_log
		(file_id,column_id,eligibility_file_error_header_trailer_id,error_code,created_by,created_date,modified_by,modified_date)
		values
		(v_file_id,NULL,NULL,v_error_code,'DBUSER',v_date,'DBUSER',v_date);


		if v_file_type = 'FTP' then
			INSERT INTO eligibility_file_status
			(file_id,eligibility_file_status_type_id,error_count,
			total_eligible,total_terminated,start_date_time,end_date_time,member_count,records_added,records_updated,
			records_no_change,file_released,active,created_by,created_date,modified_by,modified_date)
			(SELECT v_file_id, v_file_status_id_f,0,
			0,0,v_date,v_date,0,0,0,
			0,0,0,'DBUSER',v_date,'DBUSER',v_date);
		else
			UPDATE eligibility_file_status
			SET eligibility_file_status_type_id = v_file_status_id_f
			WHERE file_id = v_file_id;
		end if;



		UPDATE eligibility_file 
		SET generated_file_name = v_gen_file_name,
			client_id = v_client_id,
		    account_id = v_account_id
		WHERE file_id = v_file_id;



		SELECT CONCAT('Generated File Name : ',v_gen_file_name);

END ;;
