CREATE DEFINER=`wwhsadmin`@`%` PROCEDURE `eligibilityfile_reject`(v_file_id bigint)
BEGIN

SET SQL_SAFE_UPDATES=0;

DELETE FROM eligibility_file_suspend
WHERE file_id = v_file_id
AND eligibility_file_suspend_id>0;

UPDATE eligibility_file_status
SET eligibility_file_status_type_id = (SELECT lookup_id from lookup where lookup_group='FILE_STATUS_E_O'and lookup_key='FLD')
WHERE file_id=v_file_id
AND eligibility_file_status_id>0;

SET SQL_SAFE_UPDATES=1;

COMMIT;

END ;;
