			SELECT distinct c.file_id,v_column_id,c.eligibility_file_error_row_id,
			'121',c.created_by,c.created_date
			FROM eligibility_file_error_row c USE INDEX (fk_eligibility_file_error_row_composite_idx)  JOIN temp_relationship_code_id t ON c.eligibility_file_staging_row_id = t.eligibility_file_staging_complete_id AND c.file_id=t.file_id;

	end if;		
end if;			



if lower(v_file_type) = 'simplified' then

	create temporary table temp_relationship_code_id as
	select *
	from eligibility_file_staging_simplified
	where relationship_code not in ('01','02','03','04')
	AND  file_id = v_file_id;
		 

