CREATE DEFINER=`wwhsadmin`@`%` PROCEDURE `eligibilityfile_terminate_dependant`(v_file_id bigint, v_data_source char(1), v_system_source_id varchar(10), v_staging_type varchar(10),v_staging_id bigint,v_eligibility_data_id bigint)
BEGIN



DECLARE v_column_name varchar(100);
DECLARE v_column_id ,v_system_source_lookup_id bigint;
DECLARE v_error, v_file_type varchar(500);



SELECT lookup_id
INTO v_system_source_lookup_id
FROM lookup
WHERE lookup_group = 'System Source'
AND lookup_value = v_system_source_id;

SET SQL_SAFE_UPDATES=0;

IF(v_data_source = 'F') THEN

		UPDATE eligibility_data d inner join primary_upd_recs p
		ON  d.member_id = p.member_id
		AND d.client_id = p.client_id
		AND d.group_id  = p.group_id
		AND d.account_id = d.account_id
		SET d.eligibility_end_date = UTC_TIMESTAMP(),
		    d.file_id = v_file_id
		WHERE p.audit_type = 'U'
		AND   d.relationship_code_id in ('02','03','04')
		AND (d.relationship_code_id = '02' AND d.coverage_code_id in ('01','03','05','06')
		     or  (d.relationship_code_id = '03' AND d.coverage_code_id in ('01','02','04','06'))
	             or  (d.relationship_code_id = '04' AND d.coverage_code_id in ('01','02','03')));
				


END IF;		

IF(v_data_source = 'S' AND v_eligibility_data_id is not null) THEN

		UPDATE eligibility_data d inner join primary_upd_recs p
		ON  d.member_id = p.member_id
		AND d.client_id = p.client_id
		AND d.group_id  = p.group_id
		AND d.account_id = d.account_id
		SET d.eligibility_end_date = UTC_TIMESTAMP(),
		    d.file_id = v_file_id
		WHERE p.audit_type = 'U'
		AND   d.relationship_code_id in ('02','03','04')
		AND (d.relationship_code_id = '02' AND d.coverage_code_id in ('01','03','05','06')
		     or  (d.relationship_code_id = '03' AND d.coverage_code_id in ('01','02','04','06'))
	             or  (d.relationship_code_id = '04' AND d.coverage_code_id in ('01','02','03')));

END IF;		

SET SQL_SAFE_UPDATES=1;


end ;;
