CREATE DEFINER=`wwhsadmin`@`%` PROCEDURE `eligibilityfile_validatefullfile`(v_file_id bigint, v_data_source char(1),v_system_source_id varchar(10), v_staging_type varchar(10), v_staging_id bigint)
