declare v_file_type varchar(10);
declare v_file_class varchar(15);
DECLARE v_column_name varchar(100);
declare v_column_id, v_client_id, v_account_id bigint;
declare v_system_source_lookup_id bigint;





SET v_column_name = 'member_missing';

IF(v_data_source = 'F') 
THEN
                SELECT lower(eligibility_file_type_description)
                INTO v_file_type
                FROM eligibility_file_type
                WHERE eligibility_file_type_id = (SELECT eligibility_file_type_id FROM eligibility_file WHERE file_id = v_file_id);

				select lower(lookup_value)
				into v_file_class
