				gender,address_1,address_2,city,state,zipcode,email_address,phone_work,phone_home,phone_cell,locator_id,
				program_indicator,title,suffix,billing_pass_through,client_pass_through,filler_1,filler_2,transition_id,
				system_source_id,created_by,created_date,modified_by,modified_date)
				select v_file_id,1, 0,client_id,member_id,initial_member_id,date_of_birth,member_first_name,member_middle_initial,
                member_last_name,group_id,eligibility_effective_date,eligibility_end_date,active,relationship_code_id,coverage_code_id,coverage_effective_date,maintenance_code_id,subsidy_override,gender_id,address_1,address_2,city,state_id,zipcode,email_address,phone_work,phone_home,phone_cell,locator_id,program_indicator_id,title,suffix,billing_pass_through,client_pass_through,filler_1,filler_2,transition_id,v_system_source_lookup_id,created_by,created_date ,modified_by,modified_date
