        and e.member_first_name = m.member_first_name
        and e.date_of_birth = case when fn_str_date_chk(m.date_of_birth)=1 then str_to_date(m.date_of_birth, "%m%d%Y") else m.date_of_birth end
        and e.group_id=m.group_id;

		
