		uploader_phone = CASE WHEN fn_header_uploader_phone(v_uploader_phone) = 0 THEN v_uploader_phone else null end
		WHERE file_id = v_file_id;




		SELECT CONCAT('Generated File Name : ',v_gen_file_name);
		SELECT CONCAT('Status ',v_status);

COMMIT;
DROP temporary TABLE IF EXISTS temp_header_check;
end ;;
