DECLARE v_date DATETIME DEFAULT UTC_TIMESTAMP();
DECLARE v_file_release tinyint DEFAULT 0;
DECLARE v_numcols_errorcode mediumint DEFAULT 0;
DECLARE v_accnt_exists mediumint;

DROP temporary TABLE IF EXISTS temp_header_check;



SELECT CASE WHEN SUBSTR(v_file_name,1,3) = 'UI_' THEN 'UI' ELSE 'FTP' END INTO v_file_type;



if v_file_type = 'FTP' then
	INSERT INTO eligibility_file
	(file_name,generated_file_name,
	active,created_by,created_date,modified_by,modified_date)
	VALUES
	(
	 v_file_name,v_file_name
	 ,1,'DBUSER',v_date,'DBUSER',v_date
	);

	SET v_file_id  = LAST_INSERT_ID(); 
	SET v_file_ext = SUBSTRING_INDEX(v_file_name,'.',-1);
end if;



if v_file_type = 'FTP' then
	SELECT CONCAT('FTP_',SUBSTRING_INDEX(v_file_name,'.',1),'_',v_file_id,'_',date_format(v_date,'%Y%m%d_%h%i%s'),'.',v_file_ext) into v_gen_file_name;
else
	SET v_part_2 = SUBSTRING_INDEX(v_file_name,'_',-2);
	SET v_part_1 = SUBSTRING(v_file_name,1,INSTR(v_file_name,v_part_2) - 2);
	SELECT file_id into v_file_id from eligibility_file where generated_file_name = v_file_name limit 1;
	SELECT CONCAT(v_part_1,'_',v_file_id,'_',v_part_2) into v_gen_file_name;
end if;


	select lookup_id into v_file_status_id from lookup where lookup_group='FILE_STATUS_E_O' and lookup_value='Received';
	select lookup_id into v_file_status_id_s from lookup where lookup_group='FILE_STATUS_E_O' and lookup_value='Processing';
	select lookup_id into v_file_status_id_f from lookup where lookup_group='FILE_STATUS_E_O' and lookup_value='Failed';
	IF upper(v_file_option) = 'C' then
		select lookup_id into v_file_option_id from lookup where lookup_group='FILEOPTION' and lookup_key='FLOP2';
	elseif upper(v_file_option) = 'F' then
		select lookup_id into v_file_option_id from lookup where lookup_group='FILEOPTION' and lookup_key='FLOP1';
	end if;




	SELECT COUNT(1) INTO v_accnt_exists FROM account_vendor WHERE account_vendor_id = v_account_id;
	if v_accnt_exists = 0 then
		SET v_file_type_id = 1;
	else
		SET v_file_type_id = fn_header_get_filetype_id(v_account_id, v_file_ext);
	end if;



	if v_accnt_exists > 0 then 
			if v_col_unique is null or upper(v_col_unique) = 'N' or upper(v_col_unique) <> 'Y' then
				SET v_status = 'Failed';
				SET v_numcols_errorcode = 163;
			elseif upper(v_col_unique) = 'Y' then
				
				SELECT lookup_key into v_cols from lookup
				where lookup_group = 'COLUMNS_IN_FILE'
				and   lookup_value = (SELECT `eligibility_file_type_description`
							  FROM eligibility_file_type
							  WHERE eligibility_file_type_id = v_file_type_id);
			


				if v_cols <> ifnull(v_num_cols,0) then
					SET v_status = 'Failed';
					SET v_numcols_errorcode = 163;
				end if;
			end if;
	end if;


		CREATE temporary TABLE temp_header_check 
		(
		temp_header_check_id  bigint auto_increment,
		column_name varchar(100),
		file_id bigint,
		error_code bigint,
		column_id bigint,
		primary key(temp_header_check_id)
		);

		INSERT INTO temp_header_check(column_name,file_id,error_code,column_id)
		SELECT * FROM
		(
			(SELECT 'client_id',v_file_id,fn_header_clientid(v_client_id),fn_get_column_id('client_id',v_file_type_id,NULL,'T')) UNION
			(SELECT 'account_id',v_file_id,fn_header_accountid(v_account_id,v_client_id),fn_get_column_id('account_id',v_file_type_id,NULL,'T')) UNION
			(SELECT 'eligibility_file_option_id',v_file_id,fn_header_filetype(v_file_option),fn_get_column_id('eligibility_file_option_id',v_file_type_id,NULL,'T')) UNION
			(SELECT 'total_member_record_count_header',v_file_id,fn_header_memrecord(v_mem_records_h,null,null,'h'),fn_get_column_id('total_member_record_count_header',v_file_type_id,NULL,'T')) UNION
			(SELECT 'date_file_sent',v_file_id,fn_header_date_sent(v_date_sent),fn_get_column_id('date_file_sent',v_file_type_id,NULL,'T')) UNION
			(SELECT 'time_file_sent',v_file_id,fn_header_time_sent(v_time_sent),fn_get_column_id('time_file_sent',v_file_type_id,NULL,'T')) UNION
			(SELECT 'uploader_phone',v_file_id,fn_header_uploader_phone(v_uploader_phone),fn_get_column_id('uploader_phone',v_file_type_id,NULL,'T')) UNION
			(SELECT 'uploader_email_address',v_file_id,fn_header_uploader_address(v_uploader_address),fn_get_column_id('uploader_email_address',v_file_type_id,NULL,'T')) UNION
			(SELECT 'uploader_name',v_file_id,fn_header_uploader_name(v_uploader_name),fn_get_column_id('uploader_name',v_file_type_id,NULL,'T')) UNION
			(SELECT 'account_id',v_file_id,fn_header_account_suspend(v_account_id,v_client_id),fn_get_column_id('account_id',v_file_type_id,NULL,'T')) UNION
			(SELECT 'total_member_record_count_trailer',v_file_id,fn_header_memrecord(v_mem_records_h,v_mem_records_t,v_total_recs,'t'),fn_get_column_id('total_member_record_count_trailer',v_file_type_id,NULL,'T')) UNION
			(SELECT 'number_of_columns',v_file_id,v_numcols_errorcode,fn_get_column_id('number_of_columns',v_file_type_id,NULL,'T'))
			
		)a;




		INSERT INTO eligibility_file_error_header_trailer
		(file_id,client_id,account_id,eligibility_file_option_id,total_member_record_count_header,
		total_member_record_count_trailer,date_file_sent,time_file_sent,uploader_name,uploader_email_address,
		uploader_phone,active,created_by,created_date,modified_by,modified_date)
		(SELECT distinct v_file_id,v_client_id,v_account_id,v_file_option,v_mem_records_h,
		v_mem_records_t,v_date_sent,v_time_sent,v_uploader_name,v_uploader_address,
		v_uploader_phone,1,'DBUSER',v_date,'DBUSER',v_date
		FROM temp_header_check
		where file_id=v_file_id
		and error_code <> 0
		and not exists (SELECT 1
				from eligibility_file_error_header_trailer
				where file_id = v_file_id));

		if(row_count() > 0) then
			SET v_status = 'Failed';
		end if;




		INSERT INTO eligibility_file_error_log
		(file_id,column_id,eligibility_file_error_header_trailer_id,error_code,created_by,created_date,modified_by,modified_date)
		SELECT distinct c.file_id,t.column_id,c.eligibility_file_error_header_trailer_id,
		t.error_code,c.created_by,c.created_date,c.modified_by,c.modified_date
		FROM eligibility_file_error_header_trailer c JOIN temp_header_check t ON c.file_id = t.file_id
		WHERE t.error_code <> 0;



		if fn_header_accountid(v_account_id,v_client_id) = 0 then
			
			select wwhs_error_report_review_required_id
			into v_review_reqd
			from account_vendor
			where account_vendor_id = v_account_id;

			if v_review_reqd = (select lookup_id from lookup where lookup_group='ERRORREPORT' and lookup_value='Yes') then
				set v_file_release = 0;
			elseif v_review_reqd = (select lookup_id from lookup where lookup_group='ERRORREPORT' and lookup_value='No') then
				set v_file_release = 1;
			end if;
		end if;





		if v_file_type = 'FTP' then
			INSERT INTO eligibility_file_status
			(file_id,eligibility_file_status_type_id,error_count,
			total_eligible,total_terminated,start_date_time,end_date_time,member_count,records_added,records_updated,
			records_no_change,file_released,active,created_by,created_date,modified_by,modified_date)
			(SELECT v_file_id, CASE WHEN v_status ='Processing' THEN v_file_status_id_s ELSE v_file_status_id_f END ,0,
			0,0,v_date,v_date,0,0,0,
			0,v_file_release,1,'DBUSER',v_date,'DBUSER',v_date);
		else
			UPDATE eligibility_file_status
			SET eligibility_file_status_type_id = CASE WHEN v_status ='Processing' THEN v_file_status_id_s ELSE v_file_status_id_f END,
			file_released=v_file_release
			WHERE file_id = v_file_id;
		end if;



		UPDATE eligibility_file 
		SET generated_file_name = v_gen_file_name,
		eligibility_file_option_id = v_file_option_id,
		eligibility_file_type_id = v_file_type_id,
		client_id = CASE WHEN fn_header_clientid(v_client_id) = 0 THEN v_client_id else null end,
		account_id = CASE WHEN fn_header_accountid(v_account_id,v_client_id) = 0 THEN v_account_id else null end,
		total_member_record_count_header = CASE WHEN fn_header_memrecord(v_mem_records_h,null,null,'h') = 0 THEN v_mem_records_h else null end,
		total_member_record_count_trailer = CASE WHEN fn_header_memrecord(v_mem_records_h,v_mem_records_t,v_total_recs,'t') = 0 THEN v_mem_records_t else null end,
		date_file_sent = CASE WHEN fn_header_date_sent(v_date_sent) = 0 THEN str_to_date(v_date_sent,'%m%d%Y') else null end,
		time_file_sent = CASE WHEN fn_header_time_sent(v_time_sent) = 0 THEN str_to_date(v_time_sent,'%H:%i') else null end,
		uploader_name = CASE WHEN fn_header_uploader_name(v_uploader_name) = 0 THEN v_uploader_name else null end,
		uploader_email_address = CASE WHEN fn_header_uploader_address(v_uploader_address) = 0 THEN v_uploader_address else null end,
		uploader_phone = CASE WHEN fn_header_uploader_phone(v_uploader_phone) = 0 THEN v_uploader_phone else null end
		WHERE file_id = v_file_id;




		SELECT CONCAT('Generated File Name : ',v_gen_file_name);
		SELECT CONCAT('Status ',v_status);

COMMIT;

end ;;
DELIMITER ;
