CREATE DEFINER=`wwhsadmin`@`%` PROCEDURE `eligibilityfile_wwhs_read`(column_value1 varchar(255),column_value2 varchar(255), column_value3 varchar(255),column_value4 varchar(255), bound VARCHAR(1))
BEGIN

DECLARE id INT DEFAULT 0;


DECLARE occurance INT DEFAULT 0;
DECLARE i INT DEFAULT 0;
DECLARE splitted_value1, splitted_value2, splitted_value3, splitted_value4 varchar(255);
DECLARE done INT DEFAULT 0;

DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

DROP TEMPORARY TABLE IF EXISTS eligibilityfile_denorm_table;
