CREATE DEFINER=`wwhsadmin`@`%` PROCEDURE `eligibility_30_day_view`()
begin

drop temporary table if exists sum_members;
create temporary table sum_members
as
(
select
client_id
,account_id
, coalesce(count(*),0) as sum_mbr
from eligibility_data
where curdate() between eligibility_effective_date and eligibility_end_date 
group by 1,2
)
;

drop temporary table if exists last_30_day_new_members; 
create temporary table last_30_day_new_members
as
(
select
client_id
,account_id
, coalesce(count(*),0) as new_mbr
from eligibility_data
where eligibility_effective_date between date_sub(curdate(), interval 29 day) and curdate()
group by 1,2
)
;

drop temporary table if exists last_30_day_closed_members; 
create temporary table last_30_day_closed_members
as
(
select
client_id
,account_id
, coalesce(count(*),0) as closed_mbr
from eligibility_data
where eligibility_end_date between date_sub(curdate(), interval 29 day) and curdate()
group by 1,2
)
;

drop temporary table if exists next_30_day_closed_members;
create temporary table next_30_day_closed_members
as
(
select
client_id
,account_id
, coalesce(count(*),0) as next_30_closed_mbr
from eligibility_data
where eligibility_end_date between date_add(curdate(), interval 1 day) and  date_add(curdate(), interval 30 day) 
group by 1,2
)
;



delete from eligibility_look_ahead where eligibility_look_ahead_id > 0;
insert into eligibility_look_ahead
(

client_id
,account_vendor_id
,eligible_members
,net_last_thirty_days
,last_thirty_days_addition
,last_thirty_days_termination
,next_thirty_days_termination
,active
,created_by
,created_date
,modified_by
,modified_date
)
select
sm.client_id
,sm.account_id
,sm.sum_mbr
,coalesce(new1.new_mbr,0) - coalesce(close1.closed_mbr,0)
,coalesce(new1.new_mbr,0)
,coalesce(close1.closed_mbr,0)
,coalesce(next1.next_30_closed_mbr,0)
,1
,current_user()
,curdate()
, current_user()
,curdate()
from
sum_members as sm
inner join account_vendor as av
on sm.account_id = av.account_vendor_id
left outer join
last_30_day_new_members as new1
on sm.client_id = new1.client_id
and sm.account_id = new1.account_id
left outer join last_30_day_closed_members as close1
on sm.client_id = close1.client_id
and sm.account_id = close1.account_id
left outer join next_30_day_closed_members as next1
on sm.client_id = next1.client_id
and sm.account_id = next1.account_id
;

end ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
