CREATE DEFINER=`wwhsadmin`@`%` PROCEDURE `Load_duplicate_member_records`(v_file_id bigint,v_file_type varchar(5))
begin

	DECLARE v_finished bigint default 0;
	DECLARE v_id,v_mrn bigint;
	


	 DEClARE mrn_c CURSOR FOR 
	 SELECT staging_id,member_record_number FROM temp_mrn;
	 

	 DECLARE CONTINUE HANDLER 
	 FOR NOT FOUND SET v_finished = 1;

IF v_file_type='C' then
	 
	 OPEN mrn_c;
	 
	 get_mrn_c: LOOP
	 
	 FETCH mrn_c INTO v_id,v_mrn;
	 
	 IF v_finished = 1 THEN 
	 LEAVE get_mrn_c;
	 END IF;
	 

	 INSERT INTO temp_member_record_number
	 SELECT * from eligibility_file_staging_complete
	 where file_id=v_file_id
	 and eligibility_file_staging_complete_id <> v_id
	 and member_record_number = v_mrn;
	 
	 END LOOP get_mrn_c;
	 
	 CLOSE mrn_c;

elseif v_file_type='S' then
	OPEN mrn_c;
	 
	 get_mrn_c: LOOP
	 
	 FETCH mrn_c INTO v_id,v_mrn;
	 
	 IF v_finished = 1 THEN 
	 LEAVE get_mrn_c;
	 END IF;
	 

	 INSERT INTO temp_member_record_number
	 SELECT * from eligibility_file_staging_simplified
	 where file_id=v_file_id
	 and eligibility_file_staging_simplified_id <> v_id
	 and member_record_number = v_mrn;
	 
	 END LOOP get_mrn_c;
	 
	 CLOSE mrn_c;
end if;
end ;;
