CREATE DEFINER=`wwhsadmin`@`%` PROCEDURE `Load_eligibilityfile_transition_id`(v_file_id bigint, v_data_source char(1), v_system_source_id varchar(10), v_staging_type varchar(10),v_staging_id bigint)
begin

DECLARE v_column_name varchar(100);
DECLARE v_column_id ,v_system_source_lookup_id, v_count bigint;
DECLARE v_file_type, v_file_class varchar(500);
