								FROM eligibility_file_error_row c USE INDEX (fk_eligibility_file_error_row_composite_idx)  JOIN temp_transition_id t ON c.eligibility_file_staging_row_id = t.eligibility_file_staging_complete_id
							;

					commit;
				end if;		
			drop temporary table if exists temp_transition_id;
