				if(v_count > 0) then	
				
					INSERT INTO eligibility_file_error_row(is_invalid_row,is_duplicate_row,eligibility_file_staging_row_id,eligibility_file_type,file_id,member_record_number,client_id,member_id,initial_member_id,date_of_birth,member_first_name,member_middle_initial,member_last_name,group_id,eligibility_effective_date,eligibility_end_date,referral_status,referral_start_date,referral_end_date,relationship_code,coverage_code,coverage_effective_date,maintenance_code,subsidy_override,locator_id,program_indicator,billing_pass_through,client_pass_through,filler_1,filler_2,transition_id,data_source,system_source_id,active,created_by,created_date,modified_by,modified_date)
						SELECT  c.is_invalid_row,c.is_duplicate_row,c.eligibility_file_staging_simplified_id,SUBSTR(v_file_type,1,1),v_file_id,c.member_record_number,c.client_id,c.member_id,c.initial_member_id,c.date_of_birth,c.member_first_name,c.member_middle_initial,c.member_last_name,c.group_id,c.eligibility_effective_date,c.eligibility_end_date,c.referral_status,c.referral_start_date,c.referral_end_date,c.relationship_code,c.coverage_code,c.coverage_effective_date,c.maintenance_code,c.subsidy_override,c.locator_id,c.program_indicator,c.billing_pass_through,c.client_pass_through,c.filler_1,c.filler_2,c.transition_id,c.data_source,v_system_source_lookup_id,c.active,c.created_by,v_date,c.modified_by,v_date
						from temp_transition_id c
							where not exists (select eligibility_file_error_row_id
									  FROM eligibility_file_error_row  USE INDEX (fk_eligibility_file_error_row_composite_idx) 
									  where eligibility_file_staging_row_id = c.eligibility_file_staging_simplified_id
										AND   lower(eligibility_file_type) = lower(SUBSTR(v_file_type,1,1)))
										;

					
					
					

					INSERT INTO eligibility_file_error_log
						(file_id,column_id,eligibility_file_error_row_id,error_code,created_by,created_date)
						SELECT c.file_id,v_column_id,c.eligibility_file_error_row_id,
						'148',c.created_by,v_date
						FROM eligibility_file_error_row c USE INDEX (fk_eligibility_file_error_row_composite_idx)  JOIN temp_transition_id t ON c.eligibility_file_staging_row_id = t.eligibility_file_staging_simplified_id
						;

					

			
				end if;		
			drop temporary table if exists temp_transition_id;

			end if;			
		
END IF;



commit;

end ;;
