CREATE DEFINER=`wwhsadmin`@`%` PROCEDURE `lt_eligibilitydata_load`(v_file_id bigint, v_data_source char(1), v_system_source_id varchar(10), v_staging_type varchar(10),v_staging_id bigint unsigned, v_eligibility_data_id bigint)
proc_label: BEGIN

