SET v_error = 'procedure eligibilityfile_member_first_name failed';
CALL eligibilityfile_member_first_name(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_member_id failed';
