CALL eligibilityfile_phone_home(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_phone_work failed';
CALL eligibilityfile_phone_work(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_state_id failed';
CALL eligibilityfile_state_id(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_suffix failed';
CALL eligibilityfile_suffix(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

