SET v_error = 'procedure eligibilityfile_validatecoveragecode failed';
CALL eligibilityfile_validatecoveragecode(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure EligibilityFile_ValidateCoverageDate failed';
CALL EligibilityFile_ValidateCoverageDate(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_validateeligenddate failed';
CALL eligibilityfile_validateeligenddate(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure eligibilityfile_validaterelationshipcode failed';
CALL lt_eligibilityfile_validaterelationshipcode(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure EligibilityFile_CCEDMismatch_Single failed';
CALL eligibilityFile_CCEDMismatch_Single(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);

SET v_error = 'procedure EligibilityFile_CCEDMismatch_File failed';
CALL eligibilityFile_CCEDMismatch_File(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id);


IF v_data_source='S' 
	THEN SELECT COUNT(*)
    INTO v_error_row_count  
	FROM eligibility_file_error_row
    WHERE eligibility_file_staging_row_id = v_staging_id
    and lower(eligibility_file_type)= lower(SUBSTR(v_staging_type,1,1));
    COMMIT;

	IF v_error_row_count>0
	THEN 
    SELECT distinct
           a.error_code,
           a.error_message
    FROM eligibility_file_error_code a
    INNER JOIN eligibility_file_error_log b
    ON a.error_code = b.error_code 
    INNER JOIN eligibility_file_error_row c
    on b.eligibility_file_error_row_id = c.eligibility_file_error_row_id
    WHERE c.eligibility_file_staging_row_id = v_staging_id
    and lower(eligibility_file_type)= lower(SUBSTR(v_staging_type,1,1));
   END if;
    
    IF v_error_row_count>0
	THEN LEAVE proc_label;
    END IF; 
    
    IF v_error_row_count=0
    THEN
    SET v_error = 'procedure eligibilitydata_create failed for UI'; 
    CALL eligibilitydata_create(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id,v_eligibility_data_id);  

	set v_error = 'procedure eligibilityfile_dependent_update failed for file';
	call eligibilityfile_dependent_update(v_file_id, v_data_source, v_system_source_id, v_staging_type,v_staging_id);

	set v_error = 'procedure eligibilityfile_terminate_dependant failed for file';
	call eligibilityfile_terminate_dependant(v_file_id, v_data_source, v_system_source_id, v_staging_type,v_staging_id);

    SET v_error = 'eligibilitydatahistory_create failed for UI';
    CALL eligibilitydatahistory_create(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id,v_eligibility_data_id); 

    COMMIT; 
	
		
		if v_eligibility_data_id is null then
			SELECT 'Record Inserted successfully';
		else
			SELECT 'Record Updated successfully';
		end if;
    END IF; 
END if;

IF v_data_source='F'
THEN
SET v_error = 'procedure eligibilitydata_create failed for file'; 
CALL eligibilitydata_create(v_file_id,v_data_source, v_system_source_id,v_staging_type,v_staging_id,v_eligibility_data_id);

