where file_id = v_file_id;
END IF;

IF(lower(v_file_type) = 'simplified' and v_data_source='S') THEN
DELETE FROM eligibility_file_staging_simplified
where eligibility_file_staging_simplified_id = v_staging_id;
END IF;
COMMIT;
end ;;
