CREATE DEFINER=`wwhsadmin`@`%` PROCEDURE `lt_eligibilityfile_validaterelationshipcode`(v_file_id bigint, v_data_source char(1), v_system_source_id varchar(10), v_staging_type varchar(10),v_staging_id bigint unsigned)
begin

DECLARE v_column_name varchar(100);
DECLARE v_column_id ,v_system_source_lookup_id bigint;
DECLARE v_file_type varchar(500);


SET v_column_name = 'relationship_code';
drop temporary table if exists temp_rc_dependents;
drop temporary table if exists check_staging;
drop temporary table if exists check_data;
drop temporary table if exists temp_rc_primary;



SELECT lookup_id
INTO v_system_source_lookup_id
FROM lookup
WHERE lookup_group = 'System Source'
AND lookup_value = v_system_source_id;

IF(v_data_source = 'F') THEN

	SET  v_column_id := fn_get_column_id(v_column_name,v_file_id,null,'P');	

	SELECT eligibility_file_type_description
	INTO v_file_type
	FROM eligibility_file_type
	WHERE eligibility_file_type_id = (SELECT eligibility_file_type_id FROM eligibility_file WHERE file_id = v_file_id);


if lower(v_file_type) = 'complete' then


		CREATE  temporary table temp_rc_primary select * from eligibility_file_staging_complete where 1=2;
		ALTER TABLE temp_rc_primary ADD INDEX trcp_idx (member_id ASC, group_id ASC, client_id ASC, account_id ASC, relationship_code ASC);

		CREATE  temporary table temp_rc_dependents as select * from eligibility_file_staging_complete where 1=2;
		ALTER table temp_rc_dependents ADD INDEX trd_idx(member_id,group_id,client_id,account_id),
					       ADD PRIMARY KEY (eligibility_file_staging_complete_id);
	
		CREATE  temporary table check_staging select * from eligibility_file_staging_complete where 1=2;
		ALTER table check_staging add primary key (eligibility_file_staging_complete_id);
		CREATE temporary table check_data select * from eligibility_file_staging_complete where 1=2;
		ALTER table check_data add primary key (eligibility_file_staging_complete_id);


		INSERT INTO temp_rc_primary select * from eligibility_file_staging_complete WHERE relationship_code ='01' AND file_id = v_file_id;

		INSERT into temp_rc_dependents select efsc.* from eligibility_file_staging_complete 	as efsc		
				left outer join
				temp_multiple_mc as tmm
				on efsc.eligibility_file_staging_complete_id = tmm.eligibility_file_staging_complete_id
					
				WHERE efsc.relationship_code in ('02','03','04') AND efsc.file_id = v_file_id
				and tmm.eligibility_file_staging_complete_id is null;

		INSERT into check_staging
		SELECT d.* from temp_rc_dependents d

		WHERE not exists (select 1 from  temp_rc_primary t  where
				  	t.member_id=d.member_id
					and t.group_id=d.group_id
					and t.client_id=d.client_id
					and t.account_id=d.account_id
					and t.relationship_code='01' limit 1);

		INSERT into check_data 
		SELECT t.* from check_staging t left outer join eligibility_data d on t.member_id=d.member_id
		and t.group_id=d.group_id
		and t.client_id=d.client_id
		and t.account_id=d.account_id
		and d.relationship_code_id='01'
		where d.eligibility_data_id is null;


		if(row_count() > 0) then

			BEGIN
			
			
			INSERT INTO eligibility_file_error_row(is_invalid_row,is_duplicate_row,eligibility_file_staging_row_id,eligibility_file_type,file_id,member_record_number,client_id,member_id,initial_member_id,date_of_birth,member_first_name,member_middle_initial,member_last_name,group_id,eligibility_effective_date,eligibility_end_date,referral_status,referral_start_date,referral_end_date,relationship_code,coverage_code,coverage_effective_date,maintenance_code,subsidy_override,gender,address_1,address_2,city,state,zipcode,email_address,phone_work,phone_home,phone_cell,locator_id,program_indicator,title,suffix,billing_pass_through,client_pass_through,filler_1,filler_2,transition_id,data_source,system_source_id,active,created_by,created_date,modified_by,modified_date)
			(SELECT  c.is_invalid_row,c.is_duplicate_row,c.eligibility_file_staging_complete_id,SUBSTR(v_file_type,1,1),v_file_id,c.member_record_number,c.client_id,c.member_id,c.initial_member_id,c.date_of_birth,c.member_first_name,c.member_middle_initial,c.member_last_name,c.group_id,c.eligibility_effective_date,c.eligibility_end_date,c.referral_status,c.referral_start_date,c.referral_end_date,c.relationship_code,c.coverage_code,c.coverage_effective_date,c.maintenance_code,c.subsidy_override,c.gender,c.address_1,c.address_2,c.city,c.state,c.zipcode,c.email_address,c.phone_work,c.phone_home,c.phone_cell,c.locator_id,c.program_indicator,c.title,c.suffix,c.billing_pass_through,c.client_pass_through,c.filler_1,c.filler_2,c.transition_id,c.data_source,v_system_source_lookup_id,c.active,c.created_by,c.created_date,c.modified_by,c.modified_date
			FROM check_data c 
			WHERE NOT EXISTS (SELECT e.eligibility_file_staging_row_id
					  FROM eligibility_file_error_row e USE INDEX (fk_eligibility_file_error_row_composite_idx) 
					  WHERE e.eligibility_file_staging_row_id = c.eligibility_file_staging_complete_id
					  AND   e.eligibility_file_type = SUBSTR(v_file_type,1,1)));
			END;


				
				BEGIN
				
			INSERT INTO eligibility_file_error_log
			(file_id,column_id,eligibility_file_error_row_id,error_code,created_by,created_date)
			SELECT c.file_id,v_column_id,c.eligibility_file_error_row_id,
			122,c.created_by,c.created_date
			FROM eligibility_file_error_row c USE INDEX (fk_eligibility_file_error_row_composite_idx)  JOIN check_data t ON c.eligibility_file_staging_row_id = t.eligibility_file_staging_complete_id;

				END;

		END IF;
END IF;


if lower(v_file_type) = 'simplified' then
		CREATE  temporary table temp_rc_primary select * from eligibility_file_staging_simplified where 1=2;
		ALTER TABLE temp_rc_primary ADD INDEX trcp_idx (member_id ASC, group_id ASC, client_id ASC, account_id ASC, relationship_code ASC);

		CREATE  temporary table temp_rc_dependents as select * from eligibility_file_staging_simplified where 1=2;
		ALTER table temp_rc_dependents ADD INDEX trd_idx(member_id,group_id,client_id,account_id),
					       ADD PRIMARY KEY (eligibility_file_staging_simplified_id);
	
		CREATE  temporary table check_staging select * from eligibility_file_staging_simplified where 1=2;
		ALTER table check_staging add primary key (eligibility_file_staging_simplified_id);
		CREATE temporary table check_data select * from eligibility_file_staging_simplified where 1=2;
		ALTER table check_data add primary key (eligibility_file_staging_simplified_id);


