DELIMITER ;;
CREATE DEFINER=`wwhsadmin`@`%` PROCEDURE `sp_eligibilitymemberterminated_select`()
BEGIN
DECLARE date_job varchar(200);
declare v_column_id, v_col_hist_id bigint;

set v_col_hist_id := 0;

select max(eligibility_data_column_history_id) into v_col_hist_id
from eligibility_data_column_history 
where column_id in 
(select column_id from eligibility_file_column where sql_column_name = 'eligibility_end_date')
;


SELECT application_property_text
INTO date_job
FROM eligibility_application_property
WHERE  application_property_name = 'Switching_Job_Run_Date_Time';

drop temporary table if exists temp_terminate_records;

create temporary table temp_terminate_records
as(
select 
distinct
ed.client_id AS Client_ID,
ed.group_id AS Group_ID,
ed.member_id AS Beneficiary_ID,
case when eligibility_end_date <= curdate() 
then eligibility_end_date else '' end AS Termination_Date,
lr.lookup_key as Relationship_Code,
lr.lookup_value as Relationship_Code_Desc,
ed.member_first_name as First_Name,
ed.member_last_name as Last_Name,
ed.date_of_birth as Date_Of_Birth,
ed.email_address as Email,
ed.zipcode as ZipCode,
case when edch.oldvalue = 1 and edch.newvalue = 0 	then 'Y' else 'N' end as Referral_Switch

FROM eligibility_data ed
inner join track_check_eligibility_service es
ON ed.eligibility_data_id=es.eligibility_data_id
left outer join
eligibility_data_column_history as edch
on 
ed.eligibility_data_id = edch.eligibility_data_id


left outer join
eligibility_data_column_history as edch_end_dt
on 
ed.eligibility_data_id = edch_end_dt.eligibility_data_id

INNER JOIN lookup lr
on ed.relationship_code_id=lr.lookup_key
and lr.lookup_group = 'RELATIONSHIP'
where ed.modified_date> date_format(trim(date_job), '%Y-%m-%d %H:%m:%s')
);

drop temporary table if exists temp_terminate_records_1;
create temporary table temp_terminate_records_1 as
select * from temp_terminate_records where 1=2
;

drop temporary table if exists temp_terminate_records_2;
create temporary table temp_terminate_records_2 as
select * from temp_terminate_records where 1=2
;

insert into temp_terminate_records_1
select * from temp_terminate_records where Referral_Switch = 'Y';

insert into temp_terminate_records_2
select * from temp_terminate_records_1;

insert into temp_terminate_records_1
select * from temp_terminate_records as ttr where Referral_Switch = 'N'
and ttr.Beneficiary_ID not in (select Beneficiary_ID from temp_terminate_records_2);


insert into temp_terminate_records_1
select 
distinct
ed.client_id AS Client_ID,
ed.group_id AS Group_ID,
ed.member_id AS Beneficiary_ID,
ed.eligibility_end_date AS Termination_Date,
lr.lookup_key as Relationship_Code,
lr.lookup_value as Relationship_Code_Desc,
ed.member_first_name as First_Name,
ed.member_last_name as Last_Name,
ed.date_of_birth as Date_Of_Birth,
ed.email_address as Email,
ed.zipcode as ZipCode,
'N' as Referral_Switch
from eligibility_data as ed
inner join track_check_eligibility_service es
ON ed.eligibility_data_id=es.eligibility_data_id
left outer join 
eligibility_data_history as edh
on 
ed.eligibility_data_id = edh.eligibility_data_id
and edh.audit_type = 'I'
INNER JOIN lookup lr
on ed.relationship_code_id=lr.lookup_key
and lr.lookup_group = 'RELATIONSHIP'
where ed.modified_date> date_format(trim(date_job), '%Y-%m-%d %H:%m:%s')
and edh.audit_type = 'I'
and ed.eligibility_end_date <= curdate()
and ed.member_id not in (select Beneficiary_ID from temp_terminate_records)
;

select count(1) into @rec_count from temp_terminate_records_1;

if (@rec_count = 0) then
select 'failure';
else
	select 'Client_ID','Group_ID','Beneficiary_ID','Termination_Date','Relationship_Code','Relationship_Code_Desc','First_Name','Last_Name','Date_Of_Birth','Email','ZipCode','Referral_Switch'
	union
	select distinct * from temp_terminate_records_1 where Referral_Switch = 'Y' or Termination_Date <> '';

end if;
end ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
/*!50003 DROP PROCEDURE IF EXISTS `Table_eligibilitydata_create` */;
/*!50003 SET @saved_cs_client      = @@character_set_client */ ;
/*!50003 SET @saved_cs_results     = @@character_set_results */ ;
/*!50003 SET @saved_col_connection = @@collation_connection */ ;
/*!50003 SET character_set_client  = utf8 */ ;
/*!50003 SET character_set_results = utf8 */ ;
/*!50003 SET collation_connection  = utf8_general_ci */ ;
/*!50003 SET @saved_sql_mode       = @@sql_mode */ ;
/*!50003 SET sql_mode              = 'NO_ENGINE_SUBSTITUTION' */ ;
DELIMITER ;;
CREATE DEFINER=`wwhsadmin`@`%` PROCEDURE `Table_eligibilitydata_create`(v_file_id bigint, v_data_source char(1), v_system_source_id varchar(10), v_staging_type varchar(10),v_staging_id bigint, v_eligibility_data_id bigint)
begin

declare v_column_name , v_column_id, v_file_type, v_file_class,v_system_source_key varchar(100);
declare v_threshold, v_threshold_breach, v_eligibility_file_type_id, v_system_source_lookup_id ,v_upd_count integer;
DECLARE v_error_cnt,v_stage_cnt BIGINT;
declare v_error varchar(200);
set v_threshold = 0;
SET v_threshold_breach = 0;

if v_file_id is not null then
	select 
	eligibility_file_type_id
	into v_eligibility_file_type_id
	from eligibility_file ef
	where
	file_id = v_file_id;

	select eligibility_file_type_description
	into v_file_type
	from eligibility_file_type
	where eligibility_file_type_id = v_eligibility_file_type_id;


SELECT CONCAT('Starting File Type ',Now()+interval 570 minute);	
select lower(lookup_value)
				into v_file_class
				from lookup l
				join eligibility_file ef
				on l.lookup_id = ef.eligibility_file_option_id
				and ef.file_id=v_file_id;


elseif v_staging_id is not null and v_staging_type = 'complete' then
	set v_eligibility_file_type_id = '1';
	
	SELECT lookup_id,lookup_key
	INTO v_system_source_lookup_id,v_system_source_key
	FROM lookup
	WHERE lookup_group = 'System Source'
	AND lookup_value = v_system_source_id;
elseif v_staging_id is not null and v_staging_type = 'simplified' then
	set v_eligibility_file_type_id = '3';
	
	SELECT lookup_id
	INTO v_system_source_lookup_id
	FROM lookup
	WHERE lookup_group = 'System Source'
	AND lookup_value = v_system_source_id;
end if;


if lower(v_file_type) = 'complete' and v_file_id is not null then
SET FOREIGN_KEY_CHECKS=0;
	
	
	set sql_safe_updates = 0;	
	update eligibility_file_staging_complete c
	inner join eligibility_file_error_row e on c.eligibility_file_staging_complete_id = e.eligibility_file_staging_row_id
	and c.file_id = e.file_id
	set c.is_invalid_row = 1
	where  e.file_id = v_file_id
	and c.file_id    = v_file_id
	and e.eligibility_file_type ='C'
	and c.eligibility_file_staging_complete_id > 0;
	set sql_safe_updates = 1;
	
	select count(1)
	into v_error_cnt
	from eligibility_file_error_row
	where file_id=v_file_id;

	
	select count(1)
	into v_stage_cnt
	from eligibility_file_staging_complete
	where file_id=v_file_id; 

	SELECT (v_error_cnt/v_stage_cnt)*100 INTO v_threshold;


	
	select 
        distinct
		evf.eligibility_file_error_threshold
		into v_threshold_breach
		from eligibility_file ef
		inner join eligibility_vendor_file evf
		on ef.account_id= evf.account_vendor_id
        and ef.eligibility_file_option_id=evf.eligibility_file_option_id
		where ef.file_id = v_file_id;

		if v_threshold > v_threshold_breach  then
		SELECT CONCAT('Starting Suspension ',Now()+interval 570 minute);				
			insert into eligibility_file_suspend
			(
			is_invalid_row,is_duplicate_row,file_id,member_record_number,client_id,member_id,initial_member_id,date_of_birth,member_first_name,member_middle_initial,member_last_name,group_id,eligibility_effective_date,eligibility_end_date,active,relationship_code,coverage_code,coverage_effective_date,maintenance_code,subsidy_override,gender,address_1,address_2,city,state,zipcode,email_address,phone_work,phone_home,phone_cell,locator_id,program_indicator,title,suffix,billing_pass_through,client_pass_through,filler_1,filler_2,transition_id,data_source,enroll,created_by,created_date,modified_by,modified_date
			)
			select
			is_invalid_row,is_duplicate_row,file_id,member_record_number,client_id,member_id,initial_member_id,date_of_birth,member_first_name,member_middle_initial,member_last_name,group_id,eligibility_effective_date,eligibility_end_date,active,relationship_code,coverage_code,coverage_effective_date,maintenance_code,subsidy_override,gender,address_1,address_2,city,state,zipcode,email_address,phone_work,phone_home,phone_cell,locator_id,program_indicator,title,suffix,billing_pass_through,client_pass_through,filler_1,filler_2,transition_id,data_source,referral_status,created_by,created_date,modified_by,modified_date
			from eligibility_file_staging_complete
